INSERT INTO `excursions` VALUES (1, 'Ruta Hemingway', 'Hemingway Route', 6, '09:00 am', '4 hours', 'Diaria', 'Daily', 7, 23.00, 30.00, '<ul class=\"icon\">\r\n<li> Recogida en el hotel</li>\r\n<li> Visita al Museo Hemingway, ubicado en el poblado de San Francisco de Paula. Recorrido por la instalación con guía especializado. Se permite la entrada de cámara fotográfica y de video.</li>\r\n<li> Continuación del viaje hasta el poblado de Cojímar, pueblo de pescadores donde Hemingway celebró su premio Pulitzer en 1953, con sus amigos y Gregorio, su capitán de barco, quien sirviera de inspiración para su novela “El Viejo y el Mar”</li>\r\n<li> Visita en tránsito a la Bodeguita del Medio y el Floridita;  Regreso al hotel.</li>\r\n</ul>', '<ul class=\"icon\">\r\n<li> Pick up at hotel</li>\r\n<li> Visit the Hemingway Museum, located in the town of San Francisco de Paula. Tour of the facility with interpretation service. Camera and video cameras are allowed.</li>\r\n<li> Continue the trip to the village of Cojimar, fishing village where Hemingway celebrated his Pulitzer Prize in 1953 with his friends and Gregorio, his captain, who served as inspiration for his novel \"The Old Man and the Sea\"</li>\r\n<li> In transit visit to the Bodeguita del Medio and Floridita Bar. Back to the hotel.</li>\r\n</ul>', '1', 1, '0', '0', '1');
INSERT INTO `excursions` VALUES (2, 'Seafari Cayo Blanco', 'Seafari Cayo Blanco', 5, '06:00 am', '10 hours', 'Diaria', 'Daily', 10, 82.00, 109.00, '<ul class=\"icon\">\r\n<li> Recogida en el hotel y traslado hacia Varadero</li>\r\n<li> Arribo a la Marina Marlin Chapelín</li>\r\n<li> Paseo en embarcación con bar abierto en la travesía</li>\r\n<li> Snorkeling en barreras de corales con equipos disponibles a bordo</li>\r\n<li> Visita a Cayo Blanco con tiempo para baño en la playa;  Animación y música en vivo</li>\r\n<li> Almuerzo en Cayo Blanco con variedad de mariscos, frutas y vegetales;  Un regalo náutico</li>\r\n<li> Regreso a la Marina y salida hacia La Habana.</li>\r\n<li> Regreso al hotel.</li>\r\n</ul>', '<ul class=\"icon\">\r\n<li> Hotel pick up and transfer to Varadero</li>\r\n<li> Arrival at the Marina Marlin Chapelín</li>\r\n<li> Boat ride with open bar on the cruise</li>\r\n<li> Snorkeling in coral reefs with equipment available on board</li>\r\n<li> Visit Cayo Blanco with time to swim at the beach; Entertainment and live music</li>\r\n<li> Lunch at Cayo Blanco with a variety of seafood, fruits and vegetables; A nautical gift</li>\r\n<li> Return to the Marina and departure to Havana.</li>\r\n<li> Back to the hotel.</li>\r\n</ul>', '0', 2, '1', '0', '1');
INSERT INTO `excursions` VALUES (3, 'Soroa', 'Soroa', 6, '08:00 am', '10 hours', 'Diaria', 'Daily', 7, 34.00, 45.00, '<ul class=\"icon\">\r\n<li> Recogida en el hotel y traslado hacia Pinar del Río</li>\r\n<li> Visita a la Fábrica de Tabaco de Candelaria, donde podrá apreciar el proceso de la torcedura del tabaco</li>\r\n<li> Arribo a Villa Soroa, donde  podrá degustar un cóctel</li>\r\n<li> Recorrido hacia la Ceiba, árbol más antiguo de esta región con más de 650 años</li>\r\n<li> Visita al Jardín Botánico Orquideario de Soroa, con variedades de orquídeas traídas de todo el mundo así como de la región, y plantas ornamentales</li>\r\n<li> Visita a los Manantiales de azufre, alegóricos a la antigua Finca San José de Manantiales</li>\r\n<li> Visita al Salto de Agua, recorrido hacia la cascada con disfrute del baño natural</li>\r\n<li> Almuerzo en el Restaurante “El Salto”</li>\r\n<li> Tiempo libre con opciones NO INCLUIDAS EN EL PRECIO: Paseo a caballo, baños minero-medicinales, masajes, visita a la casa taller del artista plástico Gastel, visita a la casa de Agapito, fundador del Orquideario y campesino de la localidad y visita al Mirador Natural de Venus, con una vista natural de toda la Sierra del Rosario a 375 metros sobre el nivel del mar.</li>\r\n</ul>', '<ul class=\"icon\">\r\n<li> Hotel pick up and transfer to Pinar del Río</li>\r\n<li> Visit the Candelaria Tobacco Factory, where you can see the process of Tobacco twisting</li>\r\n<li> Arrival at Soroa Village, where you can enjoy a cocktail</li>\r\n<li> Journey to the Ceiba tree, oldest in this region with over 650 years</li>\r\n<li> Visit Soroa Orchid Botanical Garden, with varieties of orchids brought from around the world and the region, and ornamental plants</li>\r\n<li> Visit the sulfur springs in the San José de Manantiales Hacienda.</li>\r\n<li> Visit Salto de Agua, route to the waterfall to enjoy the natural bath</li>\r\n<li> Lunch at \"El Salto\" restaurant</li>\r\n<li> Leisure options NOT INCLUDED IN THE PRICE: Horseback riding, medicinal mineral baths, massages, Visit the workshop of Gastel, local artist; visit Agapito’s home, founder of the Orchid Garden and local peasant house and visit the Mirador Natural Venus, with a natural view of the entire Sierra del Rosario at 375 meters above sea level.</li>\r\n</ul>', '0', 3, '0', '0', '1');
INSERT INTO `excursions` VALUES (4, 'Varadero', 'Varadero', 4, '06:00 am', '10 hours', 'Diaria', 'Daily', 10, 47.00, 62.00, '<ul class=\"icon\">\r\n<li> Recogida en el hotel</li>\r\n<li> Salida hacia el polo turístico de Varadero</li>\r\n<li> Disfrute de un día de playa, donde se brindan facilidades para el cambio de ropa.</li>\r\n<li> Almuerzo en restaurante local.</li>\r\n<li> Retorno a La Habana, con parada en tránsito en el Mirador de Bacunayagua, donde podrá disfrutar del maravilloso paisaje que ofrece el Valle de Yumurí</li>\r\n<li> Regreso al hotel.</li>\r\n</ul>', '<ul class=\"icon\">\r\n<li> Pick up at hotel</li>\r\n<li> Departure to Varadero beach resort</li>\r\n<li> Enjoy a day at the beach, where facilities for changing clothes are provided.</li>\r\n<li> Lunch at local restaurant.</li>\r\n<li> Return to Havana, in transit stop in Bacunayagua, where you can enjoy the wonderful scenery of the Yumurí Valley</li>\r\n<li> Back to the hotel.</li>\r\n</ul>', '0', 4, '0', '0', '1');
INSERT INTO `excursions` VALUES (5, 'Viñales', 'Viñales', 6, '07:30 am', '10 hours', 'Diaria', 'Daily', 14, 51.00, 67.00, '<ul class=\"icon\">\r\n<li> Recogida en el hotel y salida hacia Pinar del Río.</li>\r\n<li> Visita a la Fábrica de Ron “Guayabita del Pinar”.</li>\r\n<li> Paseo por el Valle de Viñales, declarado Paisaje Cultural Protegido por la UNESCO y Monumento Nacional Natural.</li>\r\n<li> Visita a la Casa del Veguero, donde podrá degustar de un coctel de bienvenida y además apreciar las plantaciones de tabaco que allí se encuentran cultivadas</li>\r\n<li> Visita al Mirador de Los Jazmines, lugar que ofrece una hermosa vista general del Valle de Viñales</li>\r\n<li> Visita a la Cueva del Indio con paseo en bote por el río que corre en su interior</li>\r\n<li> Almuerzo en un restaurante de la zona</li>\r\n<li> Visita al Mural de la Prehistoria que muestra el  proceso de evolución  de la vida en la Sierra de los Órganos, desde el molusco hasta los primeros habitantes indígenas del lugar</li>\r\n<li> Regreso al hotel.</li>\r\n<ul>', '<ul class=\"icon\">\r\n<li> Pick up at the hotel and departure to Pinar del Río.</li>\r\n<li> Visit the Rum Factory \"Guayabita del Pinar\".</li>\r\n<li> Walk through the Viñales Valley, UNESCO Cultural Protected Landscape and a National Natural Monument.</li>\r\n<li> Visit the Casa del Veguero, where you can enjoy a welcome cocktail and also appreciate tobacco plantations in the area</li>\r\n<li> Visit the Mirador de Los Jazmines, a place that offers a beautiful overview of Viñales Valley</li>\r\n<li> Visit the Cueva del Indio with boat ride on the river that runs inside</li>\r\n<li> Lunch at a local restaurant</li>\r\n<li> Visit the Prehistory Mural showing the process evolution in the Sierra de los Órganos from mollusk to the first indigenous inhabitants of the place</li>\r\n<li> Back to the hotel.</li>\r\n<ul>', '1', 5, '0', '0', '1');
INSERT INTO `excursions` VALUES (6, 'Mi Habana Colonial', 'Colonial Havana', 7, '09:00 am / 14:00 pm', '4 hours', 'Diaria', 'Daily', 10, 15.00, 20.00, '<ul class=\"icon\">\r\n<li> Recogida en el hotel</li>\r\n<li> Visita a la Habana Colonial, declarada por la UNESCO Patrimonio Cultural de la Humanidad.</li>\r\n<li> Recorrido a pie por el casco histórico, con sus plazas, fortalezas y edificios construidos por los españoles entre los siglos XVI y XIX, con oportunidades para la compra de artesanías</li>\r\n<li> Visita en tránsito a La Bodeguita del Medio y principales calles y avenidas de la Habana Vieja. Parada en el Capitolio</li>\r\n<li> Continuación del recorrido con vista panorámica de la Universidad de La Habana y parada en la Plaza de la Revolución con tiempo para fotos</li>\r\n<li> Regreso al hotel.</li>\r\n</ul>', '<ul class=\"icon\">\r\n<li> Pick up at hotel</li>\r\n<li> Visit Colonial Havana, UNESCO World Cultural Heritage Site.</li>\r\n<li> Walking tour of the historic town with its squares, fortresses and buildings built by the Spaniards between the sixteenth and nineteenth centuries, with opportunities for purchasing crafts</li>\r\n<li> In transit visit to La Bodeguita del Medio and the main streets and avenues in Old Havana. Stop at the Capitol</li>\r\n<li> Continue the tour with a panoramic view of the University of Havana and stop at the Revolution Square. Time for photos</li>\r\n<li> Back to the hotel.</li>\r\n</ul>', '1', 6, '0', '1', '1');
