INSERT INTO `hotels` VALUES (1, 'NH Capri', 8, 'Este elegante hotel torre se encuentra a 6 minutos a pie de la oferta de ocio nocturno del distrito de Vedado, a 1 km del animado paseo marítimo Malecón y a 3 km de los espectáculos de ballet del Gran Teatro de la Habana. Ideal para hombres de negocio.\r\n', 'The NH Capri La Habana is in Vedado in downtown Havana. The area is close to well-known nightclubs, La Rampa art and craft market and the famous Malecón – plus it’s a short taxi ride to some of the city’s top sights. ( * less than 10 minutes’ drive to Plaza de la Revolución, * around 30 minutes’ walk to Capitolia Nacional, * near the Malecón, with pastel-coloured houses lining the waterfront)\r\n', 4, 'La Habana', '0', 1, '1', '0', '1', '0', '23.1421752', '-82.3847848');
INSERT INTO `hotels` VALUES (2, 'Tryp Habana Libre', 5, 'El Hotel Habana Libre, se alza majestuosamente en el centro neurálgico de La Rampa, Vedado, una de las esquinas más afamadas del centro de la capital cubana a unos pocos pasos de la popular Coppelia (Catedral del Helado). Con 570 habitaciones, distribuida', 'The Hotel Habana Libre is one of the more emblematic of Havana City; it’s located in 23 and L streets, Vedado, a few meters from the Malecón. This hotel is a jewel of the urban design and boasts the best view in Havana City.It has 570 rooms distributed by', 4, 'La Habana', '0', 2, '0', '0', '1', '0', '23.1393329', '-82.3844217');
INSERT INTO `hotels` VALUES (3, 'H10 Habana Panorama', 6, 'De construcción moderna y situado cerca del mar y a sólo 15 minutos en coche del centro de la ciudad, el hotel Panorama cuenta con 317 habitaciones, un Piano bar con hermosas vistas panorámicas y varios restaurantes de cocina italiana e internacional. Su localización frente al Centro de Negocios Miramar Trade Center le otorga además una característica única para viajes de negocios o empresarios.\r\n', 'This modern hotel is situated near the sea and just 15 minutes drive from the city center. The hotel offers 317 air-conditioned rooms with own bathroom. The guests can use a swimming pool, a children´s pool, a beauty salon, internet cafes, currency exchange, conference, business and wellness center. Piano Bar with a panoramic view offers its guests jazz evenings. The hotel offers several restaurants serving Italian and international menus. The hotel has secure parking and bus to the center, free of charge.', 4, 'La Habana', '0', 3, '0', '0', '1', '0', '23.1117897', '-82.439577');
