INSERT INTO `hotels` VALUES (12, 'Club Atlántico Guardalavaca', 4, 'Ubicado en primera línea de Playa y a pocos Km del lugar donde por primera vez en tierra cubana pusiera sus pies el Almirante Cristóbal Colón, el Hotel Club Atlántico Guardalavaca es ideal para vacaciones en Familia, Incentivos, Bodas y Lunas de Miel. Consta de 747 habitaciones y opera bajo el sistema de Todo Incluido.', 'Located on the beachfront and a few kilometers from the place where Christopher Columbus set foot for the first time on Cuban soil, the Atlantic Club Hotel Guardalavaca is ideal for family holidays, incentives, weddings and honeymoons. It consists of 747 rooms and operates under the All-Inclusive system.', 3, 'Holguín', '1', 4, '0', '1', '1', '0', '21.12271', '-75.8382487');
INSERT INTO `hotels` VALUES (13, 'Brisas Guardalavaca', 5, 'Ubicado en primera línea de playa, resort que opera bajo la modalidad de Todo Incluido, es el lugar ideal para el disfrute de unas vacaciones en familia. Sitio de excelencia para la celebración de bodas, lunas de miel y renovación de votos, con una amplia gama de servicios y diversidad de ofertas.', 'Located on the beachfront, this resort operates under the modality of All-Inclusive and is ideal to enjoy a family holiday. A place of excellence for weddings, honeymoons and vows renewal, with a wide range of services and diversity of offerings.', 4, 'Holguín', '1', 5, '0', '1', '1', '0', '21.125005', '-75.8310776');
INSERT INTO `hotels` VALUES (14, 'Playa Costa Verde', 5, 'El Hotel Playa Costa Verde es el mejor lugar para solteros, matrimonios y también para toda la familia. Situado en Playa Pesquero, rodeada de exhuberante vegetación tropical\r\nEl hotel Playa Costa Verde es uno de los emplazamientos más estratégicos para pasar unas vacaciones en la isla cubana.\r\n', 'Hotel Playa Costa Verde is the best place for singles, couples and also for the whole family. Located in Playa Pesquero, surrounded by lush tropical vegetation. The Costa Verde Beach is one of the most strategic locations for a holiday on the Cuban island.', 4, 'Holguín', '1', 6, '0', '1', '1', '0', '21.1028261', '-75.9319296');
INSERT INTO `hotels` VALUES (15, 'Iberostar Bella Vista', 6, '<p>El hotel IBEROSTAR Bella Vista es la respuesta a los que buscan el paraíso. Un resort 5 estrellas de lujo al pie de la playa de Varadero diseñado para familias y parejas que saben elegir lo mejor. Siempre. ¡Bienvenido al lugar en el que serás el protagonista de mil y una aventuras de ensueño!<p>\r\n<p>En sus 827 habitaciones encuentras paz y quietud, ofreciendo un auténtico oasis de relajación donde usted podrá disfrutar sus vacaciones a plenitud. Familiares, Solo para Adultos, con vistas al mar… Todas están llenas de detalles y ofrecen espacios amplios, luminosos y bien equipados.</p>\r\n<p>Este hotel cuenta con amplios jardines con vegetación tropical, 4 piscinas, restaurantes de la alta cocina y variadas opciones de entretenimiento para todos los gustos y edades.</p>\r\n<p>Apúntate a su régimen de alojamiento Todo Incluido en Varadero y disfruta sin límites de la mejor gastronomía, de bebidas de primeras marcas y de actividades para todos los gustos.</p>\r\n', '<p>The IBEROSTAR Bella Vista hotel is the right choice for those looking for a paradise. A luxury resort on the beachfront of Varadero, perfect for families and couples who know how to choose the best. Always. Welcome to the place where you play the lead in thousands of dream adventures!\r\nIn its 827 rooms, you will find peace and quietness, offering a peaceful oasis where you can enjoy your vacation to its fullest. Family, Adults Only, overlooking the sea ... All are full of detail and offer spacious, bright and well-equipped areas.</p>\r\n\r\n<p>This hotel has large gardens with tropical vegetation, 4 swimming pools, haute cuisine restaurants and several entertainment options for all tastes and ages.<p>\r\n\r\n<p>Join an All-Inclusive accommodation in Varadero and enjoy without limits the finest cuisine, drinks of the finest brands and activities for everyone.</p>\r\n\r\n', 4, 'Varadero', '0', 7, '1', '0', '1', '0', '23.1783056', '-81.19958333333334');
