INSERT INTO `hotels` VALUES (18, 'Dhawa Cayo Santa María', 6, 'Novedoso, atractivo y coqueto, Dhawa es la cuarta marca de Banyan Tree Hotels & Resorts y Dhawa Cayo Santa María representa la primera incursión del grupo en Cuba. Dhawa Cayo Santa María será el primero y único hotel de concepto estilo de vida, en este destino. Ideal para las vacaciones en familia, parejas y estadías de grupos, cuenta con lo mejor en diversión, actividades excitantes, excelentes oportunidades de esparcimiento y opciones culinarias gourmet, con las más finas atenciones y servicio esmerado.', 'Novedoso, atractivo y coqueto, Dhawa es la cuarta marca de Banyan Tree Hotels & Resorts y Dhawa Cayo Santa María representa la primera incursión del grupo en Cuba. Dhawa Cayo Santa María será el primero y único hotel de concepto estilo de vida, en este destino. Ideal para las vacaciones en familia, parejas y estadías de grupos, cuenta con lo mejor en diversión, actividades excitantes, excelentes oportunidades de esparcimiento y opciones culinarias gourmet, con las más finas atenciones y servicio esmerado.', 4, 'Villa Clara', '0', 11, '0', '1', '1', '0', '22.635122', '-79.151776');
INSERT INTO `hotels` VALUES (19, 'Mercure Sevilla', 6, 'El Mercure Sevilla, categoría 4* está muy bien situado, a menos de 200 metros del Museo de Bellas Artes, a 5 minutos a pie de la plaza principal de La Habana, se encuentra a pocos metros del Museo de la Revolución y a 21 km del Aeropuerto Internacional José Martí. El Mercure Sevilla es perfecto para viajes de negocios.\r\nEl hotel cuenta con piscina, solárium y centro de fitness. Las habitaciones incluyen aire acondicionado, TV vía satélite, teléfono, escritorio, caja fuerte y baño con bañera, ducha y secador de pelo.\r\nLos huéspedes pueden disfrutar de una gran variedad de platos en el restaurante del establecimiento y de cócteles en el bar. También hay servicio de masajes, disponible por un suplemento.', 'El Mercure Sevilla, categoría 4* está muy bien situado, a menos de 200 metros del Museo de Bellas Artes, a 5 minutos a pie de la plaza principal de La Habana, se encuentra a pocos metros del Museo de la Revolución y a 21 km del Aeropuerto Internacional José Martí. El Mercure Sevilla es perfecto para viajes de negocios.\r\nEl hotel cuenta con piscina, solárium y centro de fitness. Las habitaciones incluyen aire acondicionado, TV vía satélite, teléfono, escritorio, caja fuerte y baño con bañera, ducha y secador de pelo.\r\nLos huéspedes pueden disfrutar de una gran variedad de platos en el restaurante del establecimiento y de cócteles en el bar. También hay servicio de masajes, disponible por un suplemento.', 4, 'La Habana', '0', 12, '0', '0', '1', '0', '23.1403008', '-82.3603928');
INSERT INTO `hotels` VALUES (20, 'Punta Arena', 4, 'El Hotel Puntarena, categoría 4*, se encuentra localizado a la entrada de la playa de Varadero. Este hotel ofrece una de las mejores vistas panorámicas de Varadero, una gran opción para aquellos que buscan una escapada cubana en un hotel económico, pensado principalmente para viajes en familia.\r\n\r\nCon 255 cómodas habitaciones, el hotel cuenta con: sala de juegos, billar, bicicletas, mini golf, botes acuáticos, catamaranes, clases de danza, casa club, discoteca y muchas otras atractivas ofertas.', 'El Hotel Puntarena, categoría 4*, se encuentra localizado a la entrada de la playa de Varadero. Este hotel ofrece una de las mejores vistas panorámicas de Varadero, una gran opción para aquellos que buscan una escapada cubana en un hotel económico, pensado principalmente para viajes en familia.\r\n\r\nCon 255 cómodas habitaciones, el hotel cuenta con: sala de juegos, billar, bicicletas, mini golf, botes acuáticos, catamaranes, clases de danza, casa club, discoteca y muchas otras atractivas ofertas.', 4, 'Varadero', '0', 13, '0', '0', '1', '0', '23.1320924', '-81.3082506');
INSERT INTO `hotels` VALUES (21, 'Playa Caleta', 5, 'El Hotel Playa Caleta, categoría 4* se encuentra localizado a solo 5 minutos del centro de la ciudad de Varadero, en Cuba. Frente el canal de Paso Malo, a unos 30 minutos en coche de la ciudad de Matanzas. El Aeropuerto Internacional de Varadero queda a 25 minutos en coche.\r\n\r\nDispone de habitaciones completamente equipadas con TV vía satélite, aire acondicionado, teléfono, caja de seguridad de alquiler, minibar, agua fría y caliente, baño privado con secador de pelo y toallas. Están climatizadas para poder soportar mejor el caluroso clima caribeño, garantizandole a nuestros huéspedes unas vacaciones de ensueño. \r\n\r\nLas habitaciones son de diferente tamaño según sean tus necesidades y preferencias y ofrecen balcón con vistas, ya sea al mar o a los jardines del complejo. Están repartidas en un edificio de 7 plantas que queda en primera línea de playa.', 'El Hotel Playa Caleta, categoría 4* se encuentra localizado a solo 5 minutos del centro de la ciudad de Varadero, en Cuba. Frente el canal de Paso Malo, a unos 30 minutos en coche de la ciudad de Matanzas. El Aeropuerto Internacional de Varadero queda a 25 minutos en coche.\r\n\r\nDispone de habitaciones completamente equipadas con TV vía satélite, aire acondicionado, teléfono, caja de seguridad de alquiler, minibar, agua fría y caliente, baño privado con secador de pelo y toallas. Están climatizadas para poder soportar mejor el caluroso clima caribeño, garantizandole a nuestros huéspedes unas vacaciones de ensueño. \r\n\r\nLas habitaciones son de diferente tamaño según sean tus necesidades y preferencias y ofrecen balcón con vistas, ya sea al mar o a los jardines del complejo. Están repartidas en un edificio de 7 plantas que queda en primera línea de playa.', 4, 'Varadero', '0', 14, '0', '0', '1', '0', '23.1320924', '-81.3082506');
INSERT INTO `hotels` VALUES (24, 'Pullman Cayo Coco', 6, 'Pullman Cayo Coco, resort todo Incluido categoría 5*, ubicado en un exótico paraíso tropical, entre una laguna costera natural y una extensa sección de playas de arena blanca. \r\n\r\nEn las cristalinas aguas de las playas de Cayo Coco podrás disfrutar del buceo y la pesca. Se ofrecen además actividades ecoturísticas como la observación de aves. \r\nEl hotel Pullman Cayo Coco está especialmente recomendado para familias y la realización de Bodas y Lunas de Miel, Reuniones y Eventos. Cuenta con un magnífico y relajante Spa, varios restaurantes que se destacan por la especialización de sus platos, Club infantil con servicio de babysitting, gimnasio y cafetería abierta las 24 horas.\r\nEn las noches, el hotel Pullman Cayo Coco ofrece a sus huéspedes atractivos actividades y espectáculos que harán el disfrute de los gustos más exigentes.', 'Pullman Cayo Coco resort,todo Incluido 5*,ubicado en un exôtico paraîso tropical,entre una laguna costera natural y una extensa seccion de playas de arena blanca.\r\nEn las cristalinas aguas de las playas de Cayo Coco podrâs disfrutar del buceo y la pesca.Se ofrecen adêmas actividades ecoturisticas como la observaciôn de aves.\r\n\r\nEl hotel Pullman Cayo Coco está especialmente recomendado para familias y la realizaciôn de Bodas y Lunas de Miel, Reuniones y Eventos.Cuenta con un magnifico y relajante Spa,varios restaurantes que se destacan por la especializacion de sus platos ,Club infantil con servicio de babysitting,gimnasio y cafeteria abierta las 24 horas.\r\n\r\nEn las noches,el hotel Pullman Cayo Coco ofrece a sus huêspedes atractivos actividades y espectâculos que harân el disfrute de los gustos mâs exigentes.', 5, 'Ciego de Ávila', '0', 15, '0', '0', '1', '0', '22.5329429', '-78.3507264');
INSERT INTO `hotels` VALUES (25, 'Meliá Cohíba', 6, 'El Hotel Meliá Cohíba ubicado en zona residencial de La Habana le ofrece a sus huéspedes una opción genial para aquellos interesados en la cultura alternativa, el jazz y pasear.\r\nElegante y suntuoso, el Hotel Meliá Cohíba, categoría 5* se localiza a la orilla del Malecón y muy cerca del Centro Histórico de La Habana. El lujoso confort de su sección THE LEVEL y la bohemia de su sala de fiestas Habana Café, con espectáculos en vivo, marcan la diferencia. \r\nRecomendado para viajes de negocios, incentivos, bodas y lunas de miel.', 'El Hotel Meliá Cohíba ubicado en zona residencial de La Habana le ofrece a sus huéspedes una opción genial para aquellos interesados en la cultura alternativa, el jazz y pasear.\r\n Elegante y suntuoso, el Hotel Meliá Cohíba, categoría 5* se localiza a la orilla del Malecón y muy cerca del Centro Histórico de La Habana. El lujoso confort de su sección THE LEVEL y la bohemia de su sala de fiestas Habana Café, con espectáculos en vivo, marcan la diferencia. \r\nRecomendado para viajes de negocios, incentivos, bodas y lunas de miel.', 5, 'La Habana', '0', 16, '0', '0', '1', '0', '23.1397237', '-82.4049872');
INSERT INTO `hotels` VALUES (26, 'Meliá Habana', 8, 'El Majestuoso Hotel Meliá Habana, rodeado de jardines tropicales y con la mayor piscina del país, es una referencia entre los hoteles de negocios y anfitrión de grandes personalidades. \r\nCon terrazas con bellas vistas al jardín o la piscina, y dotadas de todo tipo de comodidades, las 146 habitaciones Clásicas del Hotel Meliá Habana están especialmente diseñadas para el disfrute de una placentera estancia y equipadas con todos los detalles necesarios para ello.\r\n', 'El Majestuoso Hotel Meliá Habana, rodeado de jardines tropicales y con la mayor piscina del país, es una referencia entre los hoteles de negocios y anfitrión de grandes personalidades. \r\nCon terrazas con bellas vistas al jardín o la piscina, y dotadas de todo tipo de comodidades, las 146 habitaciones Clásicas del Hotel Meliá Habana están especialmente diseñadas para el disfrute de una placentera estancia y equipadas con todos los detalles necesarios para ello.', 5, 'La Habana', '0', 17, '0', '0', '1', '0', '23.1397198', '-82.4378182');
INSERT INTO `hotels` VALUES (27, 'Meliá Las Américas', 10, 'El Hotel Melia las Americas, ubicado en Varadero, es un resort de lujo, solo para mayores de 18 años. El hotel cuenta con bañera de hidromasaje, 4 piscinas, sauna, centro de fitness y servicio de recepción 24 horas.\r\n\r\nLas habitaciones del Hotel Meliá las Américas están perfectamente equipadas brindándole a los huéspedes una zona de confort y descanso.\r\n\r\nEl hotel Meliá las Américas cuenta con tienda de regalos y peluquería.  Los huéspedes pueden disfrutar de comida japonesa, platos internacionales, mariscos y carnes en cualquiera de  sus 5 restaurantes temáticos, además de bebidas en uno de los 6 bares.\r\n\r\nEl complejo pone a disposición de sus huéspedes instalaciones para practicar deportes acuáticos y servicio de alquiler de coches. Se puede jugar al ping pong y al billar en el complejo, y la zona es ideal para practicar golf.\r\n', 'El Hotel Melia las Americas, ubicado en Varadero, es un resort de lujo, solo para mayores de 18 años. El hotel cuenta con bañera de hidromasaje, 4 piscinas, sauna, centro de fitness y servicio de recepción 24 horas.\r\n\r\nLas habitaciones del Hotel Meliá las Américas están perfectamente equipadas brindándole a los huéspedes una zona de confort y descanso.\r\n\r\nEl hotel Meliá las Américas cuenta con tienda de regalos y peluquería.  Los huéspedes pueden disfrutar de comida japonesa, platos internacionales, mariscos y carnes en cualquiera de  sus 5 restaurantes temáticos, además de bebidas en uno de los 6 bares.\r\n\r\nEl complejo pone a disposición de sus huéspedes instalaciones para practicar deportes acuáticos y servicio de alquiler de coches. Se puede jugar al ping pong y al billar en el complejo, y la zona es ideal para practicar golf.\r\n', 5, 'Varadero', '0', 18, '0', '0', '1', '0', '23.1809265', '-81.2115392');
INSERT INTO `hotels` VALUES (28, 'Meliá Varadero', 7, 'En una de las más hermosas playas de Varadero, Cuba, se encuentra el hotel 5 Estrellas Meliá Varadero, con 490 habitaciones, para el disfrute de sus viajes de vacaciones o negocios. \r\n\r\nSus habitaciones, finamente decoradas con gusto exquisito y moderno mobiliario, ofrecen una ubicación privilegiada muy cerca de la playa, con preciosas vistas al jardín o piscina, Sus caribeños colores, tanto interiores como exteriores, enfatizan su entorno tropical regodeado en un ambiente apacible y relajante.  Cuentan con todas las comodidades necesarias para descansar y no preocuparse por nada; garantizándote una formidable estadía.\r\nEl hotel ofrece recepción 24 horas, servicio de guardería, peluquería y tienda de regalos.\r\nSe ofrece un servicio de alquiler de coches y de préstamo de bicicletas en el complejo y la zona es ideal para jugar al golf y montar a caballo.\r\n\r\nEl hotel se encuentra localizado junto al Centro Comercial y de Convenciones Plaza América, y próximo al Varadero Golf Club. Además, forma parte del complejo Las Américas Resort de Sol Meliá Cuba en Varadero. Recomendado para golfistas, Eventos e Incentivos y Bodas y Lunas de Miel.', 'En una de las más hermosas playas de Varadero, Cuba, se encuentra el hotel 5 Estrellas Meliá Varadero, con 490 habitaciones, para el disfrute de sus viajes de vacaciones o negocios. \r\n\r\nSus habitaciones, finamente decoradas con gusto exquisito y moderno mobiliario, ofrecen una ubicación privilegiada muy cerca de la playa, con preciosas vistas al jardín o piscina, Sus caribeños colores, tanto interiores como exteriores, enfatizan su entorno tropical regodeado en un ambiente apacible y relajante.  Cuentan con todas las comodidades necesarias para descansar y no preocuparse por nada; garantizándote una formidable estadía.\r\n\r\nEl hotel ofrece recepción 24 horas, servicio de guardería, peluquería y tienda de regalos.\r\nSe ofrece un servicio de alquiler de coches y de préstamo de bicicletas en el complejo y la zona es ideal para jugar al golf y montar a caballo.\r\n\r\nEl hotel se encuentra localizado junto al Centro Comercial y de Convenciones Plaza América, y próximo al Varadero Golf Club. Además, forma parte del complejo Las Américas Resort de Sol Meliá Cuba en Varadero. Recomendado para golfistas, Eventos e Incentivos y Bodas y Lunas de Miel.\r\n', 5, 'Varadero', '0', 19, '0', '0', '1', '0', '23.1859469', '-81.2067256');
INSERT INTO `hotels` VALUES (29, 'Meliá Península Varadero', 8, 'El Hotel Meliá Península Varadero, categoría 5*, se encuentra ubicado en la famosa playa de Varadero, una de las más bellas del mundo y polo turístico por excelencia de Cuba. Acompañado de un delicado entorno tropical y cerca del Centro Comercial y de Convenciones Plaza América y del Varadero Golf Club, es ideal para familias, Eventos e Incentivos y Lunas de Miel.\r\nEl hotel cuenta con 7 restaurantes, entre ellos uno infantil, y varios bares. Los huéspedes también pueden disfrutar de servicio de peluquería, cancha de tenis, dardos, servicio de alquiler de autos y recepción 24 horas. \r\nEl hotel Meliá Península Varadero se encuentra ubicado en una zona ideal para la práctica de snorkel.', 'El Hotel Meliá Península Varadero, categoría 5*, se encuentra ubicado en la famosa playa de Varadero, una de las más bellas del mundo y polo turístico por excelencia de Cuba. Acompañado de un delicado entorno tropical y cerca del Centro Comercial y de Convenciones Plaza América y del Varadero Golf Club, es ideal para familias, Eventos e Incentivos y Lunas de Miel.\r\nEl hotel cuenta con 7 restaurantes, entre ellos uno infantil, y varios bares. Los huéspedes también pueden disfrutar de servicio de peluquería, cancha de tenis, dardos, servicio de alquiler de autos y recepción 24 horas. \r\nEl hotel Meliá Península Varadero se encuentra ubicado en una zona ideal para la práctica de snorkel.', 5, 'Varadero', '0', 20, '0', '0', '1', '0', '23.1991067', '-81.1397414');
INSERT INTO `hotels` VALUES (30, 'Paradisus Varadero', 8, 'El hotel Paradisus Varadero resort 5 Estrellas Ultra Todo Incluido, ubicado en primera línea de playa dentro de la reserva ecológica de Varadero. La elegancia privilegia este encantador ambiente de privacidad, en particular sus secciones exclusivas Royal Service (Solo Adultos) y Family Concierge.\r\nRecomendado para familias, bodas, lunas de miel, incentivos y wellness/spa.\r\nEl Paradisus Varadero alberga 8 restaurantes y sirve desde un buffet hasta comida italiana, mexicana y japonesa, pasando por platos de fusión cubano-asiáticos.\r\nLa recepción está abierta las 24 horas y se ofrece servicio de guardería, parque infantil y peluquería. El hotel tiene zona de playa privada, instalaciones para practicar deportes acuáticos y servicio de préstamo de bicicletas. Este establecimiento cuenta con pista de tenis y mesas de ping pong y de billar. También ofrece servicio de alquiler de coches.\r\n', 'El hotel Paradisus Varadero resort 5 Estrellas Ultra Todo Incluido,ubicado en primera lÎnea de playa dentro de la reserva ecolôgica de Varadero .La elegancia privilegia este encantador ambiente de privacidad ,en particular secciones exclusivas Royal Service (Solo Adultos) y FamilyConcierge. Recomendado para familias,bodas,lunas de miel,incentivos y wellness/spa.\r\n\r\nEl Paradisus Varadero alberga 8 restaurantes y sirve desde un buffet hasta comida italiana,mexicana y japonesa,pasando por platos de fusiôn cubano-asiâticos.\r\n\r\nLa recepciôn estâ abierta las 24 horas y se ofrece servicio de guarderîa,parque infantil y peluquerîa.El hotel tiene zona de playa privada,instalaciones para practicar deportes acuâticos y servicio de prêstamo de bicicletas. Este establecimiento cuenta con pistas de tenis y mesas de ping pong y de billar. Tambiên ofrece servicio de alquiler de coches. ', 5, 'Varadero', '0', 21, '0', '0', '1', '0', '23.1996368', '-81.1585047');
INSERT INTO `hotels` VALUES (31, 'Sol Sirenas Coral', 6, 'Hotel Sol Sirenas Coral Resort Todo Incluido 4 Estrellas, ubicado privilegiadamente frente al mar en la playa de Varadero. Complejo hotelero rodeado por jardines tropicales que propician un ambiente acogedor. Sobresale por su excelente animación y opciones de entretenimiento. Recomendado para familias que viajan con niños.\r\nLas habitaciones del Hotel Sol Sirenas Coral regalan una perfecta combinación de confort, elegancia y privacidad. Perfectamente equipadas con Aire acondicionado, TV Satélite, CD-DVD player, las habitaciones poseen espacios comunicados, balcón con vistas al mar o al jardín. \r\n', 'Hotel Sol Sirenas Coral Resort Todo Incluido 4 Estrellas, ubicado privilegiadamente frente al mar en la playa de Varadero. Complejo hotelero rodeado por jardines tropicales que propician un ambiente acogedor. Sobresale por su excelente animación y opciones de entretenimiento. Recomendado para familias que viajan con niños.\r\nLas habitaciones del Hotel Sol Sirenas Coral regalan una perfecta combinación de confort, elegancia y privacidad. Perfectamente equipadas con Aire acondicionado, TV Satélite, CD-DVD player, las habitaciones poseen espacios comunicados, balcón con vistas al mar o al jardín. ', 4, 'Varadero', '0', 22, '0', '0', '1', '0', '23.1618868', '-81.2356565');
INSERT INTO `hotels` VALUES (32, 'Paradisus Princesa del Mar', 7, 'Incomparable, excepcional y privado son alguna de las opiniones de El hotel Paradisus Princesa del Mar Resort & Spa, categoría 5 Estrellas Ultra Todo Incluido, concebido Solo para Adultos mayores de 18 años y ubicado en una de las mejores zonas de playa de Varadero. Un encantador ambiente de acogedores paisajes y atmósferas románticas. Máximo confort en su íntimo Royal Service para una experiencia irrepetible. Recomendado para bodas, lunas de miel, incentivos y wellness/spa.\r\nEl hotel cuenta con un total de 434 habitaciones con todo lujo de detalles: preciosas suites y suites júnior equipadas con el máximo confort, amplia oferta gastronómica y de recreo, salones para reuniones y conferencias, en conjunción con el entorno de sobrio refinamiento y servicio de excelencia. Descubra el encanto de este complejo, ideal para incentivos, parejas, bodas y lunas de miel.\r\n', 'Incomparable, excepcional y privado son alguna de las opiniones de El hotel Paradisus Princesa del Mar Resort & Spa, categoría 5 Estrellas Ultra Todo Incluido, concebido Solo para Adultos mayores de 18 años y ubicado en una de las mejores zonas de playa de Varadero. Un encantador ambiente de acogedores paisajes y atmósferas románticas. Máximo confort en su íntimo Royal Service para una experiencia irrepetible. Recomendado para bodas, lunas de miel, incentivos y wellness/spa.\r\nEl hotel cuenta con un total de 434 habitaciones con todo lujo de detalles: preciosas suites y suites júnior equipadas con el máximo confort, amplia oferta gastronómica y de recreo, salones para reuniones y conferencias, en conjunción con el entorno de sobrio refinamiento y servicio de excelencia. Descubra el encanto de este complejo, ideal para incentivos, parejas, bodas y lunas de miel.\r\n', 5, 'Varadero', '0', 23, '0', '0', '1', '0', '23.1982293', '-81.1311947');
INSERT INTO `hotels` VALUES (33, 'Meliá Marina Varadero', 7, 'El Hotel Meliá Marina Varadero, resort de playa categoría Cinco Estrellas, le regala a todos sus huéspedes las comodidades necesarias para combinar largas estancias en tierra con vida a bordo, es ideal para yatistas, buceo y pesca, y para reuniones & eventos, familias, bodas y lunas de miel, spa & wellness.\r\nIntegrado a un paseo marítimo comercial y un proyecto de Marina deportiva con capacidad para 1200 atraques y 13 pontones de amarre, el hotel ofrece en sus 40 900 m2 de área total, 423 lujosas habitaciones tipo estándar y suites ambientadas con motivos náuticos y con las más espléndidas vistas a la Marina Gaviota Varadero y la Península de Hicacos.\r\nLa gastronomía ofrece 9 restaurantes y cafeterías y 8 bares combinan propuestas de cocina internacional como la italiana o la francesa, con la cocina y coctelería locales y por supuesto, con los maridajes entre rones y tabacos cubanos, especialidad de la casa. Completan la oferta el YHI Spa, el club infantil y la mayor Área de Convenciones de Varadero con servicio de salones y banquetes.\r\nEl edificio principal, de 7 pisos, alberga en sus niveles superiores la Planta The Level: un área exclusiva cuyos ocupantes reciben servicio diferenciado y altamente personalizado.\r\n', 'El Hotel Meliá Marina Varadero, resort de playa categoría Cinco Estrellas, le regala a todos sus huéspedes las comodidades necesarias para combinar largas estancias en tierra con vida a bordo, es ideal para yatistas, buceo y pesca, y para reuniones & eventos, familias, bodas y lunas de miel, spa & wellness.\r\nIntegrado a un paseo marítimo comercial y un proyecto de Marina deportiva con capacidad para 1200 atraques y 13 pontones de amarre, el hotel ofrece en sus 40 900 m2 de área total, 423 lujosas habitaciones tipo estándar y suites ambientadas con motivos náuticos y con las más espléndidas vistas a la Marina Gaviota Varadero y la Península de Hicacos.\r\nLa gastronomía ofrece 9 restaurantes y cafeterías y 8 bares combinan propuestas de cocina internacional como la italiana o la francesa, con la cocina y coctelería locales y por supuesto, con los maridajes entre rones y tabacos cubanos, especialidad de la casa. Completan la oferta el YHI Spa, el club infantil y la mayor Área de Convenciones de Varadero con servicio de salones y banquetes.\r\nEl edificio principal, de 7 pisos, alberga en sus niveles superiores la Planta The Level: un área exclusiva cuyos ocupantes reciben servicio diferenciado y altamente personalizado.\r\n', 5, 'Varadero', '0', 24, '0', '0', '1', '0', '23.1953694', '-81.1320215');
INSERT INTO `hotels` VALUES (34, 'Sol Cayo Coco', 6, 'Cercano a la segunda mayor barrera coralina del mundo se encuentra localizado el Hotel Sol Cayo Coco resort Todo Incluido 4 Estrellas, ubicado en Cayo Coco, en primera línea de mar, con acceso a dos playas tan diferentes como acogedoras. El hotel, rodeado por jardines y palmeras, debe su nombre al ave ibis del bosque o coco, que también da nombre al cayo. Recomendado especialmente para disfrutar vacaciones en familia, la náutica, la pesca, el buceo y, por supuesto, la observación de aves.\r\nTodas las habitaciones del Hotel Sol Cayo Coco, perfectamente equipadas, incluyen aire acondicionado, TV y baño con artículos de aseo gratuitos y secador de pelo. Algunas habitaciones disponen de zona de estar y otras gozan de vistas al mar o al jardín.\r\nEl establecimiento alberga una tienda de regalos, 6 bares y 3 restaurantes que sirven menús a la carta y platos de buffet.\r\nEl establecimiento tiene una pista tenis y se encuentra en una zona ideal para montar a caballo.\r\n', 'Cercano a la segunda mayor barrera coralina del mundo se encuentra localizado el Hotel Sol Cayo Coco resort Todo Incluido 4 Estrellas, ubicado en Cayo Coco, en primera línea de mar, con acceso a dos playas tan diferentes como acogedoras. El hotel, rodeado por jardines y palmeras, debe su nombre al ave ibis del bosque o coco, que también da nombre al cayo. Recomendado especialmente para disfrutar vacaciones en familia, la náutica, la pesca, el buceo y, por supuesto, la observación de aves.\r\nTodas las habitaciones del Hotel Sol Cayo Coco, perfectamente equipadas, incluyen aire acondicionado, TV y baño con artículos de aseo gratuitos y secador de pelo. Algunas habitaciones disponen de zona de estar y otras gozan de vistas al mar o al jardín.\r\nEl establecimiento alberga una tienda de regalos, 6 bares y 3 restaurantes que sirven menús a la carta y platos de buffet.\r\nEl establecimiento tiene una pista tenis y se encuentra en una zona ideal para montar a caballo.\r\n', 5, 'Ciego de Ávila', '0', 25, '0', '0', '1', '0', '22.4816868', '-78.6260266');
INSERT INTO `hotels` VALUES (35, 'Tryp Cayo Coco', 5, 'Tryp Cayo Coco, Hotel 4 Estrellas Todo Incluido, construido en los cayos vírgenes del centro de Cuba y situado entre una laguna natural y una extensa franja de playa. Pensado principalmente para familias, amantes del buceo, de la pesca y otras actividades. Resalta por su variado y excelente servicio gastronómico, además de su programa de animación diurna y nocturna.\r\nLas habitaciones tienen TV por cable y baño privado con secador de pelo y artículos de aseo gratuitos. Algunas habitaciones incluyen zona de estar. El hotel ofrece recepción 24 horas, servicio de guardería, peluquería y tienda de regalos.\r\nEl hotel Tryp Cayo Coco se encuentra enclavado en una zona ideal para practicar snorkel y buceo. El establecimiento ofrece bicicletas de uso gratuito y dispone de servicio de alquiler de coches. El aeropuerto más cercano es el aeropuerto internacional Jardines del Rey, situado a 12 km. \r\nSi quieres pedir algo en concreto, puedes hacerlo en el siguiente paso, antes reservar. Después de reservar, te proporcionaremos los datos del alojamiento para que puedas ponerte en contacto con ellos directamente.\r\n', 'Tryp Cayo Coco, Hotel 4 Estrellas Todo Incluido, construido en los cayos vírgenes del centro de Cuba y situado entre una laguna natural y una extensa franja de playa. Pensado principalmente para familias, amantes del buceo, de la pesca y otras actividades. Resalta por su variado y excelente servicio gastronómico, además de su programa de animación diurna y nocturna.\r\nLas habitaciones tienen TV por cable y baño privado con secador de pelo y artículos de aseo gratuitos. Algunas habitaciones incluyen zona de estar. El hotel ofrece recepción 24 horas, servicio de guardería, peluquería y tienda de regalos.\r\nEl hotel Tryp Cayo Coco se encuentra enclavado en una zona ideal para practicar snorkel y buceo. El establecimiento ofrece bicicletas de uso gratuito y dispone de servicio de alquiler de coches. El aeropuerto más cercano es el aeropuerto internacional Jardines del Rey, situado a 12 km. \r\nSi quieres pedir algo en concreto, puedes hacerlo en el siguiente paso, antes reservar. Después de reservar, te proporcionaremos los datos del alojamiento para que puedas ponerte en contacto con ellos directamente.\r\n', 4, 'Ciego de Ávila', '0', 26, '0', '0', '1', '0', '22.5408726', '-78.3729009');
INSERT INTO `hotels` VALUES (36, 'Meliá Cayo Coco', 6, 'El Hotel Meliá Cayo Coco, resort de lujo, en modalidad Todo Incluido, con bungalós apoyados en pilotes, se encuentra a 11,6 km del aeropuerto internacional de Jardines del Rey y está reservado a huéspedes mayores de 18 años (los de esta edad incluidos).\r\nLas tranquilas habitaciones y suites de los bungalós cuentan con terraza, cafetera, tetera y vistas al jardín. Los bungalós superiores se encuentran apoyados en pilotes sobre la laguna. Las suites tienen salón independiente y mecedora.\r\nEl desayuno buffet y el aparcamiento son gratuitos. Entre los demás servicios se incluyen 5 restaurantes y 5 bares. También hay acceso a la playa, una piscina exterior estilo laguna, un spa, un gimnasio, un teatro y 2 pistas de tenis. \r\n', 'El Hotel Meliá Cayo Coco, resort de lujo, en modalidad Todo Incluido, con bungalós apoyados en pilotes, se encuentra a 11,6 km del aeropuerto internacional de Jardines del Rey y está reservado a huéspedes mayores de 18 años (los de esta edad incluidos).\r\nLas tranquilas habitaciones y suites de los bungalós cuentan con terraza, cafetera, tetera y vistas al jardín. Los bungalós superiores se encuentran apoyados en pilotes sobre la laguna. Las suites tienen salón independiente y mecedora.\r\nEl desayuno buffet y el aparcamiento son gratuitos. Entre los demás servicios se incluyen 5 restaurantes y 5 bares. También hay acceso a la playa, una piscina exterior estilo laguna, un spa, un gimnasio, un teatro y 2 pistas de tenis. \r\n', 5, 'Ciego de Ávila', '0', 27, '0', '0', '1', '0', '22.53441', '-78.3543787');
INSERT INTO `hotels` VALUES (37, ' Meliá Jardines del Rey', 5, 'Meliá Jardines del Rey, Resort de playa Todo Incluido, 5 Estrellas, ubicado en el archipiélago de Jardines del Rey, en el polo turístico de Cayo Coco. \r\nSus habitaciones están distribuidas en bungalows de tres niveles, con todo confort, cada habitación cuenta con TV, cafetera y baño privado con artículos de aseo gratuitos y secador de pelo.\r\n Se encuentra en la primera línea de mar de Playa Flamenco y es recomendado para familias, bodas y lunas de miel, además de reuniones y eventos, buceo, pesca y observación de aves.\r\nSe ofrece recepción 24 horas, tienda de regalos, 8 bares y 6 restaurantes que sirven platos de comida internacional y criolla.\r\nEl hotel Meliá Jardines del Rey cuenta con espacios para jugar al tenis y practicar snorkel en los alrededores. El complejo también ofrece servicio de alquiler de coches y actividades como buceo, pesca y observación de aves.\r\n', 'Meliá Jardines del Rey, Resort de playa Todo Incluido, 5 Estrellas, ubicado en el archipiélago de Jardines del Rey, en el polo turístico de Cayo Coco. \r\nSus habitaciones están distribuidas en bungalows de tres niveles, con todo confort, cada habitación cuenta con TV, cafetera y baño privado con artículos de aseo gratuitos y secador de pelo.\r\n Se encuentra en la primera línea de mar de Playa Flamenco y es recomendado para familias, bodas y lunas de miel, además de reuniones y eventos, buceo, pesca y observación de aves.\r\nSe ofrece recepción 24 horas, tienda de regalos, 8 bares y 6 restaurantes que sirven platos de comida internacional y criolla.\r\nEl hotel Meliá Jardines del Rey cuenta con espacios para jugar al tenis y practicar snorkel en los alrededores. El complejo también ofrece servicio de alquiler de coches y actividades como buceo, pesca y observación de aves.\r\n', 5, 'Ciego de Ávila', '0', 28, '0', '0', '1', '0', '22.5431595', '-78.4301949');
INSERT INTO `hotels` VALUES (38, ' Meliá Cayo Guillermo', 6, 'Enclavado en un escenario de extraordinaria belleza virginal, en Cayo Guillermo, se encuentra ubicado el Majestuoso Hotel Meliá Cayo Guillermo, que sirvió de inspiración al escritor norteamericano Ernest Hemingway. Cayo Guillermo es un regalo de la naturaleza, al que este resort Todo Incluido Cinco Estrellas y con 301 habitaciones aporta todo el confort. Está en primera línea de playa, frente a una de las barreras coralinas más bellas del mundo. Recomendado para familias, bodas y lunas de miel.', 'Enclavado en un escenario de extraordinaria belleza virginal, en Cayo Guillermo, se encuentra ubicado el Majestuoso Hotel Meliá Cayo Guillermo, que sirvió de inspiración al escritor norteamericano Ernest Hemingway. Cayo Guillermo es un regalo de la naturaleza, al que este resort Todo Incluido Cinco Estrellas y con 301 habitaciones aporta todo el confort. Está en primera línea de playa, frente a una de las barreras coralinas más bellas del mundo. Recomendado para familias, bodas y lunas de miel.', 5, 'Ciego de Ávila', '0', 29, '0', '0', '1', '0', '22.5833905', '-78.652346');
INSERT INTO `hotels` VALUES (39, 'Sol Cayo Guillermo', 6, 'El Hotel Sol Cayo Guillermo Resort Todo Incluido 4 Estrellas. Ubicado en Cayo Guillermo, junto a Playa Pilar, una de las más bellas del archipiélago Jardines del Rey, y próximo a una hermosa barrera coralina. Destaca por su ambiente romántico y cuidada vegetación tropical. Recomendado para familias, bodas y lunas de miel.\r\nEn un verdadero entorno virginal se localizan sus habitaciones, con terraza o balcón y vista al jardín. Se encuentran en bungalows de dos plantas. Amplias, acogedoras y funcionales; llenas de luz y color. Ideales para familias.\r\n', 'El Hotel Sol Cayo Guillermo Resort Todo Incluido 4 Estrellas. Ubicado en Cayo Guillermo, junto a Playa Pilar, una de las más bellas del archipiélago Jardines del Rey, y próximo a una hermosa barrera coralina. Destaca por su ambiente romántico y cuidada vegetación tropical. Recomendado para familias, bodas y lunas de miel.\r\nEn un verdadero entorno virginal se localizan sus habitaciones, con terraza o balcón y vista al jardín. Se encuentran en bungalows de dos plantas. Amplias, acogedoras y funcionales; llenas de luz y color. Ideales para familias.\r\n', 4, 'Ciego de Ávila', '0', 30, '0', '0', '1', '0', '22.5906956', '-78.6569555');
INSERT INTO `hotels` VALUES (40, ' Meliá  Cayo Santa María ', 6, 'En un paradisíaco islote de aguas cristalinas, ubicado en la cayería norte cubana se levanta el hotel Meliá Cayo Santa María. El hotel vacacional 5 Estrellas Todo Incluido Meliá Cayo Santa María está concebido para disfrutar en parejas o en familia, el complemento perfecto para unas vacaciones inolvidables. Sus 360 habitaciones disponen de TV vía satélite, cafetera y baño privado con artículos de aseo gratuitos y secador de pelo.\r\nEl establecimiento ofrece recepción 24 horas, peluquería, tienda de regalos y 5 bares.\r\nPara los amantes del deporte, el hotel Meliá Cayo Santa María está dotado de pista de tenis, mesa de ping pong y billares, y en la zona se puede practicar buceo. También hay servicio de alquiler de coches.\r\n', 'En un paradisíaco islote de aguas cristalinas, ubicado en la cayería norte cubana se levanta el hotel Meliá Cayo Santa María. El hotel vacacional 5 Estrellas Todo Incluido Meliá Cayo Santa María está concebido para disfrutar en parejas o en familia, el complemento perfecto para unas vacaciones inolvidables. Sus 360 habitaciones disponen de TV vía satélite, cafetera y baño privado con artículos de aseo gratuitos y secador de pelo.\r\nEl establecimiento ofrece recepción 24 horas, peluquería, tienda de regalos y 5 bares.\r\nPara los amantes del deporte, el hotel Meliá Cayo Santa María está dotado de pista de tenis, mesa de ping pong y billares, y en la zona se puede practicar buceo. También hay servicio de alquiler de coches.\r\n', 5, 'Villa Clara', '0', 31, '0', '0', '1', '0', '22.65942', '-79.0637687');
INSERT INTO `hotels` VALUES (41, 'Sol Cayo  Santa María ', 7, 'El hotel Sol Cayo Santa María se encuentra en ubicado en Caibarién, en la cayeria norte de la provincia de Villa Clara.\r\nEl complejo cuenta con 3 piscinas al aire libre e instalaciones de deportes acuáticos.\r\nTodas las habitaciones de este complejo disponen de aire acondicionado, TV por cable y baño privado con artículos de aseo gratuitos y secador de pelo.\r\nLa recepción está abierta las 24 horas y se ofrece servicio de guardería. El establecimiento alberga 5 restaurantes y 6 bares.\r\nPara los amantes del deporte, el Hotel Sol Cayo Santa María pone a disposición de sus huéspedes canchas para jugar al tenis y al ping pong.\r\nLas playas de Cayo Santa María regalan a sus huéspedes zonas ideales para practicar buceo y windsurf. Los huéspedes también pueden utilizar el servicio de alquiler de coches.', 'Sol Cayo Santa Maria is situated in Caibarién in the Villa Clara Region. The resort has 3 outdoor pools and water sports facilities.\r\nEach room at this resort is air conditioned and is fitted with a TV with cable channels. The private bathrooms include free toiletries and a hairdryer.\r\nThere is a 24-hour front desk and babysitting services at the property. Guests can enjoy a meal or a drink at one of the 5 restaurants and 6 bars.\r\nYou can play tennis and table tennis at this resort, and the area is popular for snorkeling and windsurfing. The resort also offers car hire.\r\nThe nearest airport is JAbel Santa Maria in Santa Clara, 43.5 miles from Sol Cayo Santa Maria.', 4, 'Villa Clara', '0', 32, '0', '0', '1', '0', '22.6594197', '-79.0703348');
INSERT INTO `hotels` VALUES (42, ' Meliá Buenavista', 7, 'El Hotel Meliá Buenavista se encuentra localizado en la playa de Punta Madruguilla, al oeste de Cayo Santa María, y ofrece bañera de hidromasaje y sauna. El complejo dispone de 2 piscinas exteriores, espacio con hermosas vistas al mar y 3 bares.\r\nLas habitaciones del Hotel Meliá Buenavista, perfectamente equipadas cuentan con TV vía satélite o por cable, cafetera y baño privado con artículos de aseo gratuitos y secador de pelo. Algunas incluyen baño privado con bañera de hidromasaje y otras, albornoces y zapatillas. \r\nLos huéspedes pueden disfrutar de platos internacionales y caribeños en sus 3 restaurantes especializados, Los Caribes, Los Navegantes y Los Marinos.\r\nEl complejo ofrece recepción las 24 horas y peluquería. En la zona podrá practicar distintas actividades náuticas como snorkel y buceo.\r\n', 'El Hotel Meliá Buenavista se encuentra localizado en la playa de Punta Madruguilla, al oeste de Cayo Santa María, y ofrece bañera de hidromasaje y sauna. El complejo dispone de 2 piscinas exteriores, espacio con hermosas vistas al mar y 3 bares.\r\nLas habitaciones del Hotel Meliá Buenavista, perfectamente equipadas cuentan con TV vía satélite o por cable, cafetera y baño privado con artículos de aseo gratuitos y secador de pelo. Algunas incluyen baño privado con bañera de hidromasaje y otras, albornoces y zapatillas. \r\nLos huéspedes pueden disfrutar de platos internacionales y caribeños en sus 3 restaurantes especializados, Los Caribes, Los Navegantes y Los Marinos.\r\nEl complejo ofrece recepción las 24 horas y peluquería. En la zona podrá practicar distintas actividades náuticas como snorkel y buceo.\r\n', 5, 'Villa Clara', '0', 33, '0', '0', '1', '0', '22.6676255', '-79.0890258');
INSERT INTO `hotels` VALUES (43, ' Meliá Las Dunas', 5, 'El hotel Meliá las Dunas, ubicado en primera línea de playa en Cayo Santa María, exótico paraje que deslumbra con su lujo natural. Resort Todo Incluido categoría 5 Estrellas, invita a disfrutar sendos ambientes para familias y parejas. Una ciudad turística llena de atracciones donde la vida converge en el espacio del lobby, que se prolonga como un singular bulevar. \r\n\r\nEl hotel Meliá las Dunas ofrece a sus huéspedes tranquilas habitaciones, perfectamente equipadas de todo tipo de comodidades. Estas habitaciones disponen de camas King size o dos camas individuales a su elección (según disponibilidad, bajo petición, antes, o a la llegada al hotel).\r\nTodas las habitaciones cuentan con una estructura adecuada, con una decoración cálida, confortable y funcional, especialmente diseñada para el disfrute de la estancia independientemente del motivo del viaje.\r\nLas habitaciones están equipadas con todos los detalles incluyendo un escritorio con su silla. Su mobiliario de alta calidad, bien en madera o en hierro de forja, sus relajantes colores pastel y sus amplios cristales que dan paso al balcón, crean un agradable ambiente donde se respiran lujo y confort.\r\nPara los amantes del deporte, el hotel dispone de espacios para jugar al tenis, al ping pong y al billar, mientras que la zona es popular entre los aficionados al buceo. También ofrece servicio de alquiler de coches. Recomendado para familias, bodas, lunas de miel, incentivos y circuitos.\r\n', 'El hotel Meliá las Dunas, ubicado en primera línea de playa en Cayo Santa María, exótico paraje que deslumbra con su lujo natural. Resort Todo Incluido categoría 5 Estrellas, invita a disfrutar sendos ambientes para familias y parejas. Una ciudad turística llena de atracciones donde la vida converge en el espacio del lobby, que se prolonga como un singular bulevar. \r\n\r\nEl hotel Meliá las Dunas ofrece a sus huéspedes tranquilas habitaciones, perfectamente equipadas de todo tipo de comodidades. Estas habitaciones disponen de camas King size o dos camas individuales a su elección (según disponibilidad, bajo petición, antes, o a la llegada al hotel).\r\nTodas las habitaciones cuentan con una estructura adecuada, con una decoración cálida, confortable y funcional, especialmente diseñada para el disfrute de la estancia independientemente del motivo del viaje.\r\nLas habitaciones están equipadas con todos los detalles incluyendo un escritorio con su silla. Su mobiliario de alta calidad, bien en madera o en hierro de forja, sus relajantes colores pastel y sus amplios cristales que dan paso al balcón, crean un agradable ambiente donde se respiran lujo y confort.\r\nPara los amantes del deporte, el hotel dispone de espacios para jugar al tenis, al ping pong y al billar, mientras que la zona es popular entre los aficionados al buceo. También ofrece servicio de alquiler de coches. Recomendado para familias, bodas, lunas de miel, incentivos y circuitos.\r\n', 5, 'Villa Clara', '0', 34, '0', '0', '1', '0', '22.6571447', '-79.0594806');
INSERT INTO `hotels` VALUES (44, 'Paradisus Río  de Oro', 4, 'El hotel Paradisus Río de Oro Resort & Spa ideado para el segmento Solo Adultos, invita a disfrutar de un amplio lobby que reproduce una aldea aborigen y un patio muy típico y acogedor que estimula a disfrutar de las más tranquilas tertulias al aire libre. El hotel deleita a sus visitantes con sus bellas zonas de jardines, parques de naturaleza boscosa tropical, jardín botánico y orquideario natural, que propician la ocasión para disfrutar de la observación de aves endémicas y deleitarse con espectaculares vistas a una laguna y al mar. \r\nEl Paradisus Río de Oro Resort & Spa se encuentra en Playa Esmeralda y ofrece un centro de spa y una zona de playa privada. El hotel pone a disposición de sus clientes una piscina exterior, 8 restaurantes, 7 bares y una discoteca.\r\nTodas las habitaciones perfectamente equipadas cuentan con TV con canales por cable, cafetera y baño privado con ducha, albornoces y artículos de aseo gratuitos.\r\nEl establecimiento dispone de peluquería, gimnasio y sauna con un costo adicional. Los huéspedes podrán practicar diversas actividades, como snorkel y buceo. El hotel también ofrece un centro de negocios, servicio de alquiler de coches y aparcamiento gratuito.\r\nEl Paradisus Río de Oro Resort & Spa es parte del parque nacional Bahía de Naranjo y está situado a 5 km de la playa de Guardalavaca, la bahía de Naranjo, el delfinario y el centro comercial Guardalavaca. El aeropuerto Frank País se encuentra a 60 minutos en coche de Paradisus Río de Oro Resort & Spa.\r\n', 'El hotel Paradisus Río de Oro Resort & Spa ideado para el segmento Solo Adultos, invita a disfrutar de un amplio lobby que reproduce una aldea aborigen y un patio muy típico y acogedor que estimula a disfrutar de las más tranquilas tertulias al aire libre. El hotel deleita a sus visitantes con sus bellas zonas de jardines, parques de naturaleza boscosa tropical, jardín botánico y orquideario natural, que propician la ocasión para disfrutar de la observación de aves endémicas y deleitarse con espectaculares vistas a una laguna y al mar. \r\nEl Paradisus Río de Oro Resort & Spa se encuentra en Playa Esmeralda y ofrece un centro de spa y una zona de playa privada. El hotel pone a disposición de sus clientes una piscina exterior, 8 restaurantes, 7 bares y una discoteca.\r\nTodas las habitaciones perfectamente equipadas cuentan con TV con canales por cable, cafetera y baño privado con ducha, albornoces y artículos de aseo gratuitos.\r\nEl establecimiento dispone de peluquería, gimnasio y sauna con un costo adicional. Los huéspedes podrán practicar diversas actividades, como snorkel y buceo. El hotel también ofrece un centro de negocios, servicio de alquiler de coches y aparcamiento gratuito.\r\nEl Paradisus Río de Oro Resort & Spa es parte del parque nacional Bahía de Naranjo y está situado a 5 km de la playa de Guardalavaca, la bahía de Naranjo, el delfinario y el centro comercial Guardalavaca. El aeropuerto Frank País se encuentra a 60 minutos en coche de Paradisus Río de Oro Resort & Spa.\r\n', 5, 'Holguín', '0', 35, '0', '0', '1', '0', '21.1139858', '-75.8675666');
INSERT INTO `hotels` VALUES (45, 'Sol Río  de Lunas y Mares', 5, 'El Hotel Sol Rio de Luna y Mares, situado a 5 km del centro de la ciudad de Guardalavaca, categoría 4 Estrellas Todo Incluido, ideal para vivir unas espléndidas vacaciones junto al mar y a la vegetación exuberante que contrastan en todos sus detalles. \r\nEl hotel Sol Rio de Luna y Mares ofrece gran variedad de entretenimientos para niños y adultos. Alberga 2 piscinas al aire libre y bañera de hidromasaje. El hotel también ofrece sauna e instalaciones para practicar deportes acuáticos.\r\nTodas las habitaciones, perfectamente equipadas disponen de TV con canales por cable, reproductor de CD, cafetera y baño privado con secador de pelo y artículos de aseo gratuitos.\r\nAdemás, el establecimiento cuenta con peluquería, bar y un restaurante que sirve platos internacionales, como comida francesa, italiana y mexicana.\r\nEl hotel ofrece a sus huéspedes actividades al aire libre y náuticas como montar a caballo y practicar snorkel. Se proporciona servicio de alquiler de coches. Ideal para vacaciones en familia.\r\n', 'El Hotel Sol Rio de Luna y Mares, situado a 5 km del centro de la ciudad de Guardalavaca, categoría 4 Estrellas Todo Incluido, ideal para vivir unas espléndidas vacaciones junto al mar y a la vegetación exuberante que contrastan en todos sus detalles. \r\nEl hotel Sol Rio de Luna y Mares ofrece gran variedad de entretenimientos para niños y adultos. Alberga 2 piscinas al aire libre y bañera de hidromasaje. El hotel también ofrece sauna e instalaciones para practicar deportes acuáticos.\r\nTodas las habitaciones, perfectamente equipadas disponen de TV con canales por cable, reproductor de CD, cafetera y baño privado con secador de pelo y artículos de aseo gratuitos.\r\nAdemás, el establecimiento cuenta con peluquería, bar y un restaurante que sirve platos internacionales, como comida francesa, italiana y mexicana.\r\nEl hotel ofrece a sus huéspedes actividades al aire libre y náuticas como montar a caballo y practicar snorkel. Se proporciona servicio de alquiler de coches. Ideal para vacaciones en familia.\r\n', 4, 'Holguín', '0', 36, '0', '0', '1', '0', '21.112752', '-75.8737577');
INSERT INTO `hotels` VALUES (46, 'Meliá Santiago', 5, 'El Hotel Melia Santiago de Cuba, ubicado en la céntrica Avenida Las Américas de la ciudad Santiago de Cuba muy cerca del Centro Histórico de Santiago de Cuba y el Centro de Convenciones Teatro Heredia. El hotel Meliá Santiago de Cuba se distingue por su sección THE LEVEL y pintoresco Santiago Café, que recrea el espíritu de la urbe santiaguera.\r\nEl hotel cuenta con piscina exterior, centro de fitness y bar. Sus habitaciones, perfectamente equipadas le regalan a sus huéspedes una inolvidable estadía llenas de confort y tranquilidad.\r\n Recomendado para viajes de incentivo, bodas, lunas de miel y circuitos. \r\n\r\nEl establecimiento, que cuenta con peluquería, es ideal para bodas y lunas de miel.\r\n', 'El Hotel Melia Santiago de Cuba, ubicado en la céntrica Avenida Las Américas de la ciudad Santiago de Cuba muy cerca del Centro Histórico de Santiago de Cuba y el Centro de Convenciones Teatro Heredia. El hotel Meliá Santiago de Cuba se distingue por su sección THE LEVEL y pintoresco Santiago Café, que recrea el espíritu de la urbe santiaguera.\r\nEl hotel cuenta con piscina exterior, centro de fitness y bar. Sus habitaciones, perfectamente equipadas le regalan a sus huéspedes una inolvidable estadía llenas de confort y tranquilidad.\r\n\r\nRecomendado para viajes de incentivo, bodas, lunas de miel y circuitos. \r\nEl establecimiento, que cuenta con peluquería, es ideal para bodas y lunas de miel.\r\n', 5, 'Santiago de Cuba', '0', 37, '0', '0', '1', '0', '20.0269487', '-75.8126941');
INSERT INTO `hotels` VALUES (47, 'Sol Cayo Largo', 6, 'Este tranquilo hotel con todo incluido se encuentra en un complejo de playa de la isla Cayo Largo del Sur, a 5 km del aeropuerto Vilo Acuña y a 6 km del Centro de Rescate de Tortugas Marinas.\r\n\r\nLas habitaciones, luminosas e informales, cuentan con balcón o terraza con vistas a los jardines, la piscina o el mar y disponen de televisor de pantalla plana y minibar. Las suites también cuentan con sala de estar independiente y, además, ofrecen masajes gratis y botellas de ron.\r\n\r\nEntre las opciones de restauración del hotel se puede disfrutar de un restaurante tranquilo en un pabellón con techo de paja, un bar acuático y un bar desenfadado con billares. El hotel dispone de 2 piscinas exteriores, un spa y un gimnasio al aire libre', 'Este tranquilo hotel con todo incluido se encuentra en un complejo de playa de la isla Cayo Largo del Sur, a 5 km del aeropuerto Vilo Acuña y a 6 km del Centro de Rescate de Tortugas Marinas.\r\n\r\nLas habitaciones, luminosas e informales, cuentan con balcón o terraza con vistas a los jardines, la piscina o el mar y disponen de televisor de pantalla plana y minibar. Las suites también cuentan con sala de estar independiente y, además, ofrecen masajes gratis y botellas de ron.\r\n\r\nEntre las opciones de restauración del hotel se puede disfrutar de un restaurante tranquilo en un pabellón con techo de paja, un bar acuático y un bar desenfadado con billares. El hotel dispone de 2 piscinas exteriores, un spa y un gimnasio al aire libre', 4, 'Cayo Largo', '0', 38, '0', '0', '1', '0', '21.6443247', '-81.5614677');
INSERT INTO `hotels` VALUES (48, 'Soroa', 4, 'Situada en la Cordillera del Rosario, a 70 kilómetros al oeste de la capital de Cuba, este acogedor hotel es perfecto para el disfrute de la naturaleza y mejorar la calidad de vida; diseñado para viajes en familia, incentivos, bodas, lunas de miel y circuitos donde se funden tradición y modernidad con un alto nivel de confort y servicio. \r\nDe 49 cabañas, una de ellas con facilidades para clientes discapacitados todas con baño individual, agua fria y caliente, aire acondicionado, caja de seguridad, teléfono, TV vía satélite. \r\nEn la colina más alta de Soroa, le recomendamos disfrutar de una deliciosa cena en el \"Castillo de Las Nubes\". El mismo fué construído en 1867 por Don Pedro, un Andaluz de España.\r\nEntre las atracciones del lugar se encuentra el orquideario más grande del pais, el cual posee una rica flora con más de 700 tipos de orquídeas y múltiples especies de helechos. Este colorido jardín es un lugar paradisíaco para aquellos con un serio entusiasmo por las orquídeas.', 'Situada en la Cordillera del Rosario, a 70 kilómetros al oeste de la capital de Cuba, este acogedor hotel es perfecto para el disfrute de la naturaleza y mejorar la calidad de vida; diseñado para viajes en familia, incentivos, bodas, lunas de miel y circuitos donde se funden tradición y modernidad con un alto nivel de confort y servicio. \r\nDe 49 cabañas, una de ellas con facilidades para clientes discapacitados todas con baño individual, agua fria y caliente, aire acondicionado, caja de seguridad, teléfono, TV vía satélite. \r\nEn la colina más alta de Soroa, le recomendamos disfrutar de una deliciosa cena en el \"Castillo de Las Nubes\". El mismo fué construído en 1867 por Don Pedro, un Andaluz de España.\r\nEntre las atracciones del lugar se encuentra el orquideario más grande del pais, el cual posee una rica flora con más de 700 tipos de orquídeas y múltiples especies de helechos. Este colorido jardín es un lugar paradisíaco para aquellos con un serio entusiasmo por las orquídeas.', 3, 'Pinar del Río', '0', 39, '0', '0', '1', '0', '22.796437', '-83.0135027');
INSERT INTO `hotels` VALUES (49, 'Los Jazmines', 5, 'Ubicado en el Valle de Viñales, El Hotel Los Jazmines categoría 3 estrellas domina una altura que le concede una de las más hermosas vistas del Valle de Viñales, se distingue por la exuberante vegetación que le rodea. Resulta una pieza arquitectónica de exquisito gusto con todo previsto para el disfrute de este escenario natural irrepetible. \r\nEl Hotel pone a facilidad de sus huéspedes oferta de senderos para la práctica del ecoturismo como \"El Camino hacia los Mogotes\", que se inicia en el hotel y se dirige a lo profundo del Valle hasta llegar al Mural de la Prehistoria; \"Naturaleza Insospechada\", permite en su recorrido apreciar la rica y variada avifauna y \"Los Secretos de un Mundo Subterráneo\", La Gran Caverna de Santo Tomás.,salones para reuniones, habitaciones climatizadas, facilidades deportivas y actividades al aire libre integran, entre otras las opciones que el Hotel pone a disposición de los vacacionistas.', 'Ubicado en el Valle de Viñales, El Hotel Los Jazmines categoría 3 estrellas domina una altura que le concede una de las más hermosas vistas del Valle de Viñales, se distingue por la exuberante vegetación que le rodea. Resulta una pieza arquitectónica de exquisito gusto con todo previsto para el disfrute de este escenario natural irrepetible. El Hotel pone a facilidad de sus huéspedes oferta de senderos para la práctica del ecoturismo como \"El Camino hacia los Mogotes\", que se inicia en el hotel y se dirige a lo profundo del Valle hasta llegar al Mural de la Prehistoria; \"Naturaleza Insospechada\", permite en su recorrido apreciar la rica y variada avifauna y \"Los Secretos de un Mundo Subterráneo\", La Gran Caverna de Santo Tomás.,salones para reuniones, habitaciones climatizadas, facilidades deportivas y actividades al aire libre integran, entre otras las opciones que el Hotel pone a disposición de los vacacionistas.', 3, 'Pinar del Río', '0', 40, '0', '0', '1', '0', '22.5963925', '-83.7266755');
INSERT INTO `hotels` VALUES (50, 'La Ermita', 5, 'Ubicado en la cima de una pendiente del extraordinario entorno del Valle de Viñales, en la provincia de Pinar del Río, este hotel se integra de manera armoniosa a su entorno. Los huéspedes de la instalación tienen acceso a recorridos por senderos habilitados, con el propósito de apreciar de cerca la flora y fauna del lugar y el contacto con campesinos de la región que mantienen las tradiciones rurales y culturales más auténticas. Recomendado para vacaciones en familia y circuitos.\r\n\r\nEl hotel La Ermita cuenta con 62 habitaciones perfectamente equipadas para hospedar a los visitantes, se organizan alrededor de la zona central, mientras que un camino de piedra se inclina hacia el amplio valle.\r\nEl restaurante del hotel tiene una amplia terraza para disfrutar de las vistas del Valle de Viñales.', 'Ubicado en la cima de una pendiente del extraordinario entorno del Valle de Viñales, en la provincia de Pinar del Río, este hotel se integra de manera armoniosa a su entorno. Los huéspedes de la instalación tienen acceso a recorridos por senderos habilitados, con el propósito de apreciar de cerca la flora y fauna del lugar y el contacto con campesinos de la región que mantienen las tradiciones rurales y culturales más auténticas. Recomendado para vacaciones en familia y circuitos.\r\n\r\nEl hotel La Ermita cuenta con 62 habitaciones perfectamente equipadas para hospedar a los visitantes, se organizan alrededor de la zona central, mientras que un camino de piedra se inclina hacia el amplio valle.\r\nEl restaurante del hotel tiene una amplia terraza para disfrutar de las vistas del Valle de Viñales.', 3, 'Pinar del Río', '0', 41, '0', '0', '1', '0', '22.611585', '-83.7015357');
INSERT INTO `hotels` VALUES (51, 'Rancho San Vicente', 6, 'En la provincia de Pinar del Río, la más occidental de Cuba, se localiza el hotel Rancho San Vicente, ubicado en el entorno del Valle de San Vicente, a las márgenes del río del mismo nombre, rico en aguas mineromedicinales. Desde este se puede observar la flora y fauna local, visitar cavernas y ríos subterráneos, así como compartir con comunidades rurales de la zona. Ideal para amantes de la naturaleza, en un ambiente de completa privacidad y mucho aire libre.\r\nLas habitaciones originales del Hotel Rancho San Vicente han sido renovadas y equipadas con todas las comodidades modernas. Se han construido nuevas cabañas con troncos importados de Chile y Brasil, que tienen un diseño llamativo y se integran muy bien con el entorno.\r\nEl hotel Rancho San Vicente cuenta con Bar, Parqueo, Piscina, Restaurante y servicio de Wifi. También ofertas excursiones turística a sitio de interés de la zona.\r\n** Algunos servicios requieren pago local.', 'En la provincia de Pinar del Río, la más occidental de Cuba, se localiza el hotel Rancho San Vicente, ubicado en el entorno del Valle de San Vicente, a las márgenes del río del mismo nombre, rico en aguas mineromedicinales. Desde este se puede observar la flora y fauna local, visitar cavernas y ríos subterráneos, así como compartir con comunidades rurales de la zona. Ideal para amantes de la naturaleza, en un ambiente de completa privacidad y mucho aire libre.\r\nLas habitaciones originales del Hotel Rancho San Vicente han sido renovadas y equipadas con todas las comodidades modernas. Se han construido nuevas cabañas con troncos importados de Chile y Brasil, que tienen un diseño llamativo y se integran muy bien con el entorno.\r\nEl hotel Rancho San Vicente cuenta con Bar, Parqueo, Piscina, Restaurante y servicio de Wifi. También ofertas excursiones turística a sitio de interés de la zona.\r\n** Algunos servicios requieren pago local.', 3, 'Pinar del Río', '0', 42, '0', '0', '1', '0', '22.67335', '-83.7098326');
INSERT INTO `hotels` VALUES (52, 'Cayo Levisa', 5, 'El Hotel Cayo Levisa está situado en una pequeña isla paradisíaca con el mismo nombre, en la costa norte de la provincia de Pinar del Río. Es una excelente opción para los que gusten de los deportes acuáticos. También, las arenas blancas de su playa invitan a los que prefieran relajarse y descansar.\r\nEl Hotel Cayo Levisa se encuentra rodeado de aguas cristalinas que dejan ver la magnificencia de sus fondos marítimos. El hotel posee un centro internacional de buceo que cuenta con un bote especializado y todo el equipamiento necesario. Una de las principales atracciones es la inmersión a la barrera coralina que se encuentra a sólo 3 metros de profundidad y muestra una sorprendente diversidad de peces y corales.\r\nEl hotel cuenta con 55 habitaciones perfectamente equipadas de ellas 10 bungalows, 7 junior suites, y 38 tropicales. Todas climatizadas, con teléfono, televisión satelital, mini bar, secador para cabello, y caja de seguridad.', 'El Hotel Cayo Levisa está situado en una pequeña isla paradisíaca con el mismo nombre, en la costa norte de la provincia de Pinar del Río. Es una excelente opción para los que gusten de los deportes acuáticos. También, las arenas blancas de su playa invitan a los que prefieran relajarse y descansar.\r\nEl Hotel Cayo Levisa se encuentra rodeado de aguas cristalinas que dejan ver la magnificencia de sus fondos marítimos. El hotel posee un centro internacional de buceo que cuenta con un bote especializado y todo el equipamiento necesario. Una de las principales atracciones es la inmersión a la barrera coralina que se encuentra a sólo 3 metros de profundidad y muestra una sorprendente diversidad de peces y corales.\r\nEl hotel cuenta con 55 habitaciones perfectamente equipadas de ellas 10 bungalows, 7 junior suites, y 38 tropicales. Todas climatizadas, con teléfono, televisión satelital, mini bar, secador para cabello, y caja de seguridad.', 3, 'Pinar del Río', '0', 43, '0', '0', '1', '0', '22.8793354', '-83.5449389');
INSERT INTO `hotels` VALUES (53, 'Chateau Miramar', 5, 'El hotel cuenta con 50 habitaciones en las que se aprecia una decoración sencilla, cálida y luminosa. Las suites y habitaciones cuentan con Wi-Fi gratuito, televisión por satélite, minibar y, en algunos casos, balcón amueblado. Las suites tienen zona de descanso independiente y bañera de hidromasaje o ducha estilo spa, todo dispuesto con el propósito de hacer su estancia productiva y placentera. Servicio de habitaciones disponible con un costo adicional. \r\n\r\nEl hotel cuenta con bar en el vestíbulo, piscina exterior y un restaurante tranquilo que dispone de vistas a la ciudad.', 'El hotel cuenta con 50 habitaciones en las que se aprecia una decoración sencilla, cálida y luminosa. Las suites y habitaciones cuentan con Wi-Fi gratuito, televisión por satélite, minibar y, en algunos casos, balcón amueblado. Las suites tienen zona de descanso independiente y bañera de hidromasaje o ducha estilo spa, todo dispuesto con el propósito de hacer su estancia productiva y placentera. Servicio de habitaciones disponible con un costo adicional. \r\n\r\nEl hotel cuenta con bar en el vestíbulo, piscina exterior y un restaurante tranquilo que dispone de vistas a la ciudad.', 4, 'La Habana', '0', 44, '0', '0', '1', '0', '23.1157517', '-82.439463');
INSERT INTO `hotels` VALUES (54, 'Acuario', 6, 'Como parte de la selecta zona Residencial de la Marina Hemingway y al oeste de La Habana se alza el único hotel Todo Incluido de la ciudad. La gran variedad y calidad de sus servicios hacen del mismo el lugar elegido para disfrutar, en un entorno apacible,. Cuenta con el Club Náutico Internacional: \"Ernest Hemingway\" , sede del torneo anual de la aguja. \r\n170 habitaciones se categorizan de (132) doble estándar, (20) triples, (10) matrimoniales y (8) comunicantes estándar. Todas climatizadas con  teléfono, TV vía satélite, minibar, baño privado (agua fría y caliente) con secador de pelo además de una extensa y panorámica vista a la piscina o a los canales de la Marina. ', 'Como parte de la selecta zona Residencial de la Marina Hemingway y al oeste de La Habana se alza el único hotel Todo Incluido de la ciudad. La gran variedad y calidad de sus servicios hacen del mismo el lugar elegido para disfrutar, en un entorno apacible,. Cuenta con el Club Náutico Internacional: \"Ernest Hemingway\" , sede del torneo anual de la aguja. \r\n170 habitaciones se categorizan de (132) doble estándar, (20) triples, (10) matrimoniales y (8) comunicantes estándar. Todas climatizadas con  teléfono, TV vía satélite, minibar, baño privado (agua fría y caliente) con secador de pelo además de una extensa y panorámica vista a la piscina o a los canales de la Marina.', 3, 'La Habana', '0', 45, '0', '0', '1', '0', '23.0889566', '-82.498619');
INSERT INTO `hotels` VALUES (56, 'Bellocaribe', 0, 'El Hotel BELLO CARIBE con categoría de 3 Estrellas se encuentra ubicado en zona residencial de la Habana, rodeado de una exuberante vegetación, aves y peces que le dan al entorno un ambiente de paz y tranquilidad para nuestros clientes. Esta instalación está compuesta por dos edificaciones claramente diferenciadas por su estructura. La primera, una moderna del estilo de construcción Girón y una antigua casona de los años 40, la cual fuera casa de familia, de un estilo ecléctico, que es donde está ubicado de restaurante. Íntimo y acogedor, el hotel Bello Caribe,  está decorado con hermosas obras de afamados pintores cubanos, entre los que se destacan Mariano Rodríguez, Flora Fong, Fabelo, Zaida del Río y Choco. La obra mural situada en el Lobby Central (inconclusa) perteneciente a Mariano fue donada por el propio artista y no terminada por su fallecimiento, siendo de entrañable valor para la instalación.', 'El Hotel BELLO CARIBE con categoría de 3 Estrellas se encuentra ubicado en zona residencial de la Habana, rodeado de una exuberante vegetación, aves y peces que le dan al entorno un ambiente de paz y tranquilidad para nuestros clientes. Esta instalación está compuesta por dos edificaciones claramente diferenciadas por su estructura. La primera, una moderna del estilo de construcción Girón y una antigua casona de los años 40, la cual fuera casa de familia, de un estilo ecléctico, que es donde está ubicado de restaurante. Íntimo y acogedor, el hotel Bello Caribe,  está decorado con hermosas obras de afamados pintores cubanos, entre los que se destacan Mariano Rodríguez, Flora Fong, Fabelo, Zaida del Río y Choco. La obra mural situada en el Lobby Central (inconclusa) perteneciente a Mariano fue donada por el propio artista y no terminada por su fallecimiento, siendo de entrañable valor para la instalación.', 2, 'La Habana', '0', 46, '0', '0', '1', '0', '23.0754369', '-82.4514295');
INSERT INTO `hotels` VALUES (57, 'Mariposa', 3, 'Ubicado en el centro del Polo Científico de La Habana y a 10 minutos del Aeropuerto Internacional José Martí, el hotel Mariposa es sin dudas una buena opción para aquellos que buscan hoteles económica en la ciudad.\r\nEste establecimiento cuenta con una piscina, un restaurante buffet, lobby bar y un excelente servicio. Es un hotel de 2 estrellas que ofrece habitaciones amplias y modernas, totalmente equipadas con todas las comodidades.\r\nEl Hotel dispone de un programa de entretenimiento para los huéspedes y unas completas instalaciones y servicios. El hotel ofrece a sus huéspedes servicios de  cambio de moneda, alquiler de coches y servicios de telefonía.', 'Ubicado en el centro del Polo Científico de La Habana y a 10 minutos del Aeropuerto Internacional José Martí, el hotel Mariposa es sin dudas una buena opción para aquellos que buscan hoteles económica en la ciudad.\r\nEste establecimiento cuenta con una piscina, un restaurante buffet, lobby bar y un excelente servicio. Es un hotel de 2 estrellas que ofrece habitaciones amplias y modernas, totalmente equipadas con todas las comodidades.\r\nEl Hotel dispone de un programa de entretenimiento para los huéspedes y unas completas instalaciones y servicios. El hotel ofrece a sus huéspedes servicios de  cambio de moneda, alquiler de coches y servicios de telefonía.', 2, 'La Habana', '0', 47, '0', '0', '1', '0', '23.0359614', '-82.4768721');
INSERT INTO `hotels` VALUES (58, 'Los Cactus', 5, 'El Hotel Los Cactus es un hotel Súper Incluido de para adultos, solteros y parejas mayores de 12 años, donde todas las comidas, vino, bebidas nacionales e internacionales, deportes náuticos con instrucción y equipamiento, la animación y otras actividades están incluidas en una sola tarifa.\r\nEl hotel Los Cactus cuenta con 270 habitaciones en total.  Todas las suites y junior suites tienen una cama King o dos camas twin, Aire acondicionado, teléfono, baño privado y ducha, plancha y tabla de planchar, secador de pelo, mini refrigerador, facilidades para té y café, mini refrigerador, TV con pantalla plana con puerto USB y HDMI, televisión por satélite con canales nacionales e internacionales, y balcón o patio. \r\nEl hotel Los Cactus cuenta con un amplio programa de actividades el cual se divulga en el Lobby Principal. Entre sus principales actividades se encuentra: PIANO BAR con Música en vivo al menos cuatro veces a la semana desde las 22:15 pm, alternando con las noches de karaoke (23:00 pm-01:00 am), DISCOTECA, SALA DE JUEGOS, GIMNASIO,  JACUZZIS, deportes terrestres y náuticos.\r\nTodas las actividades están sujetas a disponibilidad y condiciones del tiempo. ', 'Los Cactus es un hotel Súper Incluido de para adultos, solteros y parejas mayores de 12 años, donde todas las comidas, vino, bebidas nacionales e internacionales, deportes náuticos con instrucción y equipamiento, la animación y otras actividades están incluidas en una sola tarifa.\r\nEl hotel Los Cactus cuenta con 270 habitaciones en total.  Todas las suites y junior suites tienen una cama King o dos camas twin, Aire acondicionado, teléfono, baño privado y ducha, plancha y tabla de planchar, secador de pelo, mini refrigerador, facilidades para té y café, mini refrigerador, TV con pantalla plana con puerto USB y HDMI, televisión por satélite con canales nacionales e internacionales, y balcón o patio. \r\nEl hotel Los Cactus cuenta con un amplio programa de actividades el cual se divulga en el Lobby Principal. Entre sus principales actividades se encuentra: PIANO BAR con Música en vivo al menos cuatro veces a la semana desde las 22:15 pm, alternando con las noches de karaoke (23:00 pm-01:00 am), DISCOTECA, SALA DE JUEGOS, GIMNASIO,  JACUZZIS, deportes terrestres y náuticos.\r\nTodas las actividades están sujetas a disponibilidad y condiciones del tiempo. ', 4, 'Varadero', '0', 48, '0', '0', '1', '0', '23.1654647', '-81.2303203');
INSERT INTO `hotels` VALUES (59, 'Tuxpan', 5, 'En un entorno de finas arenas blancas, cristalinas aguas y un campo de golf de 18 hoyos, se halla este hotel vacacional de modalidad Todo Incluido Tuxpan, ideal para vacaciones en familia, eventos de golf y celebración de bodas y lunas de miel.\r\nEl Hotel Tuxpan pone a disposición de sus huéspedes Animación diurna y nocturna. Club infantil, jacuzzi, inicialización de buceo en piscina, servicios náuticos no motorizados, piscina para niños y adultos, áreas deportivas, programas especiales para bodas y lunas de miel. Servicio de alimentos ligeros y bebidas las 24 horas.\r\nCuenta con 233 habitaciones perfectamente equipadas con aire acondicionado, mini bar, caja de seguridad, teléfono y TV vía satélite.', 'TUXPAN\r\n\r\nEn un entorno de finas arenas blancas, cristalinas aguas y un campo de golf de 18 hoyos, se halla este hotel vacacional de modalidad Todo Incluido Tuxpan, ideal para vacaciones en familia, eventos de golf y celebración de bodas y lunas de miel.\r\n\r\nEl Hotel Tuxpan pone a disposición de sus huéspedes Animación diurna y nocturna. Club infantil, jacuzzi, inicialización de buceo en piscina, servicios náuticos no motorizados, piscina para niños y adultos, áreas deportivas, programas especiales para bodas y lunas de miel. Servicio de alimentos ligeros y bebidas las 24 horas.\r\n\r\nCuenta con 233 habitaciones perfectamente equipadas con aire acondicionado, mini bar, caja de seguridad, teléfono y TV vía satélite.', 4, 'Varadero', '0', 49, '0', '0', '1', '0', '23.1663781', '-81.2272668');
INSERT INTO `hotels` VALUES (60, 'Brisas del Caribe ', 5, 'El Hotel Brisas del Caribe, categoría 4 estrellas, ubicado en primera línea de la playa Varadero, de modalidad Todo Incluido. Es ideal para familia con niños con múltiples programas para edades entre 5 y 12 años que incluyen: club infantil, áreas de juego y animación especializada. Se especializa además en bodas y lunas de miel.\r\nPara el disfrute de todos sus huéspedes, el hotel cuenta con mini club infantil, piscinas para niños y adultos, jacuzzi, áreas deportivas y servicios náuticos no motorizados. Animación diurna y nocturna. Servicio de alimentos ligeros y bebidas las 24 horas.\r\nCuenta con 444 habitaciones, de ellas 2 con facilidades para personas con necesidades especiales. Todas climatizadas, con mini bar, caja de seguridad, teléfono y televisión satelital.', 'El Hotel Brisas del Caribe, categoría 4 estrellas, ubicado en primera línea de la playa Varadero, de modalidad Todo Incluido. Es ideal para familia con niños con múltiples programas para edades entre 5 y 12 años que incluyen: club infantil, áreas de juego y animación especializada. Se especializa además en bodas y lunas de miel.\r\nPara el disfrute de todos sus huéspedes, el hotel cuenta con mini club infantil, piscinas para niños y adultos, jacuzzi, áreas deportivas y servicios náuticos no motorizados. Animación diurna y nocturna. Servicio de alimentos ligeros y bebidas las 24 horas.\r\nCuenta con 444 habitaciones, de ellas 2 con facilidades para personas con necesidades especiales. Todas climatizadas, con mini bar, caja de seguridad, teléfono y televisión satelital.', 4, 'Varadero', '0', 50, '0', '0', '1', '0', '23.1844', '-81.1879887');
INSERT INTO `hotels` VALUES (61, 'Velasco', 5, 'Este Hotel, fundado en 1902, bajo la administración de Luis Velasco y a pocos metros de la Plaza de la Libertad, se encuentra en el Centro Histórico de la Ciudad de Matanzas; con  una arquitectura ecléctica donde sobresalen los elementos neoclásicos.\r\nEl hotel Velasco cuenta con restaurante de comida internacional, bar, lobby bar y cafetería.\r\nCuenta con 17 confortables habitaciones estándar dobles equipadas todas con aire acondicionado, TV vía satélite, teléfono, baño privado y servicio de Internet en cada una de ellas.   No posee habitaciones para minusválidos.\r\nMuy cerca se localiza el Teatro Sauto y Museo de la Farmacia. La Playa Varadero queda a unos 40 km del hotel, el cabaret Tropicana Matanzas a 13 km y La Habana 98 km.', 'Este Hotel, fundado en 1902, bajo la administración de Luis Velasco y a pocos metros de la Plaza de la Libertad, se encuentra en el Centro Histórico de la Ciudad de Matanzas; con  una arquitectura ecléctica donde sobresalen los elementos neoclásicos.\r\nEl hotel Velasco cuenta con restaurante de comida internacional, bar, lobby bar y cafetería.\r\nCuenta con 17 confortables habitaciones estándar dobles equipadas todas con aire acondicionado, TV vía satélite, teléfono, baño privado y servicio de Internet en cada una de ellas.   No posee habitaciones para minusválidos.\r\nMuy cerca se localiza el Teatro Sauto y Museo de la Farmacia. La Playa Varadero queda a unos 40 km del hotel, el cabaret Tropicana Matanzas a 13 km y La Habana 98 km.', 4, 'Matanzas', '0', 51, '0', '0', '1', '0', '23.0475243', '-81.5803019');
