INSERT INTO `hotels` VALUES (63, 'Camino del Principe', 0, 'El hotel Camino del Príncipe, situado en San Juan de los Remedios, la cuna de las “Parrandas de Remedios”, se conoce por ser, probablemente, la fiesta tradicional cubana más grande y antigua. Este hotel resulta ideal para aquellos que desean estar en contacto con la cultura y las tradiciones cubanas.\r\nCuenta con 26 habitaciones estándar dobles. Todas climatizadas, con mini bar, televisión satelital, teléfono, secador para cabello y caja de seguridad.', 'El hotel Camino del Príncipe, situado en San Juan de los Remedios, la cuna de las “Parrandas de Remedios”, se conoce por ser, probablemente, la fiesta tradicional cubana más grande y antigua. Este hotel resulta ideal para aquellos que desean estar en contacto con la cultura y las tradiciones cubanas.\r\nCuenta con 26 habitaciones estándar dobles. Todas climatizadas, con mini bar, televisión satelital, teléfono, secador para cabello y caja de seguridad.', 4, 'Villa Clara', '0', 53, '0', '0', '1', '0', '22.4952335', '-79.5465937');
INSERT INTO `hotels` VALUES (64, 'Mascotte', 4, 'Elegante y sobrio, el Hotel Mascotte se encuentra ubicado en la octava villa fundada por los españoles en Cuba, cuna de las “Parrandas de Remedios”, probablemente la fiesta tradicional cubana más grande y antigua. Se caracteriza, tanto por su ambiente familiar, como por su servicio de calidad y personalizado.\r\n\r\nCuenta con 1 restaurante, patio bar y una cafetería que ofrece comidas ligeras.\r\n\r\nSus 10 habitaciones estándar dobles, todas climatizadas, con caja de seguridad, teléfono, TV vía satélite, mini bar y secador para cabello.\r\n\r\nDentro de las Atracciones cercanas al hotel se encuentra: Centro Comercial: 100 m, Iglesia Mayor San Juan Bautista: 100 m, Museo de Historia: 500 m, Museo de Las Parrandas: 200 m, Museo del Azúcar: 5 Km, Mirador de Buena Vista: 17 Km, Aeropuerto Internacional de Santa Clara “Abel Santamaría”: 45 Km, Cayo Santa María: 60 km, Trinidad: 200 km, La Habana: 342 km.', 'Elegante y sobrio, el Hotel Mascotte se encuentra ubicado en la octava villa fundada por los españoles en Cuba, cuna de las “Parrandas de Remedios”, probablemente la fiesta tradicional cubana más grande y antigua. Se caracteriza, tanto por su ambiente familiar, como por su servicio de calidad y personalizado.\r\n\r\nCuenta con 1 restaurante, patio bar y una cafetería que ofrece comidas ligeras.\r\n\r\nSus 10 habitaciones estándar dobles, todas climatizadas, con caja de seguridad, teléfono, TV vía satélite, mini bar y secador para cabello.\r\n\r\nDentro de las Atracciones cercanas al hotel se encuentra: Centro Comercial: 100 m, Iglesia Mayor San Juan Bautista: 100 m, Museo de Historia: 500 m, Museo de Las Parrandas: 200 m, Museo del Azúcar: 5 Km, Mirador de Buena Vista: 17 Km, Aeropuerto Internacional de Santa Clara “Abel Santamaría”: 45 Km, Cayo Santa María: 60 km, Trinidad: 200 km, La Habana: 342 km.', 4, 'Villa Clara', '0', 54, '0', '0', '1', '0', '22.4953156', '-79.5478467');
INSERT INTO `hotels` VALUES (65, 'Barcelona', 4, 'El Hotel Barcelona inaugurado en el 2012 en San Juan de los Remedios, reconocida como la octava villa más antigua de Cuba, fundada en 1578 y conocida como la cuna de las Parrandas, posiblemente la más grande y más antigua fiesta tradicional cubana.\r\nCuenta con 24 habitaciones, de ellas 1 con facilidades para personas con necesidades especiales. Todas climatizadas, con mini bar, televisión satelital, teléfono, secador para cabello y caja de seguridad.\r\n\r\nDentro de las atracciones más cercanas al hotel se encuentra la Iglesia Mayor San Juan Bautista: 100 m, Museo de Historia: 500 m, Museo de Las Parrandas: 200 m, Museo del Azúcar: 5 Km, Mirador de Buena Vista: 17 Km, Aeropuerto Internacional de Santa Clara “Abel Santamaría”: 45 Km, Cayo Santa María: 60 km, Trinidad: 200 km, La Habana: 342 km', 'El Hotel Barcelona inaugurado en el 2012 en San Juan de los Remedios, reconocida como la octava villa más antigua de Cuba, fundada en 1578 y conocida como la cuna de las Parrandas, posiblemente la más grande y más antigua fiesta tradicional cubana.\r\nCuenta con 24 habitaciones, de ellas 1 con facilidades para personas con necesidades especiales. Todas climatizadas, con mini bar, televisión satelital, teléfono, secador para cabello y caja de seguridad.\r\n\r\nDentro de las atracciones más cercanas al hotel se encuentra la Iglesia Mayor San Juan Bautista: 100 m, Museo de Historia: 500 m, Museo de Las Parrandas: 200 m, Museo del Azúcar: 5 Km, Mirador de Buena Vista: 17 Km, Aeropuerto Internacional de Santa Clara “Abel Santamaría”: 45 Km, Cayo Santa María: 60 km, Trinidad: 200 km, La Habana: 342 km', 4, 'Villa Clara', '0', 55, '0', '0', '1', '0', '22.4942059', '-79.5473853');
INSERT INTO `hotels` VALUES (66, 'Real', 4, 'Situado en San Juan de los Remedios, la cuna de las “Parrandas de Remedios”, se conoce por ser, probablemente, la fiesta tradicional cubana más grande y antigua. Este hotel resulta ideal para aquellos que desean estar en contacto con la cultura y las tradiciones cubanas.\r\nEl Hotel Real cuenta con 8 habitaciones estándar dobles, Todas climatizadas, con mini bar, televisión satelital, teléfono, secador para cabello y caja de seguridad.\r\nDentro de las atracciones turísticas cercanas al hotel Real se encuentran Iglesia Mayor San Juan Bautista: 100 m, Museo de Historia: 500 m, Museo de Las Parrandas: 200 m, Museo del Azúcar: 5 Km, Mirador de Buena Vista: 17 Km, Aeropuerto Internacional de Santa Clara “Abel Santamaría”: 45 Km, Cayo Santa María: 60 km, Trinidad: 200 km, La Habana: 342 km.\r\n', 'Situado en San Juan de los Remedios, la cuna de las “Parrandas de Remedios”, se conoce por ser, probablemente, la fiesta tradicional cubana más grande y antigua. Este hotel resulta ideal para aquellos que desean estar en contacto con la cultura y las tradiciones cubanas.\r\nEl Hotel Real cuenta con 8 habitaciones estándar dobles, Todas climatizadas, con mini bar, televisión satelital, teléfono, secador para cabello y caja de seguridad.\r\nDentro de las atracciones turísticas cercanas al hotel Real se encuentran Iglesia Mayor San Juan Bautista: 100 m, Museo de Historia: 500 m, Museo de Las Parrandas: 200 m, Museo del Azúcar: 5 Km, Mirador de Buena Vista: 17 Km, Aeropuerto Internacional de Santa Clara “Abel Santamaría”: 45 Km, Cayo Santa María: 60 km, Trinidad: 200 km, La Habana: 342 km.\r\n', 4, 'Villa Clara', '0', 56, '0', '0', '1', '0', '22.4959771', '-79.5469935');
INSERT INTO `hotels` VALUES (67, 'Los Caneyes', 5, 'Considerado uno de los hoteles más interesantes de la región por su atmósfera única, recrea las viviendas de los aborígenes taínos en forma de Caneyes en medio de un  entorno natural atractivo entre frondosos árboles, cocoteros y helechos. Situado en el centro de Cuba, a 1 km del centro de la ciudad y de la Plaza de la Revolución:”Ernesto Che Guevara”. Propicia una agradable estancia para los amantes de la naturaleza y los que deseen visitar destinos turísticos cercanos a la ciudad, así como a la cayería norte de la provincia.\r\nCuenta con 96 habitaciones: 92 de ellas son doble estándar, 1 junior-suite, 2 suites y 1 con facilidades para discapacitados. Todas con aire acondicionado, radio, teléfono y TV vía satélite.', 'Considerado uno de los hoteles más interesantes de la región por su atmósfera única, recrea las viviendas de los aborígenes taínos en forma de Caneyes en medio de un  entorno natural atractivo entre frondosos árboles, cocoteros y helechos. Situado en el centro de Cuba, a 1 km del centro de la ciudad y de la Plaza de la Revolución:”Ernesto Che Guevara”. Propicia una agradable estancia para los amantes de la naturaleza y los que deseen visitar destinos turísticos cercanos a la ciudad, así como a la cayería norte de la provincia.\r\nCuenta con 96 habitaciones: 92 de ellas son doble estándar, 1 junior-suite, 2 suites y 1 con facilidades para discapacitados. Todas con aire acondicionado, radio, teléfono y TV vía satélite.', 3, 'Villa Clara', '0', 57, '0', '0', '1', '0', '22.4018679', '-80.0021501');
