INSERT INTO `hotels` VALUES (69, 'América', 4, 'Ubicado a escasos metros de la plaza cívica de Santa Clara, rodeado de un ambiente puramente citadino, con importantes centros comerciales e instituciones culturales y de recreación en su entorno más cercano se encuentra el Hotel América.\r\nEl hotel pone a disposición de sus huéspedes Cibercafé, piscina, servicios de telefonía nacional e internacional y servicio de taxi.\r\nCuenta con Restaurante a la carta y snack-bar con servicio 24 horas.\r\nSus 27 habitaciones, de ellas 4 matrimoniales y 23 estándar dobles, todas climatizadas, están perfectamente equipadas con caja de seguridad, teléfono, televisión satelital, mini bar y secado para cabello.', 'Ubicado a escasos metros de la plaza cívica de Santa Clara, rodeado de un ambiente puramente citadino, con importantes centros comerciales e instituciones culturales y de recreación en su entorno más cercano se encuentra el Hotel América.\r\nEl hotel pone a disposición de sus huéspedes Cibercafé, piscina, servicios de telefonía nacional e internacional y servicio de taxi.\r\nCuenta con Restaurante a la carta y snack-bar con servicio 24 horas.\r\nSus 27 habitaciones, de ellas 4 matrimoniales y 23 estándar dobles, todas climatizadas, están perfectamente equipadas con caja de seguridad, teléfono, televisión satelital, mini bar y secado para cabello.', 3, 'Villa Clara', '0', 59, '0', '0', '1', '0', '22.4063252', '-79.9663537');
INSERT INTO `hotels` VALUES (70, 'Marqués', 4, 'Con un elegante estilo ecléctico se encuentra ubicado a solo 100 metros de La Catedral el hotel El Marques.\r\nEl hotel pone a disposición de sus clientes Bar con servicio 24 horas que ofrece de desayuno, snacks y bebidas tradicionales e internacionales. \r\nCuenta con 6 habitaciones (4 con camas cameras, 1 doble, 1extracamera) perfectamente equipadas para ofrecerles a sus clientes unas confortables y placenteras estancias.\r\nEntre las atracciones cercanas al hotel El Marques se encuentran la Casa natal del Poeta Nacional, Nicolás Guillén: 150 mts, Plaza San Juan de Dios: 250 mts, Parroquia de Nuestra Señora de la Soledad: 250 mts, Casa natal de la poetisa Gertrudis Gómez de Avellaneda: 350 mts, Plaza del Gallo, Soledad o Solidaridad: 800 mts, Museo Provincial Ignacio Agramonte: 850 mts, Playa Santa Lucía: 120 km.', 'Con un elegante estilo ecléctico se encuentra ubicado a solo 100 metros de La Catedral el hotel El Marques.\r\nEl hotel pone a disposición de sus clientes Bar con servicio 24 horas que ofrece de desayuno, snacks y bebidas tradicionales e internacionales. \r\nCuenta con 6 habitaciones (4 con camas cameras, 1 doble, 1extracamera) perfectamente equipadas para ofrecerles a sus clientes unas confortables y placenteras estancias.\r\nEntre las atracciones cercanas al hotel El Marques se encuentran la Casa natal del Poeta Nacional, Nicolás Guillén: 150 mts, Plaza San Juan de Dios: 250 mts, Parroquia de Nuestra Señora de la Soledad: 250 mts, Casa natal de la poetisa Gertrudis Gómez de Avellaneda: 350 mts, Plaza del Gallo, Soledad o Solidaridad: 800 mts, Museo Provincial Ignacio Agramonte: 850 mts, Playa Santa Lucía: 120 km.', 4, 'Camagüey', '0', 60, '0', '0', '1', '0', '21.3800905', '-77.9210099');
