INSERT INTO `hotels` VALUES (105, 'Versalles', 0, 'InCubaTravel le ofrece la oportunidad de alojarse en El Hotel Versalles, se localiza en el Reparto Residencial de Versalles al este de la ciudad de Santiago de Cuba, rodeado de una armoniosa tranquilidad, se distingue por un servicio que prestigia costumbres, tradiciones y forma de vida del Oriente cubano, es ideal para familias y grupos, estancias cortas, excursiones, recomendado para las celebraciones de turismo de eventos y congresos. Su ubicación lo hace el Hotel Emblemático de Santiago de Cuba, dentro del Centro Histórico de la Ciudad, auténtica capital del Caribe y a pocos minutos del Aeropuerto Internacional de la ciudad de Santiago de Cuba. Ofrece a los huéspedes la posibilidad de visitar atracciones histórico-culturales.\r\n\r\nEl hotel pone a disposición de sus clientes Piscina abierta con área para niños, áreas deportivas para las prácticas de voleibol y baloncesto, animación nocturna y diurna, happy hours en piscina, servicio de Taxi, cambio de moneda 24 horas, internet 24 horas, servicios médicos, Tienda de regalos. Alguno de estos servicios requiere pago adicional.\r\n\r\nEl Hotel Versalles cuenta con Restaurante (buffet y a la carta), Cafetería con modalidades de Show Cooking, Lobby Bar, Snack-Bar, Discoteca y Parrillada (con show incluido).', 'InCubaTravel le ofrece la oportunidad de alojarse en El Hotel Versalles, se localiza en el Reparto Residencial de Versalles al este de la ciudad de Santiago de Cuba, rodeado de una armoniosa tranquilidad, se distingue por un servicio que prestigia costumbres, tradiciones y forma de vida del Oriente cubano, es ideal para familias y grupos, estancias cortas, excursiones, recomendado para las celebraciones de turismo de eventos y congresos. Su ubicación lo hace el Hotel Emblemático de Santiago de Cuba, dentro del Centro Histórico de la Ciudad, auténtica capital del Caribe y a pocos minutos del Aeropuerto Internacional de la ciudad de Santiago de Cuba. Ofrece a los huéspedes la posibilidad de visitar atracciones histórico-culturales.\r\n\r\nEl hotel pone a disposición de sus clientes Piscina abierta con área para niños, áreas deportivas para las prácticas de voleibol y baloncesto, animación nocturna y diurna, happy hours en piscina, servicio de Taxi, cambio de moneda 24 horas, internet 24 horas, servicios médicos, Tienda de regalos. Alguno de estos servicios requiere pago adicional.\r\n\r\nEl Hotel Versalles cuenta con Restaurante (buffet y a la carta), Cafetería con modalidades de Show Cooking, Lobby Bar, Snack-Bar, Discoteca y Parrillada (con show incluido).', 3, 'Santiago de Cuba', '0', 95, '0', '0', '0', '0', '11.585958', '- 85.2258569');
