INSERT INTO `hotels` VALUES (107, 'Casa Granda', 0, 'InCubaTravel le ofrece la oportunidad de alojarse en el céntrico hotel Casa Granda, ubicado junto al Parque Céspedes. Este hotel histórico construido en 1914 está a un minuto a pie del Museo Diego Velázquez y a 11 minutos de la animada Plaza de Marte. \r\nCuenta con 58 habitaciones sencillas, están decoradas con estilo clásico y disponen de minibar y televisión por cable.\r\nEl desayuno es gratuito. Las instalaciones también cuentan con un elegante restaurante con lámparas de araña y un bar con terraza y vistas al parque.\r\nEl visitante de Santiago de Cuba puede admirar la hermosa ciudad desde las confortables instalaciones de este Hotel, las cuales han sido restauradas para recuperar su esplendor original.', 'The Casagranda Hotels is situated in the very heart of Santiago de Cuba, the most Caribbean city in the country, facing famous Parque Cespedes. The Metropolitan Cathedral, Carnival Museum and the house of Governor Diego Velazquez, currently a historical museum, are all at a walking distance. Guests will be thrilled by the marvelous view of the city. The hotel was currently restored to its former splendor. Recommended for the historical segment of the market!\r\n', 4, 'Santiago de Cuba', '0', 97, '0', '0', '0', '0', '23.1446657 ', '-82.444415');
INSERT INTO `hotels` VALUES (108, 'Gran Hotel', 0, 'InCubaTravel le ofrece la oportunidad de alojarse en el céntrico Gran Hotel, disfrutando de la magia característica de los Hoteles con encanto. Con un estándar de 4 estrellas se privilegia con su localización en la calle Enramadas, la principal arteria comercial de Santiago de Cuba. Desde su ventajosa posición, es un punto de referencia para aquellos que visitan el destino turístico y deseen sentir las palpitaciones de la vida citadina en el interior del casco histórico. Construido en 1910, es representativo del estilo Chicago con elementos eclécticos y notable influencia neoclásica. Las características inherentes al Gran Hotel generan un gran móvil para visitantes interesados por la historia, la cultura y la sociedad santiaguera, que podrán disfrutar de una confortable estancia en un ambiente hospitalario y acogedor.\r\nCon sólo 42 habitaciones (39 estándares y 3 junior suites) garantiza a sus clientes un servicio personalizado y a la medida, creando un ambiente de familiaridad y distinción.', 'InCubaTravel le ofrece la oportunidad de alojarse en el céntrico Gran Hotel, disfrutando de la magia característica de los Hoteles con encanto. Con un estándar de 4 estrellas se privilegia con su localización en la calle Enramadas, la principal arteria comercial de Santiago de Cuba. Desde su ventajosa posición, es un punto de referencia para aquellos que visitan el destino turístico y deseen sentir las palpitaciones de la vida citadina en el interior del casco histórico. Construido en 1910, es representativo del estilo Chicago con elementos eclécticos y notable influencia neoclásica. Las características inherentes al Gran Hotel generan un gran móvil para visitantes interesados por la historia, la cultura y la sociedad santiaguera, que podrán disfrutar de una confortable estancia en un ambiente hospitalario y acogedor.\r\nCon sólo 42 habitaciones (39 estándares y 3 junior suites) garantiza a sus clientes un servicio personalizado y a la medida, creando un ambiente de familiaridad y distinción.', 4, 'Santiago de Cuba', '0', 98, '0', '0', '0', '0', '20.021645', '-75.8300547');
INSERT INTO `hotels` VALUES (109, 'Hotel E Imperial', 0, 'Localizado en la céntrica calle Enramadas, la principal arteria comercial de Santiago de Cuba, se localiza, junto al emblemático Hotel Casa Granda y los Hoteles E Gran Hotel y San Basilio, el complejo hotelero Hotel E Imperial.\r\nA su alrededor se agrupan edificios importantes tanto por sus funciones como por sus valores arquitectónicos e históricos, como el Palacio de Gobierno Municipal, la Catedral metropolitana, museo de Diego Velázquez, Galería de Arte entre otros.\r\nEl hotel Imperial de estilo ecléctico es una de las piezas más representativas de la arquitectura Santiaguera de todo el siglo XX. Cuenta con 4 niveles, en los tres pisos superiores se encuentran las 39 habitaciones, todas con aire acondicionado, baños privados con secador de pelo, minibar, cafetera, plancha y tabla de planchar.\r\nUbicado en la azotea con vistas espectaculares a la ciudad, se encuentra el snack-bar \"El Dorado\", donde además de las vistas podrá disfrutar de una puesta de sol, acompañada de un refrescante cóctel y de la amable atención personalizada de su personal.', 'Localizado en la céntrica calle Enramadas, la principal arteria comercial de Santiago de Cuba, se localiza, junto al emblemático Hotel Casa Granda y los Hoteles E Gran Hotel y San Basilio, el complejo hotelero Hotel E Imperial.\r\nA su alrededor se agrupan edificios importantes tanto por sus funciones como por sus valores arquitectónicos e históricos, como el Palacio de Gobierno Municipal, la Catedral metropolitana, museo de Diego Velázquez, Galería de Arte entre otros.\r\nEl hotel Imperial de estilo ecléctico es una de las piezas más representativas de la arquitectura Santiaguera de todo el siglo XX. Cuenta con 4 niveles, en los tres pisos superiores se encuentran las 39 habitaciones, todas con aire acondicionado, baños privados con secador de pelo, minibar, cafetera, plancha y tabla de planchar.\r\nUbicado en la azotea con vistas espectaculares a la ciudad, se encuentra el snack-bar \"El Dorado\", donde además de las vistas podrá disfrutar de una puesta de sol, acompañada de un refrescante cóctel y de la amable atención personalizada de su personal.', 4, 'Santiago de Cuba', '0', 99, '0', '0', '0', '0', '20.0241065', '-75.8279543');
INSERT INTO `hotels` VALUES (110, 'Brisas Sierra Mar', 0, 'La Sierra Maestra y el Mar Caribe se funden en un paisaje apacible y hermoso, donde se halla insertado el Todo Incluido Brisas Sierra Mar - Los Galeones de categoría 4 estrellas, hotel recomendado por InCubaTravel para el disfrute de sus clientes.\r\nSol, playa, cerros, palmeras, agradable clima y un servicio esmerado completaran la estancia del visitante.\r\nEl hotel Brisas Sierra Mar dispone de piscinas para adultos y niños, club infantil, animación diurna y nocturna, juegos de mesas, deportes náuticos no motorizados, clases de iniciación al buceo (en la piscina), clases de baile y de idioma español. Servicio de alimentos ligeros y bebidas las 24 horas. Servicios Wi-Fi Servicios no incluidos Servicio de telefonía nacional e internacional, internet, servicio de taxi, tienda de regalos, renta de autos, lavandería, buró de ventas de excursiones, peluquería, masajes, caja de seguridad. Algunos de estos servicios requieren pago adicional\r\nEl hotel cuenta con 1 Restaurante buffet y 3 Restaurantes especializados a la carta, parrillada en la playa y cafetería, ranchón de playa, lobby bar, bar piscina, bar-playa y bar en la sala de fiesta.\r\nSus 200 habitaciones de ellas 139 doble estándar, y 61 sencillas, todas con balcones, aire acondicionado, TV vía satélite, secador de pelo, teléfono, y caja de seguridad le ofrece a sus huéspedes una estancia tranquila y placentera.', 'La Sierra Maestra y el Mar Caribe se funden en un paisaje apacible y hermoso, donde se halla insertado el Todo Incluido Brisas Sierra Mar - Los Galeones de categoría 4 estrellas, hotel recomendado por InCubaTravel para el disfrute de sus clientes.\r\nSol, playa, cerros, palmeras, agradable clima y un servicio esmerado completaran la estancia del visitante.\r\nEl hotel Brisas Sierra Mar dispone de piscinas para adultos y niños, club infantil, animación diurna y nocturna, juegos de mesas, deportes náuticos no motorizados, clases de iniciación al buceo (en la piscina), clases de baile y de idioma español. Servicio de alimentos ligeros y bebidas las 24 horas. Servicios Wi-Fi Servicios no incluidos Servicio de telefonía nacional e internacional, internet, servicio de taxi, tienda de regalos, renta de autos, lavandería, buró de ventas de excursiones, peluquería, masajes, caja de seguridad. Algunos de estos servicios requieren pago adicional\r\nEl hotel cuenta con 1 Restaurante buffet y 3 Restaurantes especializados a la carta, parrillada en la playa y cafetería, ranchón de playa, lobby bar, bar piscina, bar-playa y bar en la sala de fiesta.\r\nSus 200 habitaciones de ellas 139 doble estándar, y 61 sencillas, todas con balcones, aire acondicionado, TV vía satélite, secador de pelo, teléfono, y caja de seguridad le ofrece a sus huéspedes una estancia tranquila y placentera', 4, 'Santiago de Cuba', '0', 100, '0', '0', '0', '0', '19.96917', '-76.3237047');
