INSERT INTO `hotels` VALUES (114, 'Iberostar Tainos', 5, 'InCubaTravel le ofrece la oportunidad de alojarse en el majestuoso hotel IBEROSTAR Taínos, un alojamiento con Todo Incluido en Varadero de 4 estrellas situado en una hermosa playa, en la costa norte de la isla de Cuba. Decorado en un estilo tradicional caribeño, este hotel para parejas y familias con niños en Cuba ofrece cómodas estancias en sus 272 habitaciones rodeadas de jardines tropicales, además de una interesante oferta de ocio para toda la familia y una exquisita gastronomía que mezcla lo mejor de la cocina cubana e internacional.\r\n\r\nEn los fogones del Restaurante Criollo del hotel IBEROSTAR Taínos se cocinan los mejores platos tradicionales de Cuba. Un placer irresistible que, a través del paladar, acerca al cliente a la cultura popular del país.\r\n\r\nEl bello entorno natural en el que se encuentra el hotel IBEROSTAR Taínos lo convierte en el escenario perfecto para celebrar bodas y disfrutar de románticas lunas de miel en Varadero.\r\n\r\nEl hotel IBEROSTAR Taínos dispone de 272 acogedoras habitaciones divididas en 136 habitaciones dobles con 2 camas y 136 habitaciones con cama King size. Las habitaciones están distribuidas en un edificio de 4 plantas y en 17 bungalows de 2 plantas. Todas las habitaciones, perfectamente equipadas regalan a sus huéspedes tranquilas y agradables estancias.', 'InCubaTravel le ofrece la oportunidad de alojarse en el majestuoso hotel IBEROSTAR Taínos, un alojamiento con Todo Incluido en Varadero de 4 estrellas situado en una hermosa playa, en la costa norte de la isla de Cuba. Decorado en un estilo tradicional caribeño, este hotel para parejas y familias con niños en Cuba ofrece cómodas estancias en sus 272 habitaciones rodeadas de jardines tropicales, además de una interesante oferta de ocio para toda la familia y una exquisita gastronomía que mezcla lo mejor de la cocina cubana e internacional.\r\n\r\nEn los fogones del Restaurante Criollo del hotel IBEROSTAR Taínos se cocinan los mejores platos tradicionales de Cuba. Un placer irresistible que, a través del paladar, acerca al cliente a la cultura popular del país.\r\n\r\nEl bello entorno natural en el que se encuentra el hotel IBEROSTAR Taínos lo convierte en el escenario perfecto para celebrar bodas y disfrutar de románticas lunas de miel en Varadero.\r\n\r\nEl hotel IBEROSTAR Taínos dispone de 272 acogedoras habitaciones divididas en 136 habitaciones dobles con 2 camas y 136 habitaciones con cama King size. Las habitaciones están distribuidas en un edificio de 4 plantas y en 17 bungalows de 2 plantas. Todas las habitaciones, perfectamente equipadas regalan a sus huéspedes tranquilas y agradables estancias.', 4, 'Varadero', '0', 104, '0', '1', '1', '0', '23.1880944', '-81.1789943');
INSERT INTO `hotels` VALUES (115, 'Iberostar Playa Alameda', 3, 'InCubaTravel le ofrece la oportunidad de alojarse en el majestuoso hotel 5 estrellas con Todo Incluido en Varadero Iberostar Playa Alameda, excelente resort para disfrutar de unas vacaciones sensacionales en Cuba. El hotel IBEROSTAR Playa Alameda está situado en primera línea de la playa de Varadero y rodeado de una extensa vegetación tropical que hace del hotel un sitio mágico donde alojarse frente al mar Caribe. Además, su amplia oferta de entretenimiento, su reputado servicio de gastronomía y la cercanía al centro urbano de Varadero convierten a este hotel en uno de los destinos favoritos de quienes visitan la isla de Cuba y en concreto las playas de la costa norte.\r\n\r\nEl hotel IBEROSTAR Playa Alameda pone a disposición de sus huéspedes una amplia lista de bares y restaurantes que ofrecen la mejor gastronomía cubana e internacional de Varadero. En los restaurantes a la carta los diferentes platos de comida muy elaborada resultan siempre atractivos.\r\n\r\nCuenta con 391 habitaciones dobles en Varadero con balcón o terraza, perfectamente equipadas con todos los detalles para que los huéspedes no echen nada de menos. Además, algunas de las habitaciones dobles pueden unirse a través de una puerta para lograr más espacio en caso de necesitarse. Queda a elección del huésped las vistas desde la habitación ya que podrá elegir entre alojarse frente al mar Caribe o frente a los jardines tropicales (sujeto a disponibilidad).\r\n\r\nEl hotel IBEROSTAR Playa Alameda es sinónimo de diversión en Varadero. Los niños pueden disfrutar de las actividades que el hotel organiza para ellos; los adultos se deleitarán durante las noches de música y baile en el hotel y podrán también relajarse en el spa. Los más deportistas, por su parte, tiene la oportunidad de practicar muchas disciplinas deportivas en la playa de Varadero sin cargo adicional y sin moverse del hotel.', 'InCubaTravel le ofrece la oportunidad de alojarse en el majestuoso hotel 5 estrellas con Todo Incluido en Varadero Iberostar Playa Alameda, excelente resort para disfrutar de unas vacaciones sensacionales en Cuba. El hotel IBEROSTAR Playa Alameda está situado en primera línea de la playa de Varadero y rodeado de una extensa vegetación tropical que hace del hotel un sitio mágico donde alojarse frente al mar Caribe. Además, su amplia oferta de entretenimiento, su reputado servicio de gastronomía y la cercanía al centro urbano de Varadero convierten a este hotel en uno de los destinos favoritos de quienes visitan la isla de Cuba y en concreto las playas de la costa norte.\r\n\r\nEl hotel IBEROSTAR Playa Alameda pone a disposición de sus huéspedes una amplia lista de bares y restaurantes que ofrecen la mejor gastronomía cubana e internacional de Varadero. En los restaurantes a la carta los diferentes platos de comida muy elaborada resultan siempre atractivos.\r\n\r\nCuenta con 391 habitaciones dobles en Varadero con balcón o terraza, perfectamente equipadas con todos los detalles para que los huéspedes no echen nada de menos. Además, algunas de las habitaciones dobles pueden unirse a través de una puerta para lograr más espacio en caso de necesitarse. Queda a elección del huésped las vistas desde la habitación ya que podrá elegir entre alojarse frente al mar Caribe o frente a los jardines tropicales (sujeto a disponibilidad).\r\n\r\nEl hotel IBEROSTAR Playa Alameda es sinónimo de diversión en Varadero. Los niños pueden disfrutar de las actividades que el hotel organiza para ellos; los adultos se deleitarán durante las noches de música y baile en el hotel y podrán también relajarse en el spa. Los más deportistas, por su parte, tiene la oportunidad de practicar muchas disciplinas deportivas en la playa de Varadero sin cargo adicional y sin moverse del hotel.', 4, 'Varadero', '0', 105, '0', '1', '1', '0', '23.20068', '-81.1351887');
INSERT INTO `hotels` VALUES (116, 'Iberostar Laguna Azul', 5, 'InCubaTravel le ofrece la oportunidad de alojarse en el magnífico hotel Iberostar Playa Alameda, resort de playa tranquilo con vistas al Golfo de México ubicado en la Península de Hicacos, a 1,9 km de la Reserva Ecológica Varahicacos y a 9 km del Varadero Golf Club. \r\n\r\nLas 814 habitaciones son informales e incluyen muebles de madera, televisiones de pantalla plana y minibares. Las habitaciones superiores tienen vistas al mar, teteras y cafeteras. Las suites ofrecen reproductores de DVD, balcones o terrazas.\r\n\r\nLos 5 restaurantes y 6 bares sirven comida y bebida de forma gratuita. Entre las demás instalaciones destacan 6 piscinas exteriores (algunas con bares acuáticos), gimnasio, playa y spa con sauna y hammam. Hay también un club infantil y deportes acuáticos', 'InCubaTravel le ofrece la oportunidad de alojarse en el magnífico hotel Iberostar Playa Alameda, resort de playa tranquilo con vistas al Golfo de México ubicado en la Península de Hicacos, a 1,9 km de la Reserva Ecológica Varahicacos y a 9 km del Varadero Golf Club. \r\n\r\nLas 814 habitaciones son informales e incluyen muebles de madera, televisiones de pantalla plana y minibares. Las habitaciones superiores tienen vistas al mar, teteras y cafeteras. Las suites ofrecen reproductores de DVD, balcones o terrazas.\r\n\r\nLos 5 restaurantes y 6 bares sirven comida y bebida de forma gratuita. Entre las demás instalaciones destacan 6 piscinas exteriores (algunas con bares acuáticos), gimnasio, playa y spa con sauna y hammam. Hay también un club infantil y deportes acuáticos', 5, 'Varadero', '0', 105, '0', '1', '1', '0', '23.2016176', '-81.1445472');
INSERT INTO `hotels` VALUES (117, 'Iberostar Varadero', 5, 'El hotel IBEROSTAR Varadero es un lujoso hotel 5 estrellas con servicio Todo Incluido que puede reservar vía online a través de InCubaTravel, se encuentra en primera línea de mar, frente a la kilométrica playa de Varadero, en Cuba. La calidad de sus servicios, la amplitud de sus habitaciones, así como la amplia oferta de actividades de entretenimiento hacen de este hotel de lujo una perfecta opción para unas increíbles vacaciones en familia en Varadero. El Hotel Iberostar Varadero les regala a quienes se alojen experiencias llenas de esencia cubana a través de su gastronomía y su música. Las vacaciones en Playa de Varadero pueden resultar inolvidables.', 'El hotel IBEROSTAR Varadero es un lujoso hotel 5 estrellas con servicio Todo Incluido que puede reservar vía online a través de InCubaTravel, se encuentra en primera línea de mar, frente a la kilométrica playa de Varadero, en Cuba. La calidad de sus servicios, la amplitud de sus habitaciones, así como la amplia oferta de actividades de entretenimiento hacen de este hotel de lujo una perfecta opción para unas increíbles vacaciones en familia en Varadero. El Hotel Iberostar Varadero les regala a quienes se alojen experiencias llenas de esencia cubana a través de su gastronomía y su música. Las vacaciones en Playa de Varadero pueden resultar inolvidables.', 5, 'Varadero', '0', 107, '0', '1', '1', '0', '23.1897799', '-81.2010856');
INSERT INTO `hotels` VALUES (118, 'Iberostar Parque Central', 7, 'Este hotel elegante junto al Parque Central se encuentra a 6 minutos a pie del Capitolio Nacional y a 14 minutos a pie del Malecón. Elegante hotel 5 estrellas ubicado en el mismo centro de la ciudad.\r\n\r\nEl hotel IBEROSTAR Parque Central, el cual puede reservar online desde nuestro sitio web www.incubatravel.com, es un punto de partida excelente para que los visitantes recorran la historia cubana y se adentren en los rincones de La Habana más auténtica. Una elección que hará de sus vacaciones familiares o en pareja en la capital cubana una experiencia irrepetible.\r\n\r\nLas habitaciones son acogedoras y cuentan con televisión por satélite, minibar, cafetera y balcón. Algunas tienen suelos de madera o vistas al Capitolio Nacional. Las suites están decoradas con muebles antiguos y disponen de sala de estar/comedor independiente.\r\n\r\nEl hotel cuenta con 3 restaurantes, que sirven comida internacional, criolla y mediterránea, una piscina exterior, una zona de spa y un gimnasio. El bar del vestíbulo, rodeado de palmeras, le ofrece espacios de música cubana en directo todas las noches.', 'Este hotel elegante junto al Parque Central se encuentra a 6 minutos a pie del Capitolio Nacional y a 14 minutos a pie del Malecón. Elegante hotel 5 estrellas ubicado en el mismo centro de la ciudad.\r\n\r\nEl hotel IBEROSTAR Parque Central, el cual puede reservar online desde nuestro sitio web www.incubatravel.com, es un punto de partida excelente para que los visitantes recorran la historia cubana y se adentren en los rincones de La Habana más auténtica. Una elección que hará de sus vacaciones familiares o en pareja en la capital cubana una experiencia irrepetible.\r\n\r\nLas habitaciones son acogedoras y cuentan con televisión por satélite, minibar, cafetera y balcón. Algunas tienen suelos de madera o vistas al Capitolio Nacional. Las suites están decoradas con muebles antiguos y disponen de sala de estar/comedor