INSERT INTO `hotels` VALUES (150, 'Vueltabajo', 0, 'El Hotel Vueltabajo lleva el nombre de la fértil región al sur de la ciudad de Pinar del Río, donde el tabaco que se cultiva es el de mejor calidad del mundo. \r\n\r\nLa edificación se destaca por su sencilla decoración, centrándose en la funcionalidad y la comodidad de sus habitaciones. La instalación es ideal para hacer una parada intermedia entre La Habana y los tesoros naturales del Centro Internacional de Buceo María La Gorda y el Cabo de San Antonio.\r\n', 'El Hotel Vueltabajo lleva el nombre de la fértil región al sur de la ciudad de Pinar del Río, donde el tabaco que se cultiva es el de mejor calidad del mundo. \r\n\r\nLa edificación se destaca por su sencilla decoración, centrándose en la funcionalidad y la comodidad de sus habitaciones. La instalación es ideal para hacer una parada intermedia entre La Habana y los tesoros naturales del Centro Internacional de Buceo María La Gorda y el Cabo de San Antonio.\r\n', 3, 'Pinar del Río', '0', 140, '0', '1', '0', '0', '0', '0');
