INSERT INTO `hotels` VALUES (161, 'Tulipan', 0, 'El Hotel Tulipán está ubicado en el barrio Nuevo Vedado, muy cerca de la Avenida Rancho Boyeros y en las inmediaciones del Hotel Bella Habana. \r\n\r\nDesde el Tulipán es muy fácil visitar sitios de interés como el casco histórico de La Habana Vieja, el Teatro Nacional, la Plaza de la Revolución y el Museo Memorial José Martí. \r\n\r\nEste hotel está conformado por 326 habitaciones básicas. Todas cuentan con aire acondicionado, baño privado, TV satélite y teléfono.\r\n', 'El Hotel Tulipán está ubicado en el barrio Nuevo Vedado, muy cerca de la Avenida Rancho Boyeros y en las inmediaciones del Hotel Bella Habana. \r\n\r\nDesde el Tulipán es muy fácil visitar sitios de interés como el casco histórico de La Habana Vieja, el Teatro Nacional, la Plaza de la Revolución y el Museo Memorial José Martí. \r\n\r\nEste hotel está conformado por 326 habitaciones básicas. Todas cuentan con aire acondicionado, baño privado, TV satélite y teléfono.\r\n', 3, 'La Habana', '0', 151, '0', '1', '0', '0', '0', '0');
INSERT INTO `hotels` VALUES (162, 'Bella Habana Aeropuerto', 0, 'El Hotel Bella Habana se encuentra en el barrio de Nuevo Vedado, cerca de la Avenida Rancho Boyeros, la cual llega hasta el Aeropuerto Internacional José Martí y es una de las principales arterias de la capital cubana. \r\n\r\nDesde el hotel puede llegar rápidamente a sitios de interés como el casco histórico de La Habana Vieja, el Teatro Nacional, la Plaza de la Revolución y el Museo Memorial José Martí.\r\n', 'El Hotel Bella Habana se encuentra en el barrio de Nuevo Vedado, cerca de la Avenida Rancho Boyeros, la cual llega hasta el Aeropuerto Internacional José Martí y es una de las principales arterias de la capital cubana. \r\n\r\nDesde el hotel puede llegar rápidamente a sitios de interés como el casco histórico de La Habana Vieja, el Teatro Nacional, la Plaza de la Revolución y el Museo Memorial José Martí.\r\n', 3, 'La Habana', '0', 152, '0', '1', '0', '0', '0', '0');
