INSERT INTO `hotels` VALUES (167, 'Varazul', 0, 'Esta opción de aparthotel económico en el centro de Varadero es ideal para aquellos que buscan el disfrute de playas y ciudad. Cuenta con 69 habitaciones.  Tiene dos restaurantes - el restaurante buffet \"El Búho\" y el restaurante \"Papa Fundo\" - un bar llamado \"Blue Star\", un lobby bar, un snack bar en la piscina, el bar y parrillada \"Varazul\" en la terraza, y un pub musical, \"La Pachanga\".', 'Esta opción de aparthotel económico en el centro de Varadero es ideal para aquellos que buscan el disfrute de playas y ciudad. Cuenta con 69 habitaciones.  Tiene dos restaurantes - el restaurante buffet \"El Búho\" y el restaurante \"Papa Fundo\" - un bar llamado \"Blue Star\", un lobby bar, un snack bar en la piscina, el bar y parrillada \"Varazul\" en la terraza, y un pub musical, \"La Pachanga\".', 2, 'Varadero', '0', 157, '0', '1', '0', '0', '0', '0');
