INSERT INTO `hotels` VALUES (169, 'Acuazul', 0, 'El Acuazul es un resort agradable y bien diseñado, situado en la parte tradicional de Varadero. Fue construido en 1991 y conserva su encanto y atmósfera acogedora. Los últimos pisos de la instalación tienen una hermosa panorámica de Varadero. \r\nCuenta con habitaciones sencillas, pero cómodas, con un estilo tropical, al igual que la arquitectura interior. Además, tiene una piscina y un bar.\r\n', 'El Acuazul es un resort agradable y bien diseñado, situado en la parte tradicional de Varadero. Fue construido en 1991 y conserva su encanto y atmósfera acogedora. Los últimos pisos de la instalación tienen una hermosa panorámica de Varadero. \r\nCuenta con habitaciones sencillas, pero cómodas, con un estilo tropical, al igual que la arquitectura interior. Además, tiene una piscina y un bar.\r\n', 3, 'Varadero', '0', 159, '0', '1', '0', '0', '0', '0');
INSERT INTO `hotels` VALUES (170, 'Mar del Sur', 0, 'Mar del Sur es un espacioso complejo con instalaciones diseñadas para pasar unas confortables vacaciones o largas estancias (invernales) de grupos o familias.\r\nCon 361 habitaciones perfectamente equipadas el hotel le ofrece a sus clientes estancias acogedoras e inmejorables. \r\n\r\nUna recomendación es que disfrute de la piscina donde siempre hay actividades deportivas o culturales. También, puedes llegar a la playa y caminar por la arena y bañarte en las aguas de Varadero\r\n', 'Mar del Sur es un espacioso complejo con instalaciones diseñadas para pasar unas confortables vacaciones o largas estancias (invernales) de grupos o familias.\r\nCon 361 habitaciones perfectamente equipadas el hotel le ofrece a sus clientes estancias acogedoras e inmejorables. \r\n\r\nUna recomendación es que disfrute de la piscina donde siempre hay actividades deportivas o culturales. También, puedes llegar a la playa y caminar por la arena y bañarte en las aguas de Varadero\r\n', 2, 'Varadero', '0', 160, '0', '1', '0', '0', '0', '0');
INSERT INTO `hotels` VALUES (171, 'Delfines', 0, 'El hotel Los Delfines se inscribe entre los alojamientos históricos del reconocido balneario de Varadero, con una vasta experiencia y arraigada cultura del buen servicio. \r\nUbicado en la primera línea de playa, esta instalación se distingue por el trato personalizado a sus clientes, y el agradable y confortable ambiente de sus instalaciones.\r\nCon 103 habitaciones perfectamente equipadas el hotel le ofrece a sus clientes estancias agradables y recuerdos inmemorables\r\n', 'El hotel Los Delfines se inscribe entre los alojamientos históricos del reconocido balneario de Varadero, con una vasta experiencia y arraigada cultura del buen servicio. \r\nUbicado en la primera línea de playa, esta instalación se distingue por el trato personalizado a sus clientes, y el agradable y confortable ambiente de sus instalaciones.\r\nCon 103 habitaciones perfectamente equipadas el hotel le ofrece a sus clientes estancias agradables y recuerdos inmemorables\r\n', 3, 'Varadero', '0', 161, '0', '1', '0', '0', '0', '0');
