INSERT INTO `hotels` VALUES (173, 'Club Tropical', 0, 'El Club Tropical está situado en la zona hotelera de Varadero, a 26 kilómetros del Aeropuerto Internacional \"Juan Gualberto Gómez\" de Varadero.\r\nEste hotel es reconocido por ofrecer a sus huéspedes estancias agradables y placenteras con opciones recreativas, un cordial y amable servicio, animación y deportes acuáticos. También, se destaca por sus servicios personalizados, su ambiente caribeño y su combinación de mar y sol.\r\n', 'El Club Tropical está situado en la zona hotelera de Varadero, a 26 kilómetros del Aeropuerto Internacional \"Juan Gualberto Gómez\" de Varadero.\r\nEste hotel es reconocido por ofrecer a sus huéspedes estancias agradables y placenteras con opciones recreativas, un cordial y amable servicio, animación y deportes acuáticos. También, se destaca por sus servicios personalizados, su ambiente caribeño y su combinación de mar y sol.\r\n', 3, 'Varadero', '0', 163, '0', '1', '0', '0', '0', '0');
