INSERT INTO `hotels` VALUES (175, 'Club Karey', 0, 'El Club Karey es un resort todo incluido conformado por un conjunto de atractivos edificios y jardines. Sus 107 habitaciones han sido completamente remodeladas y ofrecen una excelente relación calidad-precio. Con un ambiente sencillo y tranquilo, esta edificación es ideal para familias y parejas que deseen pasar unas vacaciones en la mayor intimidad y relajación. La instalación está situada en una hermosa playa de arenas blancas, a 25 minutos del aeropuerto y a menos de 1 kilómetro del centro de Varadero.', 'El Club Karey es un resort todo incluido conformado por un conjunto de atractivos edificios y jardines. Sus 107 habitaciones han sido completamente remodeladas y ofrecen una excelente relación calidad-precio. Con un ambiente sencillo y tranquilo, esta edificación es ideal para familias y parejas que deseen pasar unas vacaciones en la mayor intimidad y relajación. La instalación está situada en una hermosa playa de arenas blancas, a 25 minutos del aeropuerto y a menos de 1 kilómetro del centro de Varadero.', 3, 'Varadero', '0', 165, '0', '1', '0', '0', '0', '0');
INSERT INTO `hotels` VALUES (176, 'Pasacaballo', 0, 'A la entrada de la bahía de Cienfuegos se encuentra el hotel Pasacaballo, que ofrece hermosas vistas desde sus habitaciones y es un lugar donde se puede acceder a zona histórica de esta ciudad. \r\n\r\nDesde el recinto hotelero se puede acceder al Jardín Botánico, con una amplia variedad de flora autóctona y exótica. Además, podrás realizar un recorrido por la bahía cienfueguera, y visitar la Fortaleza de Nuestra Señora de los Ángeles de Jagua. \r\n\r\nA solo unos pocos kilómetros, se encuentra la playa Rancho Luna y el delfinario.\r\n', 'A la entrada de la bahía de Cienfuegos se encuentra el hotel Pasacaballo, que ofrece hermosas vistas desde sus habitaciones y es un lugar donde se puede acceder a zona histórica de esta ciudad. \r\n\r\nDesde el recinto hotelero se puede acceder al Jardín Botánico, con una amplia variedad de flora autóctona y exótica. Además, podrás realizar un recorrido por la bahía cienfueguera, y visitar la Fortaleza de Nuestra Señora de los Ángeles de Jagua. \r\n\r\nA solo unos pocos kilómetros, se encuentra la playa Rancho Luna y el delfinario.\r\n', 2, 'Cienfuegos', '0', 166, '0', '1', '0', '0', '0', '0');
