INSERT INTO `hotels` VALUES (183, 'Rijo-Plaza', 0, 'Hotel Rijo, es perfecto para aquellos que quisieran explorar la maravillosa ciudad de Sancti Spiritus, descubrir sus tradiciones, costumbres y la vida de la gente común. Originalmente fue construido como mansión de la familia en el 1827 y en esa etapa fue la residencia del renombrado, e ilustre doctor Rudesindo García Rijo, del cual toma el nombre el hostal. \r\n\r\nDesde el 18 de noviembre del 2001, el día de su apertura oficial como Hostal, éste se ha considerado, uno de los edificios turísticos más atractivos del la ciudad de Sancti Spíritus. \r\n\r\nSu localización, a la vista de la iglesia Parroquial Mayor y muy cerca del puente sobre el Río Yayabo, los cuales son ambos monumentos nacionales, permite que los huéspedes retrocedan en el tiempo, mientras caminan a través de las calles estrechas de Sancti Spíritus que datan de 1514.\r\n', 'Hotel Rijo, es perfecto para aquellos que quisieran explorar la maravillosa ciudad de Sancti Spiritus, descubrir sus tradiciones, costumbres y la vida de la gente común. Originalmente fue construido como mansión de la familia en el 1827 y en esa etapa fue la residencia del renombrado, e ilustre doctor Rudesindo García Rijo, del cual toma el nombre el hostal. \r\n\r\nDesde el 18 de noviembre del 2001, el día de su apertura oficial como Hostal, éste se ha considerado, uno de los edificios turísticos más atractivos del la ciudad de Sancti Spíritus. \r\n\r\nSu localización, a la vista de la iglesia Parroquial Mayor y muy cerca del puente sobre el Río Yayabo, los cuales son ambos monumentos nacionales, permite que los huéspedes retrocedan en el tiempo, mientras caminan a través de las calles estrechas de Sancti Spíritus que datan de 1514.\r\n', 3, 'Santi Spíritus ', '0', 173, '0', '1', '0', '0', '0', '0');
INSERT INTO `hotels` VALUES (184, 'Don Florencio', 0, 'Encanto Don Florencio fue reconstruido y abierto para celebrar el aniversario 500 de la fundación de la ciudad de Sancti Spíritus. Se encuentra en pleno corazón del boulevard en la calle Independencia.\r\n\r\nDon Florencio Méndez fue un espirituano que se enriqueció durante las dos primeras décadas del siglo XX, a causa del elevado nivel económico y social que alcanzó esa región. Razón por la que reedificó su casa al contratar los servicios del maestro de obras Rafael Valero, y le comunicó su deseo de que fuera algo \"majestuoso e irrepetible\".\r\n', 'Encanto Don Florencio fue reconstruido y abierto para celebrar el aniversario 500 de la fundación de la ciudad de Sancti Spíritus. Se encuentra en pleno corazón del boulevard en la calle Independencia.\r\n\r\nDon Florencio Méndez fue un espirituano que se enriqueció durante las dos primeras décadas del siglo XX, a causa del elevado nivel económico y social que alcanzó esa región. Razón por la que reedificó su casa al contratar los servicios del maestro de obras Rafael Valero, y le comunicó su deseo de que fuera algo \"majestuoso e irrepetible\".\r\n', 3, 'Santi Spíritus ', '0', 174, '0', '1', '0', '0', '0', '0');
INSERT INTO `hotels` VALUES (185, 'Rancho Hatuey', 0, 'El hotel Rancho Hatuey cuenta con 74 habitaciones perfectamente equipadas, restaurantes temáticos y gran variedad de animaciones.\r\nEl visitante tiene fácil acceso a las principales atracciones históricas y culturales de la ciudad de Sancti Spíritus, uno de los primeros pueblos fundados por los españoles en Cuba. También puede viajar a la cercana ciudad de Trinidad, Sitio Patrimonio de la Humanidad, a sólo 70 Km. de Sancti Spíritus.\r\n', 'El hotel Rancho Hatuey cuenta con 74 habitaciones perfectamente equipadas, restaurantes temáticos y gran variedad de animaciones.\r\nEl visitante tiene fácil acceso a las principales atracciones históricas y culturales de la ciudad de Sancti Spíritus, uno de los primeros pueblos fundados por los españoles en Cuba. También puede viajar a la cercana ciudad de Trinidad, Sitio Patrimonio de la Humanidad, a sólo 70 Km. de Sancti Spíritus.\r\n', 2, 'Santi Spíritus ', '0', 175, '0', '1', '0', '0', '0', '0');
