INSERT INTO `hotels` VALUES (192, 'Gran Hotel Camagüey', 0, 'El Gran Hotel Camagüey posee una situación privilegiada en el centro de la ciudad de Camagüey, para descubrir los laberintos en sus calles y la conservada arquitectura de sus casas. En la instalación, inaugurada en 1938, aún permanece la magnificencia de su lobby, solo hay que observar el trabajo con el mármol y la madera, que preserva el ambiente de principios del siglo XX.\r\n\r\nEsta edificación ha sido visitada por reconocidos intelectuales como el famoso pianista estadounidense Arthur Rubinstein. También, un detalle pintoresco fue la llegada al hotel del gángster Lucky Luciano.\r\n', 'El Gran Hotel Camagüey posee una situación privilegiada en el centro de la ciudad de Camagüey, para descubrir los laberintos en sus calles y la conservada arquitectura de sus casas. En la instalación, inaugurada en 1938, aún permanece la magnificencia de su lobby, solo hay que observar el trabajo con el mármol y la madera, que preserva el ambiente de principios del siglo XX.\r\n\r\nEsta edificación ha sido visitada por reconocidos intelectuales como el famoso pianista estadounidense Arthur Rubinstein. También, un detalle pintoresco fue la llegada al hotel del gángster Lucky Luciano.\r\n', 3, 'Camagüey', '0', 182, '0', '1', '0', '0', '0', '0');
INSERT INTO `hotels` VALUES (193, 'Colón', 0, 'La ciudad de Camagüey, fundada en el siglo XVI, fue diseñada con sus calles laberínticas para confundir a los piratas que en aquella época intentaron desolarla. Desde entonces, el centro histórico parece un rompecabezas, donde en ocasiones llegamos a un mismo punto, no importa desde dónde partamos. Es por eso que los visitantes se sienten atraídos a desentrañar este laberinto.\r\n\r\nEste acto de exploración y descubrimiento es lo que hace atractivo al viaje en sí mismo, porque cuando camine por las calles de Camagüey se percatará la mezcla de historia y modernidad. \r\n\r\nEl Hotel Colón se inserta dentro de esta fusión, pues aunque permanecen elementos originales de su creación en la década de 1920, la construcción incluye un hermoso trabajo con madera y un patio central donde los huéspedes pueden disfrutar y relajarse. El hotel se destaca por la especialización de sus cocineros (destacándose sus deliciosos dulces) y es renombrada por su comida tradicional cubana.\r\n', 'La ciudad de Camagüey, fundada en el siglo XVI, fue diseñada con sus calles laberínticas para confundir a los piratas que en aquella época intentaron desolarla. Desde entonces, el centro histórico parece un rompecabezas, donde en ocasiones llegamos a un mismo punto, no importa desde dónde partamos. Es por eso que los visitantes se sienten atraídos a desentrañar este laberinto.\r\n\r\nEste acto de exploración y descubrimiento es lo que hace atractivo al viaje en sí mismo, porque cuando camine por las calles de Camagüey se percatará la mezcla de historia y modernidad. \r\n\r\nEl Hotel Colón se inserta dentro de esta fusión, pues aunque permanecen elementos originales de su creación en la década de 1920, la construcción incluye un hermoso trabajo con madera y un patio central donde los huéspedes pueden disfrutar y relajarse. El hotel se destaca por la especialización de sus cocineros (destacándose sus deliciosos dulces) y es renombrada por su comida tradicional cubana.\r\n', 2, 'Camagüey', '0', 183, '0', '1', '0', '0', '0', '0');
