INSERT INTO `hotels` VALUES (197, 'Camagüey', 0, 'El Hotel Camagüey comparte el nombre de la ciudad donde se encuentra, la cual se caracteriza por sus enormes tinajones de barro y por su arquitectura colonial. La edificación está a solo 10 minutos del centro y es la localización perfecta, si usted está planeando descubrir el oriente de Cuba.\r\n\r\nLa instalación está rodeada de jardines, con una piscina espaciosa, salones de reunión y bar. Además, ofrece a sus huéspedes los servicios internacionales, pero con un sabor local lo cual lo animará a recorrer esta ciudad llena de historia y cultura.\r\n', 'El Hotel Camagüey comparte el nombre de la ciudad donde se encuentra, la cual se caracteriza por sus enormes tinajones de barro y por su arquitectura colonial. La edificación está a solo 10 minutos del centro y es la localización perfecta, si usted está planeando descubrir el oriente de Cuba.\r\n\r\nLa instalación está rodeada de jardines, con una piscina espaciosa, salones de reunión y bar. Además, ofrece a sus huéspedes los servicios internacionales, pero con un sabor local lo cual lo animará a recorrer esta ciudad llena de historia y cultura.\r\n', 2, 'Camagüey', '0', 187, '0', '1', '0', '0', '0', '0');
