INSERT INTO `hotels` VALUES (200, 'Don Lino', 0, 'La Villa Don Lino es un sólido hotel que les ofrece a los visitantes todas las comodidades y servicios necesarios para una estancia agradable en una hermosa playa en la costa norte de Holguín. Esta playa es una especie de joya escondida, con azules aguas cristalinas y arena blanca. \r\nEl hotel cuenta con 30 espaciosas y cálidas habitaciones perfectamente equipadas.\r\n\r\nLa playa – con 280 metros de largo y 50 metros de ancho – es lo mejor de la Villa. Don Lino se ha ganado el reconocimiento por ser \"una gran playita\", ya que esta diminuta franja de arena tiene su encanto, por lo hermoso de su entorno natural con cocoteros y uvas caleta. \r\n', 'La Villa Don Lino es un sólido hotel que les ofrece a los visitantes todas las comodidades y servicios necesarios para una estancia agradable en una hermosa playa en la costa norte de Holguín. Esta playa es una especie de joya escondida, con azules aguas cristalinas y arena blanca. \r\nEl hotel cuenta con 30 espaciosas y cálidas habitaciones perfectamente equipadas.\r\n\r\nLa playa – con 280 metros de largo y 50 metros de ancho – es lo mejor de la Villa. Don Lino se ha ganado el reconocimiento por ser \"una gran playita\", ya que esta diminuta franja de arena tiene su encanto, por lo hermoso de su entorno natural con cocoteros y uvas caleta. \r\n', 2, 'Holguín', '0', 190, '0', '1', '0', '0', '0', '0');
