INSERT INTO `hotels` VALUES (205, 'Royalton', 0, 'El Encanto Royalton, frente al Parque Céspedes en el centro de Bayamo, fue uno de los edificios clásicos que fueron restaurados. Esta instalación, que data de 1940, preserva su estilo original arquitectónico, a la vez que se le añadieron comodidades modernas, siendo designada propiedad \"Encanto\", título que reciben algunos selectos hoteles cubanos ubicados en lugares históricos que hacen énfasis en el turismo cultural. \r\n\r\nEste limpio y acogedor hotel económico se ubica en el corazón de Bayamo y es una joya escondida dentro de la ciudad. \r\n\r\nLa edificación cuenta con 33 habitaciones, que reflejan el estilo clásico, sobre todo en el lobby, el bar y el restaurante. Desde la terraza, que da a la calle, así como desde la agradable terraza en la azotea.\r\n', 'El Encanto Royalton, frente al Parque Céspedes en el centro de Bayamo, fue uno de los edificios clásicos que fueron restaurados. Esta instalación, que data de 1940, preserva su estilo original arquitectónico, a la vez que se le añadieron comodidades modernas, siendo designada propiedad \"Encanto\", título que reciben algunos selectos hoteles cubanos ubicados en lugares históricos que hacen énfasis en el turismo cultural. \r\n\r\nEste limpio y acogedor hotel económico se ubica en el corazón de Bayamo y es una joya escondida dentro de la ciudad. \r\n\r\nLa edificación cuenta con 33 habitaciones, que reflejan el estilo clásico, sobre todo en el lobby, el bar y el restaurante. Desde la terraza, que da a la calle, así como desde la agradable terraza en la azotea.', 4, 'Granma', '0', 195, '0', '1', '0', '0', '0', '0');
