INSERT INTO `hotels` VALUES (212, 'Las Américas ', 0, 'Por su ubicación en las inmediaciones de importantes centros de recreación y a unos pasos de una de las más importantes avenidas, resulta una excelente opción de alojamiento para insertarse de inmediato en el ritmo propio de esta populosa urbe del oriente cubano, famosa por su rica historia, la jovialidad de su gente, su música y festividades populares.\r\n\r\nCompetentes servicios y una arraigada cultura de la hospitalidad le harán sentirse como en su propia casa y disfrutar a fondo, sitios como la Casa de la Trova, el Parque Céspedes y la calle Enramada, o hacer incursiones a la periferia de la ciudad como el Parque Histórico Militar Loma de San Juan, el Santuario de la Caridad del Cobre y el Castillo del Morro.\r\n', 'Por su ubicación en las inmediaciones de importantes centros de recreación y a unos pasos de una de las más importantes avenidas, resulta una excelente opción de alojamiento para insertarse de inmediato en el ritmo propio de esta populosa urbe del oriente cubano, famosa por su rica historia, la jovialidad de su gente, su música y festividades populares.\r\n\r\nCompetentes servicios y una arraigada cultura de la hospitalidad le harán sentirse como en su propia casa y disfrutar a fondo, sitios como la Casa de la Trova, el Parque Céspedes y la calle Enramada, o hacer incursiones a la periferia de la ciudad como el Parque Histórico Militar Loma de San Juan, el Santuario de la Caridad del Cobre y el Castillo del Morro.', 3, 'Santiago de Cuba', '0', 202, '0', '1', '0', '0', '0', '0');
