INSERT INTO `hotels` VALUES (214, 'Costa Morena', 0, 'Costa Morena está a unos 45 minutos de la ciudad de Santiago de Cuba, en la Reserva de la Biosfera del Parque Natural Baconao. Este lugar permitirá que te relajes frente a orillas del Mar Caribe.\r\n\r\nTambién es posible la práctica del senderismo y las visitas al Parque Baconao, el Acuario, el Rodeo, el Jardín del Cactus, la Laguna de Baconao, el Valle de la Prehistoria, y varias playas cercanas. Uno de los principales atractivos del hotel es la bienvenida ofrecida por el personal y el carisma de la población local, que invitan a regresar otra vez a este sitio.\r\n\r\nLa instalación cuenta con 115 habitaciones climatizadas, con vista al mar, TV vía satélite, caja de seguridad, radio, y teléfono. Además de restaurante, bar, snack bar, parrillada, piscina natural y artificial, sala de juegos, deportes náuticos, tienda, cambio de moneda, parqueo y alquiler de autos.\r\n', 'Costa Morena está a unos 45 minutos de la ciudad de Santiago de Cuba, en la Reserva de la Biosfera del Parque Natural Baconao. Este lugar permitirá que te relajes frente a orillas del Mar Caribe.\r\n\r\nTambién es posible la práctica del senderismo y las visitas al Parque Baconao, el Acuario, el Rodeo, el Jardín del Cactus, la Laguna de Baconao, el Valle de la Prehistoria, y varias playas cercanas. Uno de los principales atractivos del hotel es la bienvenida ofrecida por el personal y el carisma de la población local, que invitan a regresar otra vez a este sitio.\r\n\r\nLa instalación cuenta con 115 habitaciones climatizadas, con vista al mar, TV vía satélite, caja de seguridad, radio, y teléfono. Además de restaurante, bar, snack bar, parrillada, piscina natural y artificial, sala de juegos, deportes náuticos, tienda, cambio de moneda, parqueo y alquiler de autos.\r\n', 2, 'Santiago de Cuba', '0', 204, '0', '1', '0', '0', '0', '0');
