INSERT INTO `hotels` VALUES (224, 'El Bosque', 0, 'Situado en las inmediaciones del parque Almendares, en la ciudad de la habana, está cercano al parque metropolitano o Bosque de la Habana, un oasis de vegetación exuberante  en medio de la ciudad. El Hotel El Bosque cuenta con 60 habitaciones decoradas y equipadas para asegurarles a sus clientes una estancia agradable.\r\nLas instalaciones con que cuenta el hotel son: sala de conferencias (40 plazas), cafetería La Yagruma, lobby bar, bar Mirador, tienda, lavandería, taxis, coches de alquiler, aparcamiento privado. Además, el restaurante Villa Diana está a pocos metros.\r\n', 'Situado en las inmediaciones del parque Almendares, en la ciudad de la habana, está cercano al parque metropolitano o Bosque de la Habana, un oasis de vegetación exuberante  en medio de la ciudad. El Hotel El Bosque cuenta con 60 habitaciones decoradas y equipadas para asegurarles a sus clientes una estancia agradable.\r\nLas instalaciones con que cuenta el hotel son: sala de conferencias (40 plazas), cafetería La Yagruma, lobby bar, bar Mirador, tienda, lavandería, taxis, coches de alquiler, aparcamiento privado. Además, el restaurante Villa Diana está a pocos metros.\r\n', 3, 'La Habana', '0', 214, '0', '1', '0', '0', '0', '0');
INSERT INTO `hotels` VALUES (225, 'Cabo San Antonio', 0, 'Localizado en la Península de Guanahacabibes, el punto más occidental de Cuba (a unos 345 Km de La Habana). \r\n\r\nLa edificación está rodeada por áreas mayormente vírgenes de exuberante vegetación y prístinas playas, siendo un destino ideal para eco-turistas. \r\n\r\nRetiradas de la playa, entre una densa vegetación, las 16 cabañas con estilo de casa de campo se integran con el entorno y ofrecen a los huéspedes un lugar acogedor. \r\n\r\nVilla Cabo de San Antonio es el único hotel en la zona y definitivamente el lugar donde descansar, bañarse en la playa y disfrutar de la flora y fauna local. La instalación cuenta, además, con recepción, cómodas cabañas y un pequeño restaurante / bar. \r\n\r\nDesde el hotel podrá caminar por maravillosos senderos naturales, rodeados  de una variedad de flora endémica.', 'Localizado en la Península de Guanahacabibes, el punto más occidental de Cuba (a unos 345 Km de La Habana). \r\n\r\nLa edificación está rodeada por áreas mayormente vírgenes de exuberante vegetación y prístinas playas, siendo un destino ideal para eco-turistas. \r\n\r\nRetiradas de la playa, entre una densa vegetación, las 16 cabañas con estilo de casa de campo se integran con el entorno y ofrecen a los huéspedes un lugar acogedor. \r\n\r\nVilla Cabo de San Antonio es el único hotel en la zona y definitivamente el lugar donde descansar, bañarse en la playa y disfrutar de la flora y fauna local. La instalación cuenta, además, con recepción, cómodas cabañas y un pequeño restaurante / bar. \r\n\r\nDesde el hotel podrá caminar por maravillosos senderos naturales, rodeados  de una variedad de flora endémica.', 3, 'Pinar del Río', '0', 215, '0', '1', '0', '0', '0', '0');
INSERT INTO `hotels` VALUES (226, 'María La Gorda', 0, 'Situada en el extremo occidental de Cuba a 300 kilómetros de La Habana, María la Gorda es un modelo en la protección del medio ambiente, que se evidencia por la preservación y cuidado de la abundante flora y fauna de la zona. \r\n\r\nEl hotel, de igual nombre, se encuentra también en la Península de Guanahacabibes, declarada Reserva de Biosfera por la UNESCO en 1987. \r\n\r\nConsiderado uno de los mejores sitios para la práctica del buceo en América Latina, María la Gorda cuenta con unas 32 zonas de observación, con abundantes jardines coralinos y una rica vida marina. Además, las temperaturas del agua son agradables y calientes, pues promedian entre 24 y 30 grados Celsius.\r\nLas cabañas de madera son acogedoras, pero las que se encuentran en el bosque, a las que se llega por medio de pequeños puentes que combinan perfectamente con el entorno, son encantadoras.\r\n', 'Situada en el extremo occidental de Cuba a 300 kilómetros de La Habana, María la Gorda es un modelo en la protección del medio ambiente, que se evidencia por la preservación y cuidado de la abundante flora y fauna de la zona. \r\n\r\nEl hotel, de igual nombre, se encuentra también en la Península de Guanahacabibes, declarada Reserva de Biosfera por la UNESCO en 1987. \r\n\r\nConsiderado uno de los mejores sitios para la práctica del buceo en América Latina, María la Gorda cuenta con unas 32 zonas de observación, con abundantes jardines coralinos y una rica vida marina. Además, las temperaturas del agua son agradables y calientes, pues promedian entre 24 y 30 grados Celsius.\r\nLas cabañas de madera son acogedoras, pero las que se encuentran en el bosque, a las que se llega por medio de pequeños puentes que combinan perfectamente con el entorno, son encantadoras.\r\n', 3, 'Pinar del Río', '0', 216, '0', '1', '0', '0', '0', '0');
INSERT INTO `hotels` VALUES (227, 'Villa Las Brujas', 0, 'En un acantilado de roca sobre el mar, el Hotel Villa Las Brujas es un refugio íntimo para los amantes de la naturaleza. Con sólo 24 habitaciones y un excepcional tramo de playa virgen, este es un maravilloso lugar para estar tranquilo y relajarse.\r\nCayo Las Brujas pertenece al archipiélago de Sabana-Camagüey (o Jardines del Rey) que tiene kilómetros de arrecifes coralinos (es el segundo arrecife más largo del mundo), con grandes bancos de sábalos, peces gatos, pagualas, meros y barracudas. El buceo y el snorkelling es muy recomendable en esta zona.\r\n', 'En un acantilado de roca sobre el mar, el Hotel Villa Las Brujas es un refugio íntimo para los amantes de la naturaleza. Con sólo 24 habitaciones y un excepcional tramo de playa virgen, este es un maravilloso lugar para estar tranquilo y relajarse.\r\nCayo Las Brujas pertenece al archipiélago de Sabana-Camagüey (o Jardines del Rey) que tiene kilómetros de arrecifes coralinos (es el segundo arrecife más largo del mundo), con grandes bancos de sábalos, peces gatos, pagualas, meros y barracudas. El buceo y el snorkelling es muy recomendable en esta zona.\r\n', 3, 'Villa Clara', '0', 217, '0', '1', '0', '0', '0', '0');
INSERT INTO `hotels` VALUES (228, 'Playa Cayo Santa María ', 0, 'Es uno de los más modernos y elegantes resorts de las hermosas playas del norte de Santa Clara, en la región central de Cuba.  Enriquece su entorno con diversidad de flora y fauna. El lugar es ideal para los amantes de los deportes acuáticos. El hotel cuenta con 769 habitaciones perfectamente equipadas.\r\n\r\nLa construcción de un pedraplén  de casi 50 Km de largo en la década de 1990 conectó tierra firme con una variedad de islas y cayos que cuentan con algunas de las mejores playas del país. Dentro del archipiélago Jardines del Rey una de las islas más atractivas es Cayo Santa María. Con más de 10 Km de playa de arena blanca. \r\n', 'Es uno de los más modernos y elegantes resorts de las hermosas playas del norte de Santa Clara, en la región central de Cuba.  Enriquece su entorno con diversidad de flora y fauna. El lugar es ideal para los amantes de los deportes acuáticos. El hotel cuenta con 769 habitaciones perfectamente equipadas.\r\n\r\nLa construcción de un pedraplén  de casi 50 Km de largo en la década de 1990 conectó tierra firme con una variedad de islas y cayos que cuentan con algunas de las mejores playas del país. Dentro del archipiélago Jardines del Rey una de las islas más atractivas es Cayo Santa María. Con más de 10 Km de playa de arena blanca. \r\n', 5, 'Villa Clara', '0', 218, '0', '1', '0', '0', '0', '0');
INSERT INTO `hotels` VALUES (229, 'Los Helechos ', 0, 'Es una de las instalaciones de hospedaje que ofrece el complejo Turístico de Topes de Collantes. Localizado en la parte central de Cuba, en el macizo montañoso de Guamuhaya, a una altura de 800 mts sobre nivel del mar, se encuentra esta región conocida por su belleza y valores naturales excepcionales.\r\n\r\nCombinando los valores de un Parque Natural, que es un reservorio de numerosas especies endémicas de la flora y de la fauna nacional, el parque en sí mismo es como un Museo Natural en donde el visitante puede observar las diferentes especies a lo largo de los varios senderos del parque, junto con las cuevas naturales, ríos subterráneos y cascadas, rodeados siempre por la vegetación exuberante y la paz apenas interrumpida por las canciones de los pájaros que le acompañarán durante el recorrido. Si se prefieren las excursiones dirigidas, usted puede pedir los servicios de guías profesionales con alta maestría en el área.\r\n', 'Es una de las instalaciones de hospedaje que ofrece el complejo Turístico de Topes de Collantes. Localizado en la parte central de Cuba, en el macizo montañoso de Guamuhaya, a una altura de 800 mts sobre nivel del mar, se encuentra esta región conocida por su belleza y valores naturales excepcionales.\r\n\r\nCombinando los valores de un Parque Natural, que es un reservorio de numerosas especies endémicas de la flora y de la fauna nacional, el parque en sí mismo es como un Museo Natural en donde el visitante puede observar las diferentes especies a lo largo de los varios senderos del parque, junto con las cuevas naturales, ríos subterráneos y cascadas, rodeados siempre por la vegetación exuberante y la paz apenas interrumpida por las canciones de los pájaros que le acompañarán durante el recorrido. Si se prefieren las excursiones dirigidas, usted puede pedir los servicios de guías profesionales con alta maestría en el área.\r\n', 3, 'Santi Spíritus ', '0', 219, '0', '1', '0', '0', '0', '0');
