INSERT INTO `hotels` VALUES (232, 'Playa Coco', 0, 'Confortable resort todo incluido de playa de 4 estrellas ubicado en el paradisíaco islote de Cayo Coco, Cuba, muy cerca de Morón, en la provincia de Ciego de Ávila. Este complejo de estilo colonial es perfecto para unas relajantes vacaciones en la playa, enaltecidas por sus áreas de spa y relajación. Este es un escenario y un establecimiento ideal para celebrar su boda.\r\n\r\nEl Hotel Playa Coco combina un diseño de estilo colonial con elementos arquitectónicos cubanos modernos con sus amplios espacios, arcadas y elegante decoración. Este es el lugar perfecto para relajarse su familia o con sus amigos.\r\n', 'Confortable resort todo incluido de playa de 4 estrellas ubicado en el paradisíaco islote de Cayo Coco, Cuba, muy cerca de Morón, en la provincia de Ciego de Ávila. Este complejo de estilo colonial es perfecto para unas relajantes vacaciones en la playa, enaltecidas por sus áreas de spa y relajación. Este es un escenario y un establecimiento ideal para celebrar su boda.\r\n\r\nEl Hotel Playa Coco combina un diseño de estilo colonial con elementos arquitectónicos cubanos modernos con sus amplios espacios, arcadas y elegante decoración. Este es el lugar perfecto para relajarse su familia o con sus amigos.\r\n', 4, 'Ciego de Ávila', '0', 222, '0', '1', '0', '0', '0', '0');
