INSERT INTO `journals` VALUES (1, 'about', '<br>\r\n<p>INCUBATRAVEL es la marca comercial de la empresa Grupo Gira S.A. para comercializar sus productos y servicios turísticos en línea.</p>\r\n<p>Por la experiencia adquirida como receptivo en Cuba y por las potencialidades que brinda este mercado, Grupo Gira prioriza el destino CUBA como su objetivo de mercado más importante.</p>', 'es');
INSERT INTO `journals` VALUES (2, 'about', '<br>\r\n<p>INCUBATRAVEL is the trademark of Grupo Gira SA to market their tourism products and services online.</p>\r\n<p>Due to the experience acquired serving as a receptive in Cuba and the market potential of this activity, Grupo Gira prioritizes the destination CUBA as its most important target market.</p>', 'en');
INSERT INTO `journals` VALUES (3, 'policies', '<p>Este sitio web es operado por INCUBATRAVEL, que es la marca comercial mediante la cual la red de ventas\r\n                de la empresa Grupo Gira S.A. comercializa sus productos y servicios turísticos en línea.\r\n                INCUBATRAVEL le agradece que usted lea detenidamente los Términos y Condiciones antes de utilizar este\r\n                sitio web. Al usarlo, usted acepta estos Términos y Condiciones.\r\n            </p>\r\n            <div class=\"hr-title\">CONDICIONES ESPECÍFICAS A LAS RESERVACIONES DE HOTELES</div>\r\n            <p><h4>Hospedaje y Precios</h4>\r\n            Los hoteles brindarán hospedaje a la persona a cuyo nombre se realizó la reservación (el \"pasajero\r\n            principal\") y al número exacto de personas acompañantes incluidas en la reservación de cada habitación. El\r\n            pasajero principal debe estar presente durante el check-in, y todos los huéspedes deben presentar un\r\n            pasaporte válido.<br><br>\r\n            Las habitaciones están generalmente disponibles a partir de las 16:00 horas, el día de arribo y el check-out\r\n            debe realizarse no más tarde de las 12:00 horas, el día de partida.\r\n            </p>\r\n            <p>Normalmente las habitaciones cuentan con 1 o 2 camas. Camas adicionales no se garantizan, por tanto, la\r\n                ocupación máxima se entiende compartiendo camas existentes, salvo que el hotel en cuestión tenga\r\n                disponibilidad de otorgar alguna.\r\n            </p>\r\n            <p>Todas las edades a las que hagamos referencia son válidas para las fechas de check-in o inicio del\r\n                servicio.</p>\r\n            <p><h4>Política sobre niños</h4>\r\n            Niños de hasta 1 año y 11 meses de edad: sin costo. Las cunas deberán ser directamente solicitadas en el\r\n            hotel, y pueden tener un costo extra. En algunos hoteles no hay cunas disponibles, y los infantes deberán\r\n            compartir la cama con los padres.</p>\r\n            <p>Los precios para niños serán confirmados durante el proceso de reserva online.</p>\r\n            <p>Normalmente, los precios para niños serán válidos para edades comprendidas entre 2 y 11 años, y solo\r\n                cuando compartan la habitación con 2 adultos.</p>\r\n            <p>La mayoría de las habitaciones no tienen espacio para una cama adicional para los niños, y por tanto, la\r\n                capacidad máxima es un adulto más un niño.</p>\r\n            <p>Los niños, entre 2 y 11 años de edad, que compartan la habitación con solo 1 adulto deben incluirse en la\r\n                reservación como adultos, excepto en las ofertas que se especifiquen como “oferta monoparental”.</p>\r\n            <p>Los niños de 12 o más años de edad, deberán incluirse en la reservación como adultos.</p>\r\n            <div class=\"hr-title\">POLÍTICA DE PAGO</div>\r\n            <p>Una vez que complete su reservación, se solicitara el pago, el cual se cargará a su tarjeta de crédito y\r\n                usted recibirá nuestro correo de confirmación. Se aceptan las siguientes tarjetas de crédito: VISA,\r\n                MASTERCARD y AMERICAN EXPRESS. Los precios se expresaran en USD, EUR, GBP Y CAD, sin embargo, el pago se expresara en\r\n                Euro. La factura será enviada por INCUBATRAVEL pero la confirmación del pago realizado le llegara con el\r\n                nombre de GRUPO GIRA S.A</p>\r\n            <p>Los clientes estan sujetos a cargos adicionales por transacciones en el exterior, el cargo asciende al 8%\r\n                del monto total de los servicios confirmados.</p>\r\n            <div class=\"hr-title\">RECLAMACIONES</div>\r\n            <p>Si usted considera que los servicios ofrecidos no cumplen lo acordado entre usted e InCubaTravel, o en el\r\n                caso de objeciones o situaciones que eviten el desenvolvimiento normal de los servicios, debe notificar\r\n                de inmediato a nuestro representante local o a nuestra oficina en La Habana. Los datos de contacto están\r\n                disponibles en los documentos y mensajes de confirmación de su reserva. No obstante, si después de\r\n                contactar a nuestro representante local o a nuestra oficina central en La Habana, no se logra una\r\n                solución adecuada, usted podrá cursar una reclamación escrita, en el término de 72 horas siguientes a la\r\n                fecha de terminación del servicio en cuestión. La agilidad de la respuesta concluyente dependerá de las\r\n                definiciones y términos del proveedor del servicio (hoteles, rentadoras, líneas aéreas, etc)</p>\r\n            <div class=\"hr-title\">REEMBOLSOS</div>\r\n            <p>Los rembolsos se realizarán únicamente a la tarjeta de crédito utilizada para el pago de su reservación.\r\n                Nuestro propósito es tramitar el reembolso dentro de las 72 horas siguientes de haberle ofrecido una\r\n                respuesta concluyente a su solicitud.</p>\r\n            <p>Aunque nos esforzamos para garantizar la disponibilidad de los servicios reservados, en ocasiones pueden\r\n                ocurrir errores. Una vez que nos percatemos de estos, haremos todo lo razonablemente posible para\r\n                informarle durante las 48 horas posteriores a su reservación. Nos reservamos el derecho de cancelar su\r\n                reservación y rembolsarle el monto total pagado, sin ningún cargo para usted.</p>\r\n            <p><h4>Política de Pago y Cancelaciones</h4>\r\n            La siguiente política de cancelación se aplica una vez que haya pagado por su reservación:\r\n            </p>\r\n            <ul>\r\n                <li>Términos especiales de cancelación se aplican para estancias del 22 de diciembre al 4 de enero. Si\r\n                    usted cancela su reservación antes de los 31 días de cumplirse su fecha de arribo planificada, le\r\n                    rembolsaremos la totalidad de la suma pagada, menos un recargo administrativo equivalente al 3 % de\r\n                    esta suma y los gastos por transferencias. Si usted cancela su reserva entre 30 y 15 días anteriores\r\n                    a su fecha de arribo planificada, le rembolsaremos el 50% de lo pagado. Si usted cancela su\r\n                    reservación dentro de los 14 días anteriores a su fecha planificada de arribo, no se hará devolución\r\n                    alguna: la penalidad será del 100%. Todos los gastos por trasferencias corren por cuenta del\r\n                    cliente.\r\n                </li>\r\n                <li>Durante el resto del año, si usted cancela con más de 20 días de antelación a la fecha de entrada al\r\n                    hotel, le rembolsaremos la totalidad de la suma pagada, menos un recargo administrativo equivalente\r\n                    al 3 % de esta suma y los gastos por transferencias que correrán a cuenta del cliente.\r\n                </li>\r\n                <li>Si usted cancela su reserva entre 15 y 4 días anteriores a su fecha de arribo planificada, le\r\n                    rembolsaremos el 50% de lo pagado, mas recargo administrativo.\r\n                </li>\r\n                <li>Si cancela la reservación dentro de los 3 días anteriores a su fecha de check-in, o si no se\r\n                    presenta al check-in (no show), no se hará devolución alguna: la penalidad será del 100%. Todos los\r\n                    gastos por trasferencias corren por cuenta del cliente.\r\n                </li>\r\n                <li>Ante salidas imprevistas que no han sido previamente negociadas con el hotel, se penaliza al cliente\r\n                    facturándole la tarifa que establezca el contrato para una noche, en el plan y la temporada que\r\n                    corresponda.\r\n                </li>\r\n            </ul>\r\n            <div class=\"hr-title\">CONDICIONES ESPECÍFICAS A LAS RESERVACIONES DE RENTA DE AUTOS</div>\r\n            <p>A continuación usted encontrará las condiciones específicas a las reservaciones de renta de autos\r\n                operadas por INCUBATRAVEL.</p>\r\n            <p><h4>Precios</h4>\r\n            Por favor, tenga en cuenta que los precios no están garantizados hasta que el pago es realizado y aceptado\r\n            por INCUBATRAVEL. Los precios mostrados están sujetos a cambios, pero serán confirmados durante el proceso\r\n            de reservación. En caso de no poder confirmar el servicio durante el proceso de reservación, INCUBATRAVEL\r\n            garantizara la respuesta en un plazo máximo de 24 horas. Además del precio de la renta, podrán aplicar\r\n            recargos por nuestros servicios de reservación. Todos los cargos serán mostrados durante el proceso de\r\n            reservación.\r\n            </p>\r\n            <p>Los siguientes cargos deberán ser pagados directamente a la rentadora durante la recogida del auto:</p>\r\n            <ol>\r\n                <li>Depósito de Garantía, Cobertura de Relevo de Responsabilidad y Conductor Adicional (Según la\r\n                    rentadora y categoría del auto):<br>\r\n                    <table class=\"table table-responsive\">\r\n                        <tr>\r\n                            <td colspan=\"3\" class=\"text-center\">CUBACAR/HAVANAUTOS</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Categoría</td>\r\n                            <td>Depósito de Garantía</td>\r\n                            <td>Conductor Adicional</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td colspan=\"3\" class=\"text-center\">(Por día)</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Economy</td>\r\n                            <td>150.00 CUC</td>\r\n                            <td>3.00 CUC</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Medium</td>\r\n                            <td>200.00 CUC</td>\r\n                            <td>3.00 CUC</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Medium High</td>\r\n                            <td>250.00 CUC</td>\r\n                            <td>3.00 CUC</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Jeep High</td>\r\n                            <td>250.00 CUC</td>\r\n                            <td>3.00 CUC</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Premium</td>\r\n                            <td>250.00 CUC</td>\r\n                            <td>3.00 CUC</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Van</td>\r\n                            <td>250.00 CUC</td>\r\n                            <td>3.00 CUC</td>\r\n                        </tr>\r\n                    </table>\r\n                </li>\r\n                <li>\r\n                    Cargo en caso de recogida en Aeropuerto por valor de 20.00 CUC (Cubacar/Havanautos/Rex). Deberá ser pagado en la oficina rentadora del aeropuerto.\r\n                </li>\r\n                <li>\r\n                    Tarifas de retorno por valor de 10-250 CUC, según la distancia entre los puntos de recogida y devolución del auto (solo cuando aplica). Deberá ser pagado en la oficina rentadora del aeropuerto.\r\n                </li>\r\n                <li>Tanque de combustible lleno: gasolina especial 1.20 CUC / L, DIESEL 1.10 CUC / L Deberá ser pagado en la oficina rentadora del aeropuerto.</li>\r\n            </ol>\r\n            <p><h4>Política de Pago y Cancelaciones</h4>\r\n            <h5>Pagos</h5>\r\n            El pago es solamente por la renta del auto. Usted deberá pagar directamente a la rentadora, en el momento de la recogida del auto, los siguientes cargos: seguro, combustible en el depósito, chofer adicional y depósito de garantía (sujeto a las condiciones de la rentadora).</p>\r\n            <p><h5>Cancelaciones</h5>\r\n            La siguiente política de cancelación se aplica una vez que haya pagado por su reservación:\r\n            <ul>\r\n                <li>Si cancela la reservación dentro de los 15 días previos al inicio del servicio, se penaliza con 1 día de renta. Es decir, le rembolsaremos la totalidad de la suma pagada, menos el valor equivalente al precio de 1 día de renta. Los gastos por transferencias corren a cuenta del cliente.</li>\r\n                <li>Si cancela la reservación después de las 17 horas del día anterior al del inicio del servicio de renta o en caso de \"no-show\" (no presentación en el día y hora de la recogida del auto), se penaliza con el equivalente a 2 días de renta. Es decir, le rembolsaremos la totalidad de la suma pagada, menos el valor equivalente al precio de 2 días de renta. Los gastos por transferencias corren a cuenta del cliente.</li>\r\n            </ul>\r\n            </p>\r\n            <p><h5>Vouchers</h5>Además de nuestro Correo de Confirmación, enviado al finalizar el proceso de reservación y pago, en ocasiones y en dependencia de la compañía rentadora, usted también recibirá por correo electrónico un voucher del proveedor. Ambos documentos deberán ser impresos y presentados a la rentadora para recoger el auto. INCUBATRAVEL no aceptan responsabilidad alguna por retrasos o problemas durante la recogida del auto en caso de que estos documentos no sean presentados al proveedor.</p>\r\n            <p><h5>Restricciones</h5>Se requiere experiencia mínima de conducción de 2 años y tener más de 21 años de edad.</p>\r\n            <div class=\"hr-title\">CONDICIONES RELACIONADAS CON LOS PAQUETES DE VIAJE / RESERVAS DE TOURS</div>\r\n            <p>A continuación encontrará condiciones específicas relacionadas con los paquetes de viaje / reservas de tours gestionados por CUBA TRAVEL NETWORK.</p>\r\n            <p><h4>Alojamiento y Precios</h4>Los hoteles incluidos en un paquete de viaje o tour ofrecerán alojamiento a la persona cuyo nombre aparece en la reserva (el \"viajero principal\") y al número exacto de acompañantes incluidos en la reserva para cada habitación. El viajero principal debe estar presente durante el check-in, y todos los huéspedes deben presentar un pasaporte válido.</p>\r\n            <p>Las habitaciones están generalmente disponibles a partir de las 4 pm el día de llegada y la salida es no más tarde de mediodía, el día de salida.</p>\r\n            <p>Normalmente, las habitaciones cuentan con una o dos camas. Camas adicionales no se pueden garantizar, por lo tanto, la ocupación máxima implica que los huéspedes compartirán las camas disponibles, a menos que el hotel en cuestión sea capaz de ofrecer camas adicionales en el check-in.</p>\r\n            <p>Todas las edades de los huéspedes que se mencionan en la reserva son válidas para las fechas de registro o el comienzo de un servicio.</p>\r\n            <p><h4>Política del niño</h4>Los precios y / o descuentos para los niños serán aplicados / descontados en el precio total del paquete o del tour.</p>\r\n            <p>Para los niños entre 2 y 11 años de edad, los descuentos se aplican sólo cuando comparten la habitación con dos adultos. Cuando comparten una habitación con un adulto, deben aparecer en la lista de adultos.</p>\r\n            <p>Los niños de 12 o más años de edad, deben aparecer en la reserva como adultos.</p>\r\n            <p>Las cunas para bebés deben ser solicitadas directamente desde el hotel y cargar un suplemento. En algunos hoteles, no hay cunas disponibles, y los niños deben compartir una cama con los padres / tutores.</p>\r\n            <p><h4>Políticas de pagos y cancelación</h4>La política de cancelación siguiente se aplica una vez que haya pagado por su reserva:</p>\r\n            <p>Términos y condiciones de cancelación para estancias del 22 de diciembre al 4 de enero:</p>\r\n            <ul>\r\n                <li>Cancelación de reserva hasta 31 días antes de la fecha de llegada: reembolso total del monto total pagado, menos un cargo administrativo equivalente al 3% de esta suma. Todos los gastos por trasferencias corren por cuenta del cliente.</li>\r\n                <li>Cancelación de la reserva entre 30 y 15 días antes de la fecha de llegada: reembolso del 50% del importe total pagado. Todos los gastos por trasferencias corren por cuenta del cliente.</li>\r\n                <li>Cancelación de reserva dentro de 14 días antes de la fecha de llegada y no-show: no hay reembolso, la multa es del 100%. Todos los gastos por trasferencias corren por cuenta del cliente.</li>\r\n            </ul>\r\n            <p>Condiciones de cancelación durante el resto del año:</p>\r\n            <ul>\r\n                <li>Cancelación de reserva hasta 16 días antes de la fecha de llegada: reembolso total del monto total pagado, menos un cargo administrativo equivalente al 3% de esta suma. Todos los gastos por trasferencias corren por cuenta del cliente.</li>\r\n                <li>Cancelación de la reserva entre 15 y 4 días antes de la fecha de llegada: reembolso del 50% del importe total pagado. Todos los gastos por trasferencias corren por cuenta del cliente.</li>\r\n                <li>Cancelación de reserva dentro de 3 días antes de la fecha de llegada y no-show: no hay reembolso, la multa es del 100%. Todos los gastos por trasferencias corren por cuenta del cliente.</li>\r\n            </ul>\r\n            <p>Salida prematura:</p>\r\n            <p>Si usted cierra prematuramente el tour y / o no hace uso de (algunos) elementos que están incluidos en el paquete de viaje o gira (por ejemplo, transferencias, comidas, excursiones, noches de hotel), no habrá reembolso.</p>\r\n            <div class=\"hr-title\">CONDICIONES ESPECÍFICAS A LAS RESERVACIONES DE EXCURSIONES</div>\r\n            <p>Una vez que haya hecho su reserva, se aplicarán cargos por cancelación. El monto de la cuota de cancelación depende del momento de la cancelación y es determinado por el proveedor de ejecución.</p>\r\n            <div class=\"hr-title\">CONDICIONES GENERALES</div>\r\n            <p>Usted acepta estar sujeto a las siguientes obligaciones, incluyendo y sin limitación:</p>\r\n            <ul>\r\n                <li>Usted asume responsabilidad financiera por todas las transacciones realizadas bajo su nombre o cuenta.</li>\r\n                <li>Para realizar cualquier compra, debe tener más de 18 años de edad, hacer la compra para uso personal y tener capacidad legal para efectuar la transacción.</li>\r\n                <li>Usted garantiza que toda la información que nos brinda es verdadera y exacta.</li>\r\n                <li>Nos reservamos el derecho de cancelar su reservación luego de su emisión si no se efectuara el pago o si se brindase información incorrecta sobre el titular de la tarjeta.</li>\r\n                <li>No podrá modificar, copiar, transmitir, distribuir, vender, exhibir, otorgar licencia, ni reproducir el sitio ni sus contenidos en forma alguna, excepto en caso de que desee hacer copias para su uso personal y sin propósitos comerciales.</li>\r\n                <li>No aceptamos ninguna responsabilidad relacionada con su capacidad de acceder o usar el sitio en momento alguno, ni en caso de cualquier interrupción en su acceso o uso, ni por errores al efectuar una transacción. No garantizamos que el Sitio esté libre de virus informáticos ni de otras propiedades que puedan causar pérdidas o perjuicios.</li>\r\n                <li>Si usted es un ciudadano de los Estados Unidos de América, es su responsabilidad obtener la documentación pertinente solicitada por el Gobierno de los Estados Unidos de América para viajes a Cuba. No asumiremos responsabilidad de ningún tipo si usted no obtiene la documentación pertinente con anterioridad a su viaje a Cuba. Tampoco reconoceremos responsabilidad de ninguna multa o demanda del Departamento del Tesoro de los Estados Unidos de América por causa de su viaje a Cuba.</li>\r\n            </ul>\r\n            <div class=\"hr-title\">SEGURIDAD</div>\r\n            <p>Usted es totalmente responsable del contenido enviado a nuestros sitios, especialmente (pero no limitado a) sus comentarios sobre los productos o servicios comercializados. Queda terminantemente prohibido el envío o transmisión a nuestros sitios de: (i) cualquier información amenazante, difamatoria, obscena, pornográfica u otro material o contenido que viole los derechos de publicidad y/o privacidad o que viole cualquier ley; (ii) cualquier material o contenido comercial, incluyendo, pero no limitado a, solicitación de fondos, publicidad o marketing de cualquier producto o servicio; y (iii) cualquier material o contenido que infrinja, se apropie inadecuadamente o viole cualquier derecho reservado, marca registrada, derecho de patente o cualquier otro derecho de propiedad. Usted es completamente responsable por cualquier daño resultante de cualquier violación de estas restricciones, o de cualquier otro daño resultante de su envío de contenido a nuestros sitios. Usted reconoce que nuestro sitio web INCUBATRAVEL puede ejercer sus derechos (por ejemplo, publicar, eliminar) sobre cualquier contenido recibido de Usted, sin previo aviso.</p>\r\n            <div class=\"hr-title\">USO DE DATOS PERSONALES</div>\r\n            <p>INCUBATRAVEL trabaja con sistemas de seguridad confiables y nos aseguramos de que la información que usted intercambia con nosotros online, incluyendo datos personales e información de su tarjeta de crédito, sea tratada con toda la seguridad posible para proteger la información enviada desde su navegador hacia nuestros sistemas.</p>\r\n            <div class=\"hr-title\">RESTRICCION DE RESPONSABILIDAD</div>\r\n            <p>En ningún caso INCUBATRAVEL será responsable de ningún retraso, accidente, pérdida, cambios de programa, perjuicios (ya sean directos, indirectos, punibles, fortuitos, especiales, significativos, ni de ningún otro tipo) por causa de o que estén de alguna forma vinculados con el uso de o la incapacidad para usar este Sitio Web, o de cualquier otra información, software, productos o servicios obtenidos a través o de otra forma vinculados a este Sitio Web, en cada caso independientemente de si tales perjuicios son basados en contrato, violación, responsabilidad objetiva u otro concepto de responsabilidad.</p>\r\n            <div class=\"hr-title\">FUERZA MAYOR</div>\r\n            <p>Si a consecuencia de una Fuerza Mayor INCUBATRAVEL. se viese obligada a restringir, alterar o cancelar una reservación y/o alguno de los servicios convenidos, el socio y/o cliente no tendrá derecho a reclamar compensación por ninguna de las pérdidas motivadas por la mencionada restricción, alteración o cancelación. El término \"Fuerza Mayor\" incluye pero no se limita a casos fortuitos, desastres naturales, incendios y cualquier otra destrucción de cualquiera de los hospedajes reservados, disturbios, acciones de guerra civil o internacional, desastres naturales, incendios, ejercicios de la autoridad municipal, legislativa, militar o de otro tipo, ataques, acciones industriales, o cualquier otra razón que escape de nuestro control.</p>\r\n            <div class=\"hr-title\">CAMBIOS A ESTOS TERMINOS Y CONDICIONES DE USO</div>\r\n            <p>INCUBATRAVEL se reserva el derecho de hacer cambios a estos Términos y Condiciones de Uso en cualquier momento.</p>\r\n            <div class=\"hr-title\">DESCARGO DE RESPONSABILIDAD</div>\r\n            <p>La información, productos y servicios que se publican en este sitio Web pueden presentar inexactitudes o errores tipográficos. Se hacen cambios periódicamente a la información expuesta en este sitio web.</p>', 'es');
INSERT INTO `journals` VALUES (4, 'policies', '<p>This website is operated by INCUBATRAVEL that is the commercial brand by means of which the company Gira SA Group sells its products and tourism services online. INCUBATRAVEL appreciates that you carefully read the Terms and Conditions before using this website. By using the INCUBATRAVEL website, you accept these Terms and Conditions.\r\n            </p>\r\n            <div class=\"hr-title\">CONDITIONS SPECIFIC TO HOTEL BOOKINGS</div>\r\n            <p><h4>Accommodation, Rates</h4>\r\n            Hotels provide accommodation to the person who made the reservation (“lead passenger\") and to the exact number of accompanying persons included in the reservation of each room. The lead passenger must be present at check-in, and all guests must carry a valid passport.<br><br>\r\n            Rooms are usually available from 16:00 on the day of arrival and check-out must be done no later than 12:00 hours on departure day.\r\n            </p>\r\n            <p>Rooms typically feature 1 or 2 beds. Additional beds are not guaranteed, therefore, maximum occupancy means sharing existing bedding, unless the hotel in question is able to provide more beds.\r\n            </p>\r\n            <p>All ages to which we make reference are valid for the specified check-in or start of the service dates.</p>\r\n            <p><h4>Children Policy</h4>\r\n            Children up to 1 year and 11 months old: free. Cribs must be requested directly at the hotel and may have an extra cost. In some hotels, cots are not available, and infants must share the bed with their parents.</p>\r\n            <p>Children prices will be confirmed during the online reservation process.</p>\r\n            <p>Normally, prices are valid for children ages ranging from 2 to 11 years, and only when sharing room with 2 adults.</p>\r\n            <p>Most rooms have no space for an extra bed for children, and therefore the maximum capacity is an adult plus a child.</p>\r\n            <p>Children between 2 and 11 years old, sharing a room with only 1 adult must be booked as adults, except in the cases specified as \"one parent offer.\"</p>\r\n            <p>Children 12 years of age or older must be booked as adults.</p>\r\n            <div class=\"hr-title\">PAYMENT POLICY</div>\r\n            <p>Once you complete your reservation, payment will be requested, which will be charged to your credit card and you will receive our confirmation email. The following credit cards will be accepted: VISA, MASTERCARD and AMERICAN EXPRESS. The prices are expressed in  USD, EUR, GBP and CAD, however, the payment will be carried out in EURO, taking into account the current exchange rate in Cuba at the time of booking. The invoice will be sent by INCUBATRAVEL but confirmation of the payment made will be sent to you under GRUPO GIRA SA</p>\r\n            <p>Customers are subject to additional charges for transactions abroad, the charge amounts to 8% of the total of the confirmed services.</p>\r\n            <div class=\"hr-title\">COMPLAINTS</div>\r\n            <p>If you believe that the services offered do not comply with what was agreed between you and InCubaTravel, or in the case of objections or situations that prevent the normal development of services, you must immediately notify our local representative or our office in Havana. Contact details are available in the documents and messages confirming your reservation. However, if after contacting our local representative or our head office in Havana, an adequate solution is not provided, you may write a complaint at the end of the date of termination of the service within 72 hours. The agility of a conclusive answer depends on the definitions and terms of the service provider (hotels, car rental agencies, airlines, etc.)</p>\r\n            <div class=\"hr-title\">REFUNDS</div>\r\n            <p>Refunds will be made only to the credit card used for payment of your reservation. Our purpose is to process the refund within the following 72 hours after having offered you a conclusive answer to your request.</p>\r\n            <p>Although we strive to ensure the availability of the reserved services, sometimes errors can occur. Once we are aware of such errors, we will do everything reasonably possible to inform you within 48 hours after your reservation. We reserve the right to cancel your reservation and reimburse the total amount paid, with no charge to you.</p>\r\n            <p><h4>Payment Policy and Cancellation</h4>\r\n            The following cancellation policy applies once you have paid for your reservation:\r\n            </p>\r\n            <ul>\r\n                <li>The reservation cancellation special terms apply for stays from December 22nd to January 4th. \r\nIf you cancel your reservation 31 days before your planned arrival date, we will refund the full amount paid, minus an administration fee equivalent to 3% of this amount and transfer expenses. \r\nIf you cancel your booking between 30 and 15 days prior to the arrival date, we will refund 50% of the amount paid. \r\nIf you cancel your reservation within 14 days prior to your planned arrival date, there will be no refund: the penalty will be 100%. All transfer expenses are covered by the customer.\r\n                </li>\r\n                <li>During the rest of the year, if you cancel more than 20 days before arrival to the hotel, we will refund the full amount paid, minus an administration fee equivalent to 3% of this amount and transfer expenses will be covered by the customer.\r\n                </li>\r\n                <li>If you cancel your booking between 15 and 4 days prior to the arrival date, we will refund 50% of the amount paid, plus an administrative charge.\r\n                </li>\r\n                <li>If you cancel the reservation within 3 days prior to check-in, or if you are not present at check-in (no show), there will be no refund: the penalty will be 100%. All transfers expenses are borne by the customer.\r\n                </li>\r\n                <li>Unforeseen departures that have not been previously negotiated, the hotel penalizes the customer by billing the client the established rate per contract for one night, according to the plan and season.\r\n                </li>\r\n            </ul>\r\n            <div class=\"hr-title\">CONDITIONS SPECIFIC TO CAR RENTAL</div>\r\n            <p>Below you will find the conditions specific to car rental reservation operated by INCUBATRAVEL.</p>\r\n            <p><h4>Prices</h4>\r\n            Please note that prices are not guaranteed until payment is made and accepted by INCUBATRAVEL. Prices shown are subject to change but will be confirmed during the reservation process. In the event that you are not able to confirm the service during the booking process, INCUBATRAVEL guarantees a response within 24 hours. Besides the price of the rent, surcharges may apply to our reservation services. All charges will be shown during the booking process.\r\n            </p>\r\n            <p>The following fees shall be paid directly to the car rental office when you pick up the car:</p>\r\n            <ol>\r\n                <li> Insurance deposit, liability coverage and Additional Driver (According to car rental office and car category):<br>\r\n                    <table class=\"table table-responsive\">\r\n                        <tr>\r\n                            <td colspan=\"3\" class=\"text-center\">CUBACAR/HAVANAUTOS</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Category</td>\r\n                            <td>Insurance Deposit</td>\r\n                            <td>Additional Driver</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td colspan=\"3\" class=\"text-center\">(Per day)</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Economy</td>\r\n                            <td>150.00 CUC</td>\r\n                            <td>3.00 CUC</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Medium</td>\r\n                            <td>200.00 CUC</td>\r\n                            <td>3.00 CUC</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Medium High</td>\r\n                            <td>250.00 CUC</td>\r\n                            <td>3.00 CUC</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Jeep High</td>\r\n                            <td>250.00 CUC</td>\r\n                            <td>3.00 CUC</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Premium</td>\r\n                            <td>250.00 CUC</td>\r\n                            <td>3.00 CUC</td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td>Van</td>\r\n                            <td>250.00 CUC</td>\r\n                            <td>3.00 CUC</td>\r\n                        </tr>\r\n                    </table>\r\n                </li>\r\n                <li>\r\n                    The fee to pick you up at the airport is 20.00 CUC (Cubacar / Havanautos / Rex). The fee must be paid at the airport car rental office.\r\n                </li>\r\n                <li>\r\n                    Return rates are between 10-250 CUC, according to the distance between the points of collection and return of the car (only when applicable). It must be paid at the car rental airport office.\r\n                </li>\r\n                <li>Full fuel tank: Special gasoline 1.20 CUC / L, DIESEL 1.10 CUC / L. This must be paid at the airport car rental office.</li>\r\n            </ol>\r\n            <p><h4>Payment Policy and Cancellation</h4>\r\n            <h5>Payments</h5>\r\n            Payment will be solely made through the car rental office. The following charges will be paid directly to the car rental office at the time of picking up of the car: insurance, full tank, additional driver and security deposit (subject to conditions of the car rental office).</p>\r\n            <p><h5>Cancellations</h5>\r\n            The following cancellation policy applies once you have paid for your reservation:\r\n            <ul>\r\n                <li>If the reservation is canceled within the 15 days before the start of the service, the customer will be penalized with 1-day rental. That is, the customer will refund the full amount paid, minus the value equivalent to the price of 1-day rental. Transfer expenses are to be charged to the customer.</li>\r\n                <li>If the reservation is cancelled after 17 hours before the start of the rental service or in case of \"no-show\" (no show on the day and time of collecting the car), the customer will be penalized with the equivalent of 2-day rental. That is, we will refund the full amount paid, minus the equivalent to the price of 2 days rental. Transfer expenses are to be charged to the customer.</li>\r\n            </ul>\r\n            </p>\r\n            <p><h5>Vouchers</h5>In addition to our confirmation email, sent at the end of the booking and payment process, and sometimes depending on the car rental company, you will also receive a voucher by email from the service provider. Both documents must be printed and presented to the car rental office to pick up the car. INCUBATRAVEL takes no responsibility for delays or problems during collection of the car in case these documents are not shown to the service provider.</p>\r\n            <p><h5>Restrictions</h5>Minimum driving experience required: 2 years and be over 21 years of age.</p>\r\n            <div class=\"hr-title\">CONDITIONS RELATING TO TRAVEL PACKAGES / BOOKING TOURS</div>\r\n            <p>Below you will find specific conditions related to the travel packages/tours reservations managed by CUBA TRAVEL NETWORK.</p>\r\n            <p><h4>Accommodations and Prices</h4>The hotels included in a travel package or provide accommodation to the person who made the reservation (“lead passenger\") and to the exact number of accompanying persons included in the reservation of each room. The lead passenger must be present at check-in, and all guests must carry a valid passport.</p>\r\n            <p>Rooms are usually available from 16:00 on the day of arrival and check-out must be done no later than 12:00 hours on departure day.</p>\r\n            <p>Rooms typically feature 1 or 2 beds. Additional beds are not guaranteed, therefore, maximum occupancy means sharing existing bedding, unless the hotel in question is able to provide more beds.</p>\r\n            <p>All ages to which we make reference are valid for the specified check-in or start of the service dates.</p>\r\n            <p><h4>Children Policy</h4>Children up to 1 year and 11 months old: free. Cribs must be requested directly at the hotel and may have an extra cost. In some hotels, cots are not available, and infants must share the bed with their parents.</p>\r\n            <p>Prices and/or discounts for children will be applied/deducted from the total price of the package or tour.</p>\r\n            <p>Discounts for children between 2 and 11 years old apply only when sharing a room with two adults. When sharing a room with an adult, they should appear in the list of adults.</p>\r\n            <p>Children 12 years of age or older must be booked as adults.</p>\r\n            <p>Baby cots must be requested directly from the hotel reception and charged a fee. In some cases, hotels do not have cribs available, and children should share a bed with parents/guardians.</p>\r\n            <p><h4>Payment policies and cancellation</h4>The following cancellation policy applies once you have paid for your reservation:</p>\r\n            <p>Terms and Conditions for cancellation policy for stays from December 22 to January 4:</p>\r\n            <ul>\r\n                <li> If you cancel your reservation 31 days before your planned arrival date, we will refund the full amount paid, minus an administration fee equivalent to 3% of this amount and transfer expenses.</li>\r\n                <li>If you cancel your booking between 30 and 15 days prior to the arrival date, we will refund 50% of the amount paid. </li>\r\n                <li>If you cancel your reservation within 14 days prior to your planned arrival date, there will not be any refund: the penalty will be 100%. All transfer expenses are covered by the customer.</li>\r\n            </ul>\r\n            <p>Cancellation during the rest of the year:</p>\r\n            <ul>\r\n                <li>Cancellation of a reservation from up to 16 days before arrival: the hotel will refund the full amount paid, minus an administration fee equivalent to 3% of this amount and transfer expenses will be covered by the customer.</li>\r\n                <li>If you cancel your booking between 15 and 4 days prior to the arrival date, we will refund 50% of the amount paid, plus an administrative charge.</li>\r\n                <li>If you cancel the reservation within 3 days prior to check-in, or if you are not present at check-in (no show), there will be no refund: the penalty will be 100%. All transfers expenses are borne by the customer.</li>\r\n            </ul>\r\n            <p>Premature departure:</p>\r\n            <p>If you prematurely close the tour and/or do not make use of (some) elements that are included in the travel package or tour (for example, transfers, meals, trips, hotel nights), no refund will be given.</p>\r\n            <div class=\"hr-title\">CONDITIONS SPECIFIC TO EXCURSIONS RESERVATIONS</div>\r\n            <p>Once you have made your reservation cancellation fees may apply. The amount of the cancellation fee depends on the time of the cancellation and the implementation of such fee is determined by the booking agency.</p>\r\n            <div class=\"hr-title\">GENERAL CONDITIONS</div>\r\n            <p>You agree to be subject to the following obligations, including and without limitation:</p>\r\n            <ul>\r\n                <li>To take financial responsibility for all transactions made under your name or account.</li>\r\n                <li>In order to make a purchase, you must be over 18 years old, be able to do shopping for personal use and have the legal capacity to carry out such transaction.</li>\r\n                <li>You guarantee that all information you provide is true and accurate.</li>\r\n                <li>We reserve the right to cancel your reservation after being issued if the payment is not made or if the information of the card holder being supplied is incorrect.</li>\r\n                <li>You may not modify, copy, transmit, distribute, sell, display, license, or reproduce the site or its content in any way except in case you want to make copies for personal use and non-commercial purposes.</li>\r\n                <li>We accept no responsibility related either to your ability to access or use the site at any time, or in case of any interruption while doing so or using the site, or mistakes when making a transaction.</li>\r\n                <li>We do not guarantee that the site is free from computer viruses or other properties that may cause loss or damage.</li>\r\n                <li>If you are a citizen of the United States of America, it is your responsibility to obtain the relevant documentation requested by the Government of the United States of America to travel to Cuba. We take no responsibility of any kind if you do not get the relevant documentation prior to your trip to Cuba. We do not acknowledge any responsibility for any fines or demands by the United States of America Treasury Department because of your trip to Cuba.</li>\r\n            </ul>\r\n            <div class=\"hr-title\">SAFETY</div>\r\n            <p>You are fully responsible for the content submitted through our sites, especially (but not limited to) your comments on the products or purchased services. Posting or transmitting to our sites is strictly prohibited: (i) any threatening, defamatory, obscene, pornographic information or any other material or content that violates copyright publicity and / or privacy or laws; (ii) any commercial material or content, including but not limited to, solicitation of funds, advertising or marketing of any product or service; and (iii) any material or content that infringes, patent rights or any other proprietary rights, misappropriates or violates any copyright or trademark. You are fully responsible for any damages resulting from any violation of these restrictions, or any other harm resulting from your sending content to our sites. You acknowledge that our website INCUBATRAVEL can exercise their rights to, for example, publish, delete any content received from you, without notice.</p>\r\n            <div class=\"hr-title\">USE OF PERSONAL DATA</div>\r\n            <p>INCUBATRAVEL works with reliable security systems and ensures that the information you exchange with us online, including personal data and information from your credit card, will be treated with all security possible to protect the information sent from your browser to our systems.</p>\r\n            <div class=\"hr-title\">LIMITATION OF LIABILITY</div>\r\n            <p>Under no circumstances INCUBATRAVEL will be liable for any delay, accident, loss, program changes, damage (whether direct, indirect, punitive, incidental, special, significant, or otherwise) because of or that are in some way related to the use of or inability to use this website or any information, software, products or services obtained through or otherwise linked to this website; in each case regardless of whether such damages are based on the contract, violation, strict liability or other liability concepts.</p>\r\n            <div class=\"hr-title\">FORCE MAJEURE</div>\r\n            <p>If INCUBATRAVEL due to a Force Majeure is obliged to restrict, alter or cancel a reservation and/or any of the agreed services, the partner and/or customer will not be entitled to claim compensation for any loss caused by that restriction, alteration or cancellation. The term \"Force Majeure\" includes, but is not restricted to fortuitous events, natural disasters, fire and any other destruction of any accommodation booked, riots, events of civil or international war, natural disasters, fires, enforcement of municipal authority, legislative, military or otherwise, strikes, industrial action or any other reason beyond our control.</p>\r\n            <div class=\"hr-title\">CHANGES TO THESE TERMS AND CONDITIONS OF USE</div>\r\n            <p>INCUBATRAVEL reserves the right to make changes to these Terms and Conditions of Use at any given time.</p>\r\n            <div class=\"hr-title\">DISCLAIMER</div>\r\n            <p>The information, products and services on this Website may have inaccuracies or typographical errors. Changes are made periodically to the information presented on this website.</p>', 'en');
INSERT INTO `journals` VALUES (5, 'paymentsuccess', 'Estimado cliente, usted ha realizado la compra satisfactoriamente. Para adquirir los comprobantes de pago, por favor, haga click en el siguiente vínculo.', 'es');
