INSERT INTO `packs` VALUES (6, 'Ven a los cayos !!!', 'Come to the Keys!!!', '<ul class=\"icon\">\r\n<li> TRANSFER IN/OUT COLECTIVO EN LA HABANA</li>\r\n<li> 2 NOCHES DE ALOJAMIENTO EN LA HABANA CON DESAYUNO INCLUIDO</li>\r\n<li> AL DIA SIGUIENTE DE LA LLEGADA A LA HABANA, CITY TOUR COLECTIVO SIN ALMUERZO</li>\r\n<li> BOLETO AEREO LA HABANA – CAYO COCO – LA HABANA (INCLUYE TODOS LOS TRASLADOS HOTEL – AEROPUERTO)</li>\r\n<li> 4 NOCHES DE ALOJAMIENTO EN TODO INCLUIDO EN CAYO COCO Y/O CAYO GUILLERMO</li>\r\n<li> 1 NOCHE DE ALOJAMIENTO EN LA HABANA CON DESAYUNO INCLUIDO</li>\r\n</ul>\r\nIMPOTANTE:\r\n<ul class=\"icon\">\r\n<li> SE DEBE SOLICITAR LA OFERTA CON AL MENOS 4 DIAS DE ANTELACION.</li>\r\n<li> LOS PRECIOS PUEDEN VARIAR, CAMBIOS SE INFORMARAN CON 15 DIAS DE ANTELACION</li>\r\n</ul>\r\nPENALIZACIONES:\r\n<ul class=\"icon\">\r\n<li> CANCELACIONES HASTA 72 HORAS ANTES (DIAS Y HORARIOS LABORABLES): SIN PENALIZACION</li>\r\n<li> CANCELACIONES CON MENOS DE 72 HORAS (DIAS Y HORARIOS LABORABLES) O NO SHOW: 100 % DE LOS SERVICIOS</li>\r\n</ul>', '<ul class=\"icon\">\r\n<li> BUS TRANSFER IN / OUT IN HAVANA</li>\r\n<li> 2 OVERNIGHTS IN HAVANA WITH BREAKFAST INCLUDED</li>\r\n<li> CITY TOUR AROUND HAVANA THE FOLLOWING DAY OF THE ARRIVAL WITHOUT LUNCH</li>\r\n<li> AIR TICKET HAVANA - CAYO COCO - HAVANA (INCLUDES ALL HOTEL - AIRPORT TRANSFERS)</li>\r\n<li> 4 NIGHTS ACCOMMODATION IN ALL-INCLUSIVE HOTEL IN CAYO COCO AND / OR HOLGUIN</li>\r\n<li> 1 NIGHT IN HAVANA WITH BREAKFAST INCLUDED</li>\r\n</ul>\r\nIMPORTANT\r\n<ul class=\"icon\">\r\n<li> THE OFFER MUST BE PURCHASED WITH AT LEAST FOUR DAYS PRIOR TO THE STARTING DATE.</li>\r\n<li> PRICES MAY VARY, ANY CHANGES WILL BE INFORMED 15 DAYS PRIOR TO THE STARTING DATE.</li>\r\n</ul>\r\nPENALTY\r\n<ul class=\"icon\">\r\n<li> CANCELATIONS UP TO 72 HOURS BEFORE THE STARTING DATE (OFFICE HOURS): NO PENALTIES</li>\r\n<li> CANCELATIONS LESS THAN 72 HOURS BEFORE THE STARTING DATE OR NO SHOW (OFFICE HOURS): 100% OF THE SERVICE FEE</li>\r\n<ul>\r\n\r\n', '1', 2, '1', '0', 7, '1');
