INSERT INTO `rooms_prices` VALUES (46, 10, 11, '2017-01-01', '2017-12-31', 1150.00, NULL, NULL, 'var tf = function(price, adults, infants, children) {\r\n  var vadults = [[0, 1], [1, 1]],\r\n      vchildren = [[0, 0], [0, 1]];\r\n  if ((adults + children === 0) || (children > 0) || (infants > 1) || (adults===0 && infants>0)) return -1;\r\n  var l_adults = vadults[adults][children];\r\n  return (price * l_adults).toFixed(2);\r\n}');
INSERT INTO `rooms_prices` VALUES (47, 10, 12, '2017-01-01', '2017-12-31', 826.00, NULL, NULL, 'var tf = function(price, adults, infants, children) {\r\n  var vadults = [[0, 1, 2], [1, 2, 2], [2, 2, 2]],\r\n      vchildren = [[0, 0, 0], [0, 0, 1], [0, 1, 2]];\r\n  if ((adults + children < 2) || (infants + children > 2) || (adults===0 && infants>0)) return -1;\r\n  var l_adults = vadults[adults][children],\r\n      l_children = vchildren[adults][children],\r\n      l_price = 0;\r\n  if (l_children>0) l_price+=541;\r\n  if (l_children>1) l_price+=541;\r\n  return ((price * l_adults) + l_price).toFixed(2);\r\n}');
