INSERT INTO `roundtrips` VALUES (1, 'Fantasía Cubana', 'Cuban Fantasy', 6, 5, 4, '<b>HABANA</b><br>\r\n<b>DÍA 1.</b> Recorrido de  ciudad  con visita al Centro Histórico de la Habana Vieja, Patrimonio de la Humanidad. Visita a las plazas de La Habana: Plaza de la Catedral, Plaza de Armas, Plaza de San Francisco de Asís y Plaza Vieja. Almuerzo en restaurante local. En la tarde  en  AUTOS ANTIGUOS  visita  panorámica al Capitolio, Parque Central, Parque de la Fraternidad, Plaza de la Revolución. Retorno al hotel. .Alojamiento por el T.O.<br><br>\r\n<b>HABANA- LAS TERRAZAS - HABANA</b><br>\r\n<b>DÍA 2.</b> Salida hacia Las Terrazas, proyecto ecológico ubicado en la Sierra de del Rosario, declarada por la UNESCO Reserva de la Biosfera, disfrutando de la flora y la fauna cubanas y de las bellezas del lugar. Se conocerá el hotel La Moka, singular instalación insertada en el bosque. Visita a la hacienda La Unión, con un bello jardín de plantas tropicales. Desplazamiento hacia las ruinas parcialmente reconstruidas del Cafetal Buenavista, hacienda cafetalera del siglo XIX, conociendo didácticamente la historia del lugar y el proceso del beneficio del café en la época. Contacto con la comunidad, visitando la Plaza del Pueblo y sus instalaciones socio-culturales, con la posibilidad de degustar el exquisito café cubano en la casa de María (no incluido). Se visitará el Taller de Serigrafía del lugar, pudiendo conocer acerca de este trabajo y del de artesanía que se desarrolla en el lugar, con posibilidades de comprar diversos artículos. Almuerzo en la zona y, si se desea,  tiempo de baño en el Río San Juan. Regreso al hotel en la Habana. <b>(por el T.O.)</b><br><br>\r\n<b>HABANA – GUAMÁ - TRINIDAD</b><br>\r\n<b>DÍA 3.</b> Salida hacia Guamá, ubicada en la Península de Zapata, provincia de Matanzas.  Explicaciones de interés del guía durante el recorrido.  Visita al Criadero de Cocodrilos. Almuerzo en restaurante de la zona. Al concluir el almuerzo, salida para la ciudad de Trinidad. Alojamiento y cena en hotel seleccionado.<br><br>\r\n<b>TRINIDAD</b><br>\r\n<b>DÍA 4.</b> Desayuno. Recorrido por la ciudad de Trinidad, ciudad detenida en el tiempo. Visita a la Plaza Mayor; Museo Romántico; La Iglesia de la Santísima Trinidad; Bar la Canchánchara, con su típico coctel de bienvenida; y Taller de Cerámica. Almuerzo en restaurante local. Tiempo libre en la ciudad. Regreso al hotel. Cena en el hotel. Noche a disposición.<br><br>\r\n<b>TRINIDAD - CIENFUEGOS – VARADERO Y/O LA HABANA</b><br>\r\n<b>DÍA 5.</b> Desayuno. Salida hacia Varadero. En tránsito, recorrido por la ciudad de Cienfuegos, conocida como la Perla del Sur. Recorrido por sus calles y avenidas fundadas por los franceses. Está situada en una maravillosa bahía, donde se halla el mayor coral de Cuba hasta ahora descubierto, y bautizado con el nombre de Notre Dame. Visita al Parque Martí, Teatro Tomas Terry, Casa de Bienes Culturales y Catedral de la Purísima Concepción. Almuerzo en un restaurante local. Continuación del viaje hacia Varadero o La Habana, según el hotel seleccionado. <b>(por el T.O.)</b>', '<b>HAVANA</b><br>\r\n<b>DAY 1.</b> City tour with a Visit the Historical Center of Old Havana, World Heritage. Visit Havana squares: the Cathedral Square, Plaza de Armas, Plaza de San Francisco de Asís and the Plaza Vieja. Lunch at a local restaurant. In the afternoon, antique car sightseeing tour to the Capitol, Central Park, Fraternidad Park, the Revolution Square. Return to hotel. <b>Accommodation T.O.</b><br><br>\r\n<b>HAVANA – LAS TERRAZA - HAVANA</b><br>\r\n<b>DAY 2.</b> Departure to Las Terrazas, an ecological project located in the Sierra del Rosario, UNESCO Biosphere Reserve, enjoying the Cuban flora and fauna and the amenities of the place. Visit La Moka Hotel, a unique facility inserted into the forest. Visit the La Union Hacienda, with a beautiful garden of tropical plants. A walk around the partially restored ruins of the Cafetal Buenavista, nineteenth century coffee plantation, didactically acquiring the history of the place and the process of coffee processing at the time. Contact with the community. Visit the Plaza del Pueblo and socio-cultural facilities, with the possibility to taste the delicious Cuban coffee at the Home of Mary (not included). A visit to the Silkscreen Workshop to know about the crafts developed at this place, with the possibility of buying various items. Lunch in the area and, if desired, bath time in the San Juan River. Return to the hotel in Havana. (<b>by the T.O.</b>)<br><br>\r\n<b>HAVANA - GUAMÁ - TRINIDAD</b><br>\r\n<b>DAY 3.</b> Departure to Guamá, located in the Zapata Peninsula, Matanzas province. Interpretation of the place by the tour guide. Visit the Crocodile Hatchery. Lunch at a restaurant in the area. After lunch, departure to the city of Trinidad. Accommodation and dinner at the hotel.<br><br>\r\n<b>TRINIDAD</b><br>\r\n<b>DAY 4.</b> Breakfast. City tour around Trinidad, a city frozen in time. Visit the Plaza Mayor; The Romantic Museum; The Church of the Holy Trinity; La Canchánchara Bar, with its typical welcome cocktail; and a ceramics workshop. Lunch at a local restaurant. Free time in the city. Back to the hotel. Dinner at the hotel. Free night.<br><br>\r\n<b>TRINIDAD - CIENFUEGOS - VARADERO AND / OR HAVANA</b><br>\r\n<b>DAY 5.</b> Breakfast. Departure to Varadero. In transit tour around the city of Cienfuegos, known as the Pearl of the South. Walk around its streets and avenues founded by the French. This city is located by a beautiful bay with the largest coral reef of Cuba discovered so far. The Coral Reef is known as Notre Dame. Visit the Marti Park, The Tomas Terry Theater, The House of Cultural Property and the Immaculate Conception Cathedral. Lunch at a local restaurant. Following the trip to Varadero or Havana, according to the chosen hotel. (<b>by the T.O.</b>)', '1', 1, '0', '0', '1');
INSERT INTO `roundtrips` VALUES (2, 'Mini Fantasía Cubana', 'Mini Cuban Fantasy', 1, 3, 5, '<b>HABANA – GUAMÁ - TRINIDAD</b><br>\r\n<b>DÍA 1.</b> Salida hacia Guamá, ubicada en la Península de Zapata, provincia de Matanzas.  Explicaciones de interés del guía durante el recorrido.  Visita al Criadero de Cocodrilos. Almuerzo en restaurante de la zona. Al concluir el almuerzo, salida para la ciudad de Trinidad. Alojamiento y cena en hotel seleccionado.<br><br>\r\n<b>TRINIDAD</b><br>\r\n<b>DÍA 2.</b> Desayuno. Recorrido por la ciudad de Trinidad, ciudad detenida en el tiempo. Visita a la Plaza Mayor; Museo Romántico; La Iglesia de la Santísima Trinidad; Bar la Canchánchara, con su típico coctel de bienvenida; y Taller de Cerámica. Almuerzo en restaurante local. Tiempo libre en la ciudad. Regreso al hotel. Cena en el hotel. Noche a disposición.<br><br>\r\n<b>TRINIDAD - CIENFUEGOS – VARADERO Y/O LA HABANA</b><br>\r\n<b>DÍA 3.</b> Desayuno. Salida hacia Varadero. En tránsito, recorrido por la ciudad de Cienfuegos, conocida como la Perla del Sur. Recorrido por sus calles y avenidas fundadas por los franceses. Está situada en una maravillosa bahía, donde se halla el mayor coral de Cuba hasta ahora descubierto, y bautizado con el nombre de Notre Dame. Visita al Parque Martí, Teatro Tomas Terry, Casa de Bienes Culturales y Catedral de la Purísima Concepción. Almuerzo en un restaurante local. Continuación del viaje hacia Varadero o La Habana, según el hotel seleccionado. (por el T.O.)', '<b>HAVANA - GUAMÁ - TRINIDAD</b><br>\r\n<b>DAY 1.</b> Departure to Guamá, located in the Zapata Peninsula, Matanzas province. Interpretation of the place by the tour guide. Visit the Crocodile Hatchery. Lunch at a restaurant in the area. After lunch, departure to the city of Trinidad. Accommodation and dinner at the hotel.<br><br>\r\n<b>TRINIDAD</b><br>\r\n<b>DAY 2.</b> Breakfast. City tour around Trinidad, a city frozen in time. Visit the Plaza Mayor; The Romantic Museum; The Church of the Holy Trinity; La Canchánchara Bar, with its typical welcome cocktail; and a ceramics workshop. Lunch at a local restaurant. Free time in the city. Back to the hotel. Dinner at the hotel. Free night.<br><br>\r\n<b>TRINIDAD - CIENFUEGOS - VARADERO AND / OR HAVANA</b><br>\r\n<b>DAY 3.</b> Breakfast. Departure to Varadero. In transit tour around the city of Cienfuegos, known as the Pearl of the South. Walk around its streets and avenues founded by the French. This city is located by a beautiful bay with the largest coral reef of Cuba discovered so far. The Coral Reef is known as Notre Dame. Visit the Marti Park, the Tomas Terry Theater, The House of Cultural Property and the Immaculate Conception Cathedral. Lunch at a local restaurant. Following the trip to Varadero or Havana, according to the chosen hotel. (<b>by the T.O.</b>)\r\n', '1', 2, '0', '0', '1');
INSERT INTO `roundtrips` VALUES (3, 'Pasión por Cuba', 'Passion for Cuba', 2, 8, 5, '<b>HABANA - SANTIAGO DE CUBA</b><br>\r\n<b>DÍA 1.</b> Traslado al aeropuerto de vuelos nacionales para tomar el vuelo con destino a Santiago de Cuba u Holguín. Boleto Incluido. A la llegada, traslado al hotel seleccionado en Santiago de Cuba. Alojamiento y cena en el hotel.<br><br>\r\n<b>SANTIAGO DE CUBA</b><br>\r\n<b>DÍA 2.</b> Desayuno. Reunión de información. Visita, al Santuario del Cobre. Recorrido por la segunda ciudad más importante de Cuba, ciudad impregnada de historia y música, capital del Oriente y cuna del Son y de la Revolución Cubana. Almuerzo en un  restaurante de la zona. En la tarde, visita al Cuartel Moncada, Parque Céspedes, Castillo del Morro, Cementerio de Santa Ifigenia y Casa de Diego Velásquez. Retorno al hotel. Cena y Noche libre.<br><br>\r\n<b>SANTIAGO DE CUBA – HOLGUÍN</b><br>\r\n<b>DÍA 3.</b> Desayuno. Salida para Holguin.  En tránsito visita a Cayo Saetía, área preservada considerada el mayor coto de caza del país. Safari con paseo en jeep o camión entre los bosques y praderas del cayo, donde se podrá observar animales exóticos y endémicos que se encuentran en completa libertad como cebras, antílopes, búfalos, toros y caballos salvajes, jabalíes, dromedarios, jirafas, avestruces, entre muchos otros. Almuerzo en el ranchón de la playa. Tiempo libre para baño en la playa. Continuación del viaje hacia Holguín. Alojamiento y cena.<br><br>\r\n<b>HOLGUIN - SANTA  LUCÍA</b><br>\r\n<b>DÍA 4.</b> Desayuno. Recorrido por la ciudad de Holguín. Esta ciudad posee el titulo popular de Ciudad de los Parques. Recorrido por sus cinco parques localizados en las calles principales.  Visita a la Loma de la Cruz, esta se eleva a 261 metros sobre el nivel del mar, con 458 escalones, toma su nombre de una cruz de madera que existe en su cima, símbolo protector para muchos, depósito de promesas u original ornamento para otros. Salida hacia Santa Lucia. Alojamiento en todo incluido.<br><br>\r\n<b>SANTA LUCÍA</b><br>\r\n<b>DÍA 5.</b> Día libre para el disfrute de una de las playas más bellas del norte de Cuba y la compra de opcionales.<br><br>\r\n<b>SANTA LUCÍA - TRINIDAD</b><br>\r\n<b>DÍA 6.</b> Desayuno. Salida hacia Trinidad, en tránsito, visita a la ciudad de Camagüey, fundada en 1514, es una de las primeras 7 villas de Cuba, se caracteriza por un paisaje urbano de calles estrechas y laberínticas que confluyen en numerosas plazas y plazoletas en su centro histórico que es uno de los más extensos de la isla y donde se señalan numerosas edificaciones con significativos valores arquitectónicos e histórico-culturales. Almuerzo en  restaurante local. Recorrido  panorámico por la ciudad de Sancti Spíritus. Continuación del recorrido hacia  Manaca – Iznaga, centro del Valle de los Ingenios, región que fue en los siglos XVII y XVIII una de las más prósperas de Cuba, y aún conserva su esplendor gracias al cultivo y producción de la azúcar de caña. Alojamiento y cena en hotel seleccionado.<br><br>\r\n<b>TRINIDAD – CIENFUEGOS</b><br>\r\n<b>DÍA 7.</b> Desayuno. Recorrido por la ciudad de  Trinidad, llamada la Ciudad Museo de Cuba, tiene el privilegio de ser una de las localidades coloniales del país y califica además entre los conjuntos arquitectónicos más completos y conservados del continente americano. Declarada Patrimonio de la Humanidad por la UNESCO en 1988. Visita al Museo Romántico y Bar La Canchánchara. Almuerzo en restaurante de la zona.  Continuación  del  viaje hacia Cienfuegos. Recorrido panorámico por la ciudad fundada por los franceses, llamada también la Perla del Sur. Alojamiento y cena en hotel seleccionado.<br><br>\r\n<b>CIENFUEGOS - SANTA CLARA – GUAMÁ - HABANA Y/O VARADERO</b><br>\r\n<b>DÍA 8.</b> Desayuno. Salida para Santa Clara. Vista al Mausoleo del Che y al Tren Blindado. Recorrido panorámico por la ciudad. Continuación del recorrido hacia el Parque Montemar. Almuerzo en un restaurante local. Visita al  Criadero de Cocodrilos. Continuación del viaje hacia Varadero o La Habana. Alojamiento en hotel seleccionado (por el T.O.)', '<b>HAVANA - SANTIAGO DE CUBA</b><br>\r\n<b>DAY 1.</b> Airport Transfer to the domestic flights to Santiago de Cuba or Holguin. Ticket included. On arrival, transfer to hotel in Santiago de Cuba. Accommodation and dinner at the hotel.<br><br>\r\n<b>SANTIAGO DE CUBA</b><br>\r\n<b>DAY 2.</b> Breakfast. Briefing. Visit El Cobre Sanctuary. Tour of the second largest city in Cuba, steeped in history and music, the capital city of the East and birthplace of Son and of the Cuban Revolution. Lunch at a local restaurant. In the afternoon, visit the Moncada Garrison, Céspedes Park, El Morro Castle, Santa Ifigenia Cemetery and Diego Velásquez House. Return to hotel. Dinner and free night.<br><br>\r\n<b>SANTIAGO DE CUBA - HOLGUÍN</b><br>\r\n<b>DAY 3.</b> Breakfast. Departure to Holguin. In transit Visit Cayo Saetia, preserved area considered the largest hunting ground of the country. Safari with a jeep or truck ride across the forests and prairies of the keys, where you can observe exotic and endemic animals in complete freedom like zebras, antelopes, buffaloes, wild bulls and horses, wild boars, dromedaries, giraffes, ostriches, among many others. Lunch at the beach ranchón. Free time to swim at the beach. Continue the trip to Holguin. Accommodation and dinner.<br><br>\r\n<b>HOLGUIN - SANTA LUCIA</b><br>\r\n<b>DAY 4.</b> Breakfast. City tour around Holguin. This city owns the popular title of The City of Parks. Tour through its five parks located on the main streets of the city. Visit the Loma de la Cruz, which rises 261 meters above sea level, with 458 steps. It takes its name from the wooden cross at its top, a protection symbol for many and a deposit of promises or original ornament for others. Departure to Santa Lucia. All-inclusive accommodation.<br><br>\r\n<b>SANTA LUCIA</b><br>\r\n<b>DAY 5.</b> Free day to enjoy one of the most beautiful beaches of northern Cuba and to purchase souvenirs.<br><br>\r\n<b>SANTA LUCIA - TRINIDAD</b><br>\r\n<b>DAY 6.</b> Breakfast. Departure to Trinidad. Continue the trip to the city of Camaguey, founded in 1514. Camaguey is one of the first seven villas in Cuba. It is characterized by an urban landscape of narrow, winding streets that converge in many squares and plazas in the historic center of the city (one of the largest on the island), where many buildings with significant architectural and historical-cultural values are noted. Lunch at a local restaurant. Panoramic tour of the city of Sancti Spiritus. Continue the trip to Manaca – Iznaga, which is the center of the Valle de los Ingenios, a region that was one of the most prosperous in Cuba in the XVII and XVIII centuries and its splendor still retains thanks to the cultivation of sugar cane. Accommodation and dinner at the hotel.<br><br>\r\n<b>TRINIDAD - CIENFUEGOS</b><br>\r\n<b>DAY 7.</b> Breakfast. City tour around Trinidad, called Cuba’s Museum City. It has the privilege of being one of the colonial cities of the country and also qualifies among the most complete and preserved architectural complexes in the Americas. Declared World Heritage Site by UNESCO in 1988. Visit the Romantic Museum, La Canchánchara Bar. Lunch at a local restaurant. Continuation of the trip to Cienfuegos. Panoramic tour of the city founded by the French, also called the Pearl of the South. Accommodation and dinner at chosen hotel.<br><br>\r\n<b>CIENFUEGOS - SANTA CLARA - GUAMÁ - HAVANA AND / OR VARADERO</b><br>\r\n<b>DAY 8.</b> Breakfast. Departure to Santa Clara. Visit the Che Guevara’s Mausoleum and the Armored Train Monument. Panoramic city tour. Continue the trip to Montemar Park. Lunch at a local restaurant. Visit the Crocodile Hatchery. Continue the trip to Varadero or Havana. Overnight accommodation (<b>by the T.O.</b>)', '1', 3, '1', '0', '1');
INSERT INTO `roundtrips` VALUES (4, 'Cuba, una isla fascinante', 'Cuba, a fascinating island', 2, 6, 4, '<b>HABANA - SANTIAGO DE CUBA</b><br>\r\n<b>DÍA 1.</b> Traslado al aeropuerto de vuelos nacionales para tomar el vuelo con destino a Santiago de Cuba u Holguín. Boleto Incluido. A la llegada, traslado al hotel seleccionado en Santiago de Cuba. Alojamiento y cena en el hotel.<br><br>\r\n<b>SANTIAGO DE CUBA</b><br>\r\n<b>DÍA 2.</b> Desayuno. Reunión de información. Recorrido por la segunda ciudad más importante de Cuba, ciudad impregnada de historia y música, capital del Oriente, y cuna del Son y de la Revolución Cubana. Almuerzo en  restaurante local. En la tarde, visita al Cuartel Moncada, Parque Céspedes, Castillo del Morro, Cementerio Santa Ifigenia y Casa de Diego Velásquez.  Regreso al hotel para cenar. Noche libre.<br><br>\r\n<b>SANTIAGO DE CUBA – CAMAGÜEY</b><br>\r\n<b>DÍA 3.</b> Desayuno. Salida para Bayamo. Visita, en tránsito, al Santuario del Cobre. Visita a la ciudad de Bayamo, almuerzo en  restaurante local. Continuación del recorrido a Camagüey. Alojamiento y cena en  hotel seleccionado de la ciudad. Noche libre.<br><br>\r\n<b>CAMAGÜEY – TRINIDAD</b><br>\r\n<b>DÍA 4.</b> Desayuno. Salida hacia Trinidad, recorrido en tránsito por la ciudad de Ciego de Ávila. Almuerzo en  restaurante local. Visita panorámica por la ciudad de Sancti Spíritus. Continuación del recorrido a  Manaca – Iznaga, centro del Valle de los Ingenios, región que fue en los siglos XVII y XVIII una de las más prósperas de Cuba, y aún conserva su esplendor, gracias al cultivo y producción de la azúcar de caña. Arribo a Trinidad. Alojamiento y cena en hotel local.<br><br>\r\n<b>TRINIDAD – CIENFUEGOS</b><br>\r\n<b>DÍA 5.</b> Desayuno. Recorrido por la ciudad de Trinidad, Patrimonio de La Humanidad, visitando el Museo Romántico y Bar La Canchánchara. Almuerzo en un restaurante de la zona. Continuación del recorriodo hacia Cienfuegos. Alojamiento y cena en hotel seleccionado.<br><br>\r\n<b>CIENFUEGOS – GUAMÁ – HABANA Y/O VARADERO</b><br>\r\n<b>DÍA 6.</b>  Desayuno. Visita panorámica a la ciudad de Cienfuegos. Salida hacia el Parque Montemar. Almuerzo en un restaurante local. Visita al Criadero de Cocodrilos. Continuación del viaje hacia Varadero o La Habana. Alojamiento en el hotel seleccionado. (por el T.O.)', '<b>HAVANA - SANTIAGO DE CUBA</b><br>\r\n<b>DAY 1.</b> Transfer to the domestic flights airport to fly to Santiago de Cuba or Holguin. Ticket included. On arrival, transfer to hotel in Santiago de Cuba. Accommodation and dinner at the hotel.<br><br>\r\n<b>SANTIAGO DE CUBA</b><br>\r\n<b>DAY 2.</b> Breakfast. Briefing. Tour around the second largest city in Cuba, steeped in history and music, the capital of the East, the cradle of the Son and of the Cuban Revolution. Lunch at a local restaurant. In the afternoon, Visit the Moncada Garrison, Céspedes Park, El Morro Castle, Santa Ifigenia Cemetery and Diego Velázquez Museum. Return to the hotel for dinner. Free night.<br><br>\r\n<b>SANTIAGO DE CUBA - CAMAGÜEY</b><br>\r\n<b>DAY 3.</b> Breakfast. Departure to Bayamo. In transit Visit the Sanctuary of El Cobre. Visit the city of Bayamo. Lunch at a local restaurant. Continue the trip to Camagüey. Accommodation and dinner at a local hotel. Free night.<br><br>\r\n<b>CAMAGÜEY - TRINIDAD</b><br>\r\n<b>DAY 4.</b> Breakfast. Departure to Trinidad, in transit tour to Ciego de Avila city. Lunch at a local restaurant. Sightseeing tour of Sancti Spiritus city. Continue the trip to Manaca – Iznaga, the center of the Valle de los Ingenios, a region that was one of the most prosperous in Cuba in the XVII and XVIII centuries, its splendor still retains thanks to the cultivation and production of sugar cane. Arrival in Trinidad. Accommodation at a local hotel.<br><br>\r\n<b>TRINIDAD - CIENFUEGOS</b><br>\r\n<b>DAY 5.</b> Breakfast. City tour around Trinidad, a World Heritage Site. Visit the Romantic Museum, La Canchánchara Bar. Lunch at a local restaurant. Continue the trip to Cienfuegos. Accommodation and dinner at the chosen hotel.<br><br>\r\n<b>CIENFUEGOS - GUAMÁ - HAVANA AND / OR VARADERO</b><br>\r\n<b>DAY 6.</b> Breakfast. Panoramic visit of the city of Cienfuegos. Departure to Montemar Park. Lunch at a local restaurant. Visit the Crocodile Hatchery. Continue the trip to Varadero or Havana. Overnight at the hotel (<b>by the T.O.</b>)', '0', 4, '0', '0', '1');
INSERT INTO `roundtrips` VALUES (5, 'Colores y Aromas de Cuba', 'Colors and Scents of Cuba', 6, 6, 4, '<b>HABANA</b><br>\r\n<b>DÍA 1.</b> Recorrido de  ciudad con visita al Centro Histórico de la Habana Vieja, Patrimonio de la Humanidad. Visita a las plazas de La Habana: Plaza de la Catedral, Plaza de Armas, Plaza de San Francisco de Asís y Plaza Vieja. Almuerzo en restaurante local. En la tarde  en  <b>AUTOS ANTIGUOS</b>  visita  panorámica al Capitolio, Parque Central, Parque de la Fraternidad, Plaza de la Revolución. Retorno al hotel. <b>(por el T.O.)</b><br><br> \r\n<b>HABANA - LAS TERRAZAS - HABANA</b><br>\r\n<b>DÍA 2.</b> Salida hacia Las Terrazas, proyecto ecológico ubicado en la Sierra de del Rosario, declarada por la UNESCO Reserva de la Biosfera, disfrutando de la flora y la fauna cubanas y de las bellezas del lugar. Se conocerá el hotel La Moka, singular instalación insertada en el bosque. Visita a la hacienda La Unión, con un bello jardín de plantas tropicales. Desplazamiento hacia las ruinas parcialmente reconstruidas del Cafetal Buenavista, hacienda cafetalera del siglo XIX, conociendo didácticamente la historia del lugar y el proceso del beneficio del café en la época. Contacto con la comunidad, visitando la Plaza del Pueblo y sus instalaciones socio-culturales, con la posibilidad de degustar el exquisito café cubano en la casa de María (no incluido). Se visitará el Taller de Serigrafía del lugar, pudiendo conocer acerca de este trabajo y del de artesanía que se desarrolla en el lugar, con posibilidades de comprar diversos artículos. Almuerzo en la zona y, si se desea,  tiempo de baño en el Río San Juan. Regreso al hotel en la Habana. <b>(por el T.O.)</b><br><br>\r\n<b>HABANA –  CIENFUEGOS</b><br>\r\n<b>DÍA 3.</b> Salida hacia la ciudad de Cienfuegos, llamada la Perla del Sur, en la cual se destaca el trazado perfecto de sus calles y edificaciones de alto valor arquitectónico, que revelan el esplendor de una cultura con fuerte acento francés. Visita al Teatro Tomás Terry y al Palacio de Valle, donde conocerá la hermosa leyenda que se asocia a la construcción. Almuerzo en restaurante de la zona. En la tarde visita y disfrute de uno de los ecosistemas más singulares de nuestro país ubicada al Sudeste de la hermosa Bahía Cienfueguera donde se podrá observar las colonias de Flamencos Rosados, patos de la Florida y otras especies migratorias. Es además el mayor criadero de camarones de Cienfuegos. Paseo en bote por la laguna natural o paseo marítimo para disfrute de la zona. Alojamiento y cena en hotel seleccionado. Noche a disposición.<br><br>\r\n<b>CIENFUEGOS – TRINIDAD – SANCTI SPÍRITUS</b><br>\r\n<b>DÍA 4.</b> Desayuno. Salida hacia Sancti Spíritus, en tránsito visita a Trinidad, ciudad que con sus calles zanjadas al medio, su Plaza Mayor y su arquitectura parece haberse detenido en los siglos XVIII y XIX, y que fue declarada en 1988, por la UNESCO, Patrimonio de la Humanidad. Visita al Museo Romántico y al Bar la Canchánchara, donde podrá degustar un trago típico de bienvenida. Almuerzo en restaurante de la zona. Continuación del viaje. Alojamiento y cena en hotel seleccionado. Noche a disposición.<br><br>\r\n<b>SANCTI SPÍRITUS  -  SANTA CLARA</b><br>\r\n<b>DÍA 5.</b> Desayuno. Recorrido panorámico por el macizo montañoso del Escambray, una de las más importantes cordilleras del país; pasando por Manicaragua, asentamiento de comunidades de cultivadores del famoso tabaco cubano y del rico café. En tránsito, se podrán observar las plantaciones de tabaco de la zona. Paseo por el Lago Hanabanilla, único lago de montaña de Cuba. Almuerzo en un restaurante local. Continuación del viaje hacia Santa Clara. Alojamiento y  cena en  hotel de la zona.<br><br>\r\n<b>SANTA CLARA – VARADERO Y/O LA HABANA</b><br>\r\n<b>DÍA 6.</b> Desayuno. Recorrido por la ciudad de Santa Clara, la capital del centro de Cuba, con un recorrido por la ruta patrimonial de la ciudad, que incluye el Parque del Carmen, lugar donde se fundó la villa en 1685 y el Parque Leoncio Vidal. Visita a la Plaza Ernesto Che Guevara, lugar de encuentro con una de las más prominentes y carismáticas personalidades de la historia contemporánea mundial, y donde se encuentran el Museo y el Memorial que lleva su nombre. Visita al monumento a la acción contra el Tren Blindado. Almuerzo en restaurante de la zona. Continuación del viaje hacia Varadero o La Habana. Alojamiento en el hotel seleccionado. <b>(por el T.O.)</b>', '<b>HAVANA</b><br>\r\n<b>DAY 1.</b> City tour with a Visit the Historical Center of Old Havana, World Heritage. Visit Havana squares: The Cathedral Square, Plaza de Armas, Plaza de San Francisco de Asís and Plaza Vieja. Lunch at a local restaurant. In the afternoon, antique car sightseeing tour to the Capitol, Central Park, Fraternidad Park, The Revolution Square. Return to the hotel. (<b>by the T.O.</b>)<br><br>\r\n<b>HAVANA - LAS TERRAZAS - HAVANA</b><br>\r\n<b>DAY 2.</b> Departure to Las Terrazas, an ecological project located in the Sierra del Rosario, UNESCO Biosphere Reserve, enjoying the Cuban flora and fauna and the amenities of the place. Visit La Moka Hotel, a unique facility inserted into the forest. Visit the La Union Hacienda, with a beautiful garden of tropical plants. A walk around the partially restored ruins of the Cafetal Buenavista, nineteenth-century coffee plantation, didactically acquiring the history of the place and getting in touch with coffee processing at that time. Contact with the community. Visit the Plaza del Pueblo and socio-cultural facilities, with the possibility to taste the delicious Cuban coffee at the Home of Mary (not included). A visit to the Silkscreen Workshop to know about the crafts developed at this place, with the possibility of buying various items. Lunch in the area and, if desired, bath time in the San Juan River. Return to the hotel in Havana. (<b>by the T.O.</b>)<br><br>\r\n<b>HAVANA - CIENFUEGOS</b><br>\r\n<b>DAY 3.</b> Departure to the city of Cienfuegos, called the Pearl of the South, where the perfect layout of its streets and its buildings of high architectural value reveal the splendor of a culture with a strong French accent. Visit the Tomás Terry Theater and the Palacio de Valle, where you will know of the beautiful legend associated with its construction. Lunch at a local restaurant. In the afternoon visit and enjoy a unique ecosystem of our country located in the southeast of the beautiful Cienfuegos’ bay where you can see colonies of pink flamingos, Florida ducks and other migratory species. It is also the largest shrimp farm in Cienfuegos. Boat ride through the natural lagoon or promenade to enjoy the area. Accommodation. Dinner at local hotel. Free night.<br><br>\r\n<b>CIENFUEGOS - TRINIDAD - SANCTI SPIRITUS</b><br>\r\n<b>DAY 4.</b> Breakfast. Departure to Sancti Spíritus. In transit visit to Trinidad, a city with ditched sections in the middle of the streets, its Plaza Mayor and its architecture that seems to be frozen in the eighteenth and nineteenth centuries. The city was declared World Heritage in 1988 by UNESCO. Visit the Romantic Museum and La Canchánchara Bar, where you can taste a typical welcome drink. Lunch at a local restaurant. Continue the trip to its destination. Accommodation and dinner at the chosen hotel. Free night.<br><br>\r\n<b>SANCTI SPÍRITUS - SANTA CLARA</b><br>\r\n<b>DAY 5.</b> Breakfast. Panoramic tour through the Escambray mountain range, one of the most important mountain ranges of the country. Visit Manicaragua, a farmers’ settlement famous for the Cuban tobacco and the delicious coffee. In transit, tobacco plantations may be spotted in the area. Walk around Hanabanilla Lake, the only Cuban mountain lake. Lunch at a local restaurant. Continue the trip to Santa Clara. Accommodation and dinner at a local hotel.<br><br>\r\n<b>SANTA CLARA -VARADERO AND/OR HAVANA</b><br>\r\n<b>DAY 6.</b> Breakfast. Tour around the city of Santa Clara, the capital of central Cuba, with a tour along the heritage route in the city, including the Parque del Carmen, where the town was founded in 1685 and Leoncio Vidal Park. Visit the Ernesto Che Guevara Plaza, in which you will get in touch with the life and work of one of the most prominent and charismatic personalities of contemporary world history, and where the Museum and the Memorial that bear his name are located. Visit the Armored Train Monument. Lunch at a local restaurant. Continue the trip to Varadero or Havana. Overnight at the chosen hotel. (<b>by the T.O.</b>)', '0', 5, '0', '0', '1');
