mantic Museum and La Canchánchara Bar, where you can taste a typical welcome drink. Lunch at a local restaurant. Continue the trip to Sancti Spiritus. Accommodation and dinner at the chosen hotel. Free night.<br><br>\r\n<b>SANCTI SPÍRITUS - SANTA CLARA</b><br>\r\n<b>DAY 3.</b> Breakfast. Panoramic tour through the Escambray mountain range, one of the most important mountain ranges of the country. Visit Manicaragua, a farmers settlement famous for the Cuban tobacco and the delicious coffee. In transit, tobacco plantations may be spotted in the area. Walk around Hanabanilla Lake, the only Cuban mountain lake. Lunch at a local restaurant. Continue the trip to Santa Clara. Accommodation and dinner at a local hotel.<br><br>\r\n<b>SANTA CLARA - VARADERO AND/OR HAVANA</b><br>\r\n<b>DAY 4.</b> Breakfast. Tour around the city of Santa Clara, the capital of central Cuba, with a tour along the heritage route in the city, including the Parque del Carmen, where the town was founded in 1685 and Leoncio Vidal Park. Visit the Ernesto Che Guevara Plaza, in which you will get in touch with the life and work of one of the most prominent and charismatic personalities of contemporary world history, and where the Museum and the Memorial that bear his name are located. Visit the Armored Train Monument. Lunch at a local restaurant. Continue the trip to Varadero or Havana. Overnight at the chosen hotel. (<b>by the T.O.</b>)', '0', 6, '0', '0', '1');
INSERT INTO `roundtrips` VALUES (7, 'Cuba, Mar, Naturaleza e Historia', 'Cuba, Sea, Nature and History', 6, 4, 6, '<b>HABANA – PLAYA GIRON</b><br>\r\n<b>DÍA 1.</b> Salida hacia Guamá, ubicada en la Península de Zapata, provincia de Matanzas.  Explicaciones de interés del guía durante el recorrido.  Visita al Criadero de Cocodrilos, con recorrido por el lugar. Almuerzo en restaurante de la zona. Alojamiento y cena en hotel seleccionado.<br><br>\r\n<b>PLAYA GIRON - CIENFUEGOS - TRINIDAD - SANTA CLARA</b><br>\r\n<b>DÍA 2.</b> Desayuno. Salida para Santa Clara en tránsito visita panorámica a la Ciudad de Cienfuegos llamada la Perla del Sur, en la cual se destaca el trazado perfecto de sus calles y edificaciones de alto valor arquitectónico, que revelan el esplendor de una cultura con fuerte acento francés, continuación del viaje a Trinidad. Almuerzo en la zona Recorrido por la ciudad, una de las primeras villas fundadas en Cuba por los españoles a principios del siglo XV, declarada por la UNESCO Patrimonio de la Humanidad. Visita a la Plaza Mayor; Museo Romántico; La Iglesia de la Santísima Trinidad; Bar la Canchánchara, con su típico cóctel de bienvenida; Taller de Cerámica. Tiempo libre en la ciudad. Continuación del viaje a Santa Clara. Alojamiento y Cena en el hotel.<br><br>\r\n<b>SANTA  CLARA - CAYO LAS BRUJAS - SANTA CLARA</b><br>\r\n<b>DÍA 3.</b> Desayuno. Salida de excursión a Cayo Las Brujas, con 11 Km de playas vírgenes de magnifica calidad, que forman la nueva región turística, unida a tierra firme a través de una carretera sobre el mar de 48 Km. En tránsito, vista panorámica a la ciudad de Remedios. Disfrute de la playa. Almuerzo marinero. Regreso al Hotel. Alojamiento y cena en el hotel.<br><br>\r\n<b>SANTA CLARA – HABANA Y/O VARADERO</b><br>\r\n<b>DÍA 4.</b>  Desayuno. Recorrido por la ciudad de Santa Clara, la capital del centro de Cuba, con un recorrido por la ruta patrimonial de la ciudad, que incluye el Parque del Carmen, lugar donde se fundó la villa en 1685 y el Parque Leoncio Vidal. Visita a la Plaza Ernesto Che Guevara, lugar de encuentro con una de las más prominentes y carismáticas personalidades de la historia contemporánea mundial, y donde se encuentran el Museo y el Memorial que lleva su nombre. Visita al monumento a la acción contra el Tren Blindado. Almuerzo en restaurante de la zona. Continuación del viaje hacia Varadero o La Habana. Alojamiento en el hotel seleccionado. <b>(por el T.O.)</b>', '<b>HAVANA - PLAYA GIRÓN</b><br>\r\n<b>DAY 1.</b> Departure to Guamá, located in the Zapata Peninsula, Matanzas province. Tour interpretation. Visit the Crocodile Hatchery with a tour of the site. Lunch at a local restaurant. Accommodation and dinner at the chosen hotel.<br><br>\r\n<b>PLAYA GIRÓN - CIENFUEGOS - TRINIDAD - SANTA CLARA</b><br>\r\n<b>DAY 2.</b> Breakfast. Departure to Santa Clara. In transit panoramic visit of the city of Cienfuegos called the Pearl of the South, where the perfect layout of its streets and its buildings of high architectural value reveal the splendor of a culture with a strong French accent. Continue the trip to Trinidad. Lunch at a local restaurant. Tour around the city, one of the first villages founded in Cuba by the Spaniards in the early fifteenth century, a UNESCO World Heritage Site. Visit the Plaza Mayor; The Romantic Museum; The Church of the Holy Trinity; La Canchánchara Bar, with its typical welcome cocktail; Ceramics workshop. Free time in the city. Continue the trip to Santa Clara. Accommodation and dinner at the hotel.<br><br>\r\n<b>SANTA CLARA - LAS BRUJAS CAYO - SANTA CLARA</b><br>\r\n<b>DAY 3.</b> Breakfast. Tour around Las Brujas Key with 11 Km of virgin beaches of superb quality part of the new touristic region, joined to the mainland through a sea highway of 48 Km. In transit panoramic view of Remedios city. Enjoy the beach. Seafood lunch. Back to the hotel. Accommodation and dinner at the hotel.<br><br>\r\n<b>SANTA CLARA - HAVANA AND/OR VARADERO</b><br>\r\n<b>DAY 4.</b> Breakfast. Tour around the city of Santa Clara, the capital of central Cuba, with a tour along the heritage route in the city, including the Parque del Carmen, where the town was founded in 1685 and Leoncio Vidal Park. Visit the Ernesto Che Guevara Plaza, in which you will get in touch with the life and work of one of the most prominent and charismatic personalities of contemporary world history, and where the Museum and the Memorial that bear his name are located. Visit the Armored Train Monument. Lunch at a local restaurant. Continue trip to Varadero or Havana. Overnight at the selected hotel. (<b>by the T.O.</b>)', '0', 7, '0', '0', '1');
INSERT INTO `roundtrips` VALUES (8, 'Cuba, donde crece la Palma', 'Cuba, where the palm tree grows', 2, 4, 5, '<b>HABANA – SANTA CLARA</b><br>\r\n<b>DÍA 1.</b> Salida hacia la Ciudad de Santa Clara. Almuerzo en un restaurante local. Visita a la Plaza Ernesto Che Guevara, lugar de encuentro con una de las más prominentes y carismáticas personalidades de la historia contemporánea mundial, y donde se encuentran el Museo y el Memorial que lleva su nombre. Visita al monumento a la acción contra el Tren Blindado. Recorrido panorámico por  Santa Clara. Alojamiento en hotel de la ciudad. Cena en el hotel.<br><br>\r\n<b>SANTA CLARA - CAYO LAS BRUJAS - SANTA CLARA</b><br>\r\n<b>DÍA 2.</b> Desayuno. En tránsito visita a la ciudad de Remedios. Salida de excursión a Cayo Las Brujas con 11 Km de playas vírgenes de magnifica calidad, que forman la nueva región turística, unida a tierra firme a través de una carretera sobre el mar de 48 Km. En tránsito vista panorámica a la ciudad de Remedios. Disfrute de la playa. Almuerzo marinero. Regreso al hotel. Alojamiento y cena.<br><br>\r\n<b>SANTA CLARA – TOPES DE COLLANTES - TRINIDAD</b><br>\r\n<b>DÍA 3.</b> Desayuno. Visita al Parque Guanayara, caminata de 5000 metros por el extraordinario sendero natural.  Almuerzo en un restaurante local.  Salida para Trinidad. Alojamiento en hotel de la ciudad. Cena en hotel.<br><br>\r\n<b>TRINIDAD – CIENFUEGOS – HABANA Y/O VARADERO</b><br>\r\n<b>DÍA 4.</b> Desayuno. Recorrido panorámico por la ciudad de Trinidad, Patrimonio de La Humanidad, visitando el Museo Romántico y Bar La Canchánchara. Salida hacia Varadero. En tránsito, recorrido por la ciudad de Cienfuegos. Recorrido por sus calles y avenidas fundadas por los franceses; visita al Parque Martí, Teatro Tomas Terry, Casa de Bienes Culturales y Catedral de la Purísima Concepción. Almuerzo en un restaurante local. Continuación del viaje hacia Varadero o La Habana. Alojamiento en el hotel seleccionado. <b>(por el T.O.)</b>', '<b>HAVANA - SANTA CLARA</b><br>\r\n<b>DAY 1.</b> Departure to the City of Santa Clara. Lunch at a local restaurant. Visit the Ernesto Che Guevara Plaza, in which you will get in touch with the life and work of one of the most prominent and charismatic personalities of contemporary world history, and where the Museum and the Memorial that bear his name are located. Visit the Armored Train Monument. Panoramic tour of Santa Clara. Hotel accommodation in the city. Dinner at the hotel.<br><br>\r\n<b>SANTA CLARA - LAS BRUJAS CAYO - SANTA CLARA</b><br>\r\n<b>DAY 2.</b> Breakfast. In transit visit of Remedios city. Tour around Las Brujas Key with 11 Km of virgin beaches of superb quality part of the new touristic region, joined to the mainland through a sea highway of 48 Km. In transit panoramic view of Remedios city. Enjoy the beach. Seafood lunch. Back to the hotel. Accommodation and dinner at the hotel.<br><br>\r\n<b>SANTA CLARA – TOPES DE COLLANTES - TRINIDAD</b><br>\r\n<b>DAY 3.</b> Breakfast. Visit the Guanayara Park, a 5000-meter walk through the extraordinary nature trail. Lunch at a local restaurant. Departure to Trinidad. Hotel accommodation in the city. Dinner at the hotel.<br><br>\r\n<b>TRINIDAD - CIENFUEGOS - HAVANA AND/OR VARADERO</b><br>\r\n<b>DAY 4.</b> Breakfast. Panoramic city tour of Trinidad, a World Heritage Site. Visit the Romantic Museum and La Canchánchara Bar. Departure to Varadero. In transit tour of Cienfuegos city. Walk through its streets and avenues founded by the French; Visit Marti Park, The Tomas Terry Theater, House of Cultural Property and the Immaculate Conception Cathedral. Lunch at a local restaurant. Continue the trip to Varadero or Havana. Overnight at the selected hotel. (<b>by the T.O.</b>)', '0', 8, '0', '0', '1');
INSERT INTO `roundtrips` VALUES (9, 'Una pincelada cubana', 'A Cuban brushstroke', 5, 3, 6, '<b>HABANA – TERRAZAS - SOROA</b><br>\r\n<b>DÍA 1.</b> Salida a las Terrazas. Visita a la comunidad, salto opcional en canopy. Visita a la Casa del Campesino. Almuerzo en  restaurante local, disfrute del baño en el río San Juan. Salida hacia Soroa  Alojamiento y cena en Hotel de Soroa.<br><br>\r\n<b>SOROA - VIÑALES</b><br>\r\n<b>DÍA 2.</b> Desayuno. Recorrido por Soroa con visita al Orquideario y al Salto de Agua. Almuerzo en restaurante local. Salida  hacia Viñales. Visita a la casa del Veguero Montesino, la cual ha estado en manos de la misma familia desde hace 3 generaciones. Alojamiento y cena en Viñales.<br><br>\r\n<b>VIÑALES - HABANA</b><br>\r\n<b>DÍA 3.</b> Desayuno. Recorrido por el Valle de Viñales, en Pinar del Río, provincia más occidental de Cuba y donde se cultiva el mejor tabaco del mundo.  Recorrido por el valle, visitando el Mural de la Prehistoria. Almuerzo en un restaurante local. Visita opcional a  La Cueva del Indio. Visita, en tránsito, a la Casa del Veguero, para conocer plantaciones de tabaco (en temporada de plantaciones)  y su proceso. Retorno a la Habana. Alojamiento hotel seleccionado. <b>(por el T.O.)</b>', '<b>HAVANA - TERRAZAS - SOROA</b><br>\r\n<b>DAY 1.</b> Departure to Las Terrazas. Visit the community, optional canopy jump. Visit the Casa del Campesino. Lunch at a local restaurant. Enjoy bathing in the San Juan river. Departure to Soroa Hotel.<br><br>\r\n<b>SOROA - VIÑALES</b><br>\r\n<b>DAY 2.</b> Breakfast. Soroa tour with Visit the Orchid Garden and the waterfall. Lunch at a local restaurant. Departure to Viñales. Visit the Veguero Montesino house, which has been owned by the same family for 3 generations. Accommodation and dinner in Viñales.<br><br>\r\n<b>VIÑALES - HAVANA</b><br>\r\n<b>DAY 3.</b> Breakfast. Tour through the Viñales Valley, in Pinar del Río, Cuba\'s westernmost province where the best tobacco in the world is grown. Tour through the valley. Visit the Prehistory Mural. Lunch at a local restaurant. Optional Visit the Cueva del Indio. In transit visit the House of Veguero to know about tobacco plantations (in season) and the tobacco production process. Return to Havana. Accommodation at the chosen hotel. (<b>by the T.O.</b>)', '0', 9, '0', '0', '1');
INSERT INTO `roundtrips` VALUES (10, 'Hay sol bueno y mar de espumas', 'There is good sun and foamy sea', 5, 6, 4, '<b>HABANA</b><br>\r\n<b>DÍA 1.</b> Recogida en el hotel; Visita a la Habana Colonial, declarada por la UNESCO Patrimonio \r\nCultural de la Humanidad. Recorrido a pie por el casco histórico, con sus plazas, fortalezas y \r\nedificios construidos por los españoles entre los siglos XVI y XIX, con oportunidades para la \r\ncompra de artesanías; Visita en tránsito a La Bodeguita del Medio y principales calles y \r\navenidas de la Habana Vieja. Parada en el Capitolio; Almuerzo con un líquido en un \r\nrestaurante de la zona; Continuación del recorrido con vista panorámica de la Universidad de \r\nLa Habana y parada en la Plaza de la Revolución con tiempo para fotos; Regreso al hotel. \r\nAlojamiento (<b>por el T.O.</b>)<br><br>\r\n<b>HABANA - VIÑALES - HABANA</b><br>\r\n<b>DÍA 2.</b> Salida hacia Pinar del Río. Paseo por el Valle de Viñales, declarado Paisaje Cultural \r\nProtegido por la UNESCO y Monumento Nacional Natural. Visita a la Casa del Veguero, donde \r\npodrá degustar de un coctel de bienvenida y además apreciar las plantaciones de tabaco que \r\nallí se encuentran cultivadas; Visita al Mirador de Los Jazmines, lugar que ofrece una hermosa \r\nvista general del Valle de Viñales; Visita a la Cueva del Indio con paseo en bote por el río que \r\ncorre en su interior; Almuerzo en un restaurante de la zona; Visita al Mural de la Prehistoria que \r\nmuestra el proceso de evolución de la vida en la Sierra de los Órganos, desde el molusco hasta \r\nlos primeros habitantes indígenas del lugar; Regreso al hotel. (<b>por el T.O.</b>)<br><br>\r\n<b>HABANA – CIENFUEGOS - TRINIDAD - CAYO SANTA MARÍA</b><br>\r\n<b>DÍA 3.</b> Salida hacia Cayo Santa María. En tránsito, recorrido por la ciudad de Cienfuegos, \r\nconocida como la Perla del Sur. Recorrido por sus calles y avenidas fundadas por los \r\nfranceses. Está situada en una maravillosa bahía, donde se halla el mayor coral de Cuba hasta \r\nahora descubierto, y bautizado con el nombre de Notre Dame. Visita al Parque Martí, Teatro \r\nTomas Terry, Casa de Bienes Culturales y Catedral de la Purísima Concepción. Visita en \r\ntránsito a la ciudad de Trinidad, llamada la Ciudad Museo de Cuba, tiene el privilegio de ser \r\nuna de las localidades coloniales del país y califica además entre los conjuntos arquitectónicos \r\nmás completos y conservados del continente americano. Declarada Patrimonio de la \r\nHumanidad por la UNESCO en 1988. Visita al Museo Romántico y Bar La Canchánchara. \r\nAlmuerzo en restaurante de la zona. Continuación del viaje hacia Cayo Santa María.<br><br>\r\n<b>CAYO SANTA MARÍA</b><br>\r\n<b>DÍA 4.</b> Día libre en Cayo Santa María para disfrutar del régimen Todo Incluido.<br><br>\r\n<b>CAYO SANTA MARÍA – REMEDIOS - SANTA CLARA - VARADERO</b><br>\r\n<b>DÍA 5.</b> Desayuno. Salida hacia Varadero. En tránsito vista panorámica a la ciudad de Remedios \r\ny posteriormente recorrido por la ciudad de Santa Clara, la capital del centro de Cuba, con un \r\nrecorrido por la ruta patrimonial de la ciudad, que incluye el Parque del Carmen, lugar donde se \r\nfundó la villa en 1685 y el Parque Leoncio Vidal. Visita a la Plaza Ernesto Che Guevara, lugar \r\nde encuentro con una de las más prominentes y carismáticas personalidades de la historia \r\ncontemporánea mundial, y donde se encuentran el Museo y el Memorial que lleva su nombre. \r\nVisita al monumento a la acción contra el Tren Blindado. Almuerzo en tránsito en restaurante \r\nlocal. Continuación del recorrido hacia Varadero. Alojamiento (<b>por el T.O</b>)<br><br>\r\n<b>VARADERO</b><br>\r\n<b>DÍA 6.</b> Desayuno. Recogida en el hotel. Paseo en Catamarán donde podrá apreciar los \r\nencantos de nuestros mares. Snorkeling en la Barrera Coralina, Tiempo de playa en Cayo \r\nBlanco. Almuerzo (a base de: Langosta, Camarón, Pulpo, Pollo, pan, arroz, vegetales, vianda, \r\npostre, café). Bar abierto a bordo y en el Cayo Blanco. Snack a bordo. Animación a bordo y en \r\nCayo Blanco. Interacción con Delfines. Regreso al hotel.', '<b>HAVANA</b><br>\r\n<b>DAY 1.</b> Pick up at the hotel; Visit Old Havana, declared World Cultural Heritage Site. Walking tour around the historic town with its squares, fortresses and buildings built by the Spaniards between the sixteenth and nineteenth centuries, with opportunities for purchasing crafts; In transit Visit La Bodeguita del Medio and the main streets and avenues in Old Havana. Stop at the Capitol; Lunch with a beverage at a local restaurant; Continue the tour with a panoramic view of the University of Havana and stop at the Revolution Square; time for pictures. Back to the hotel. Accommodation (<b>by the T.O.</b>)<br><br>\r\n<b>HAVANA - VIÑALES - HAVANA</b><br>\r\n<b>DAY 2.</b> Departure to Pinar del Río. Walk through the Viñales Valley, declared Protected Cultural Landscape by UNESCO and a National Natural Monument. Visit the Casa del Veguero, where you can enjoy a welcome cocktail and also appreciate the tobacco plantations; Visit the Mirador de Los Jazmines, a place that offers a beautiful overview of Viñales Valley; Visit the Cueva del Indio with boat ride on the river that runs inside; Lunch at a local restaurant; Visit the Prehistory Mural showing the evolution process in the Sierra de los Órganos from mollusk to the first indigenous inhabitants of the place. Back to the hotel. (<b>by the T.O.</b>)<br><br>\r\n<b>HAVANA - CIENFUEGOS - TRINIDAD - CAYO SANTA MARÍA</b><br>\r\n<b>DAY 3.</b> Departure to Santa Maria Key. In transit tour of the city of Cienfuegos, known as the Pearl of the South. Walk through its streets and avenues founded by the French. This city is located in a beautiful bay with the largest coral reef of Cuba discovered so far. The Coral Reef is known as Notre Dame. Visit the Marti Park, The Tomas Terry Theater, The House of Cultural Property and the Immaculate Conception Cathedral. In transit visit to the city of Trinidad, called Cuba’s Museum City. It has the privilege of being one of the colonial cities of the country and also qualifies among the most complete and preserved architectural complexes in the Americas. Declared World Heritage Site by UNESCO in 1988. Visit the Romantic Museum, La Canchánchara Bar. Lunch at a local restaurant. Continue the trip to Santa Maria Key.<br><br>\r\n<b>CAYO SANTA MARÍA</b><br>\r\n<b>DAY 4.</b> Free day at Santa María Key to enjoy the All-Inclusive modality.<br><br>\r\n<b>CAYO SANTA MARÍA - REMEDIOS - SANTA CLARA - VARADERO</b><br>\r\n<b>DAY 5.</b> Breakfast. Departure to Varadero. In transit panoramic visit to Remedios city. Tour around the city of Santa Clara, the capital of central Cuba, with a walk around the heritage route in the city, including the Parque del Carmen, where the town was founded in 1685 and Leoncio Vidal Park. Visit the Plaza Ernesto Che Guevara, a meeting with one of the most prominent and charismatic personalities of contemporary world history, and where are the Museum and the Memorial that bears his name. Visit the Armored Train Monument. Lunch at a local restaurant. Then, travel to Varadero. Accommodation (<b>by the T.O.</b>)<br><br>\r\n<b>VARADERO</b><br>\r\n<b>DAY 6.</b> Breakfast. Pick up at the hotel. Catamaran ride where you can appreciate the beauty of our seas. Snorkeling on the Coral Reef. Beach time in Cayo Blanco. Lunch (with lobster, shrimp, octopus, chicken, bread, rice, vegetables, snack, dessert, coffee), open bar on board and in the Cayo Blanco Bar. Snack on board. Entertainment on board and in Cayo Blanco. Dolphin interaction. Back to the hotel.', '0', 10, '0', '1', '1');
