egos, called the Pearl of the South, where the perfect layout of its streets and buildings of high architectural value, which reveal the splendor of a culture with a strong French accent. Visit the Tomás Terry Theater and the Palacio de Valle, where you will know of the beautiful legend associated with its construction. Lunch at a local restaurant. Then travel to Santa Clara. Tour around the city of Santa Clara, the capital of central Cuba, with a tour along the heritage route in the city, including the Parque del Carmen, where the town was founded in 1685 and Leoncio Vidal Park. Visit the Ernesto Che Guevara Plaza, in which you will get in touch with the life and work of one of the most prominent and charismatic personalities of contemporary world history, and where the Museum and the Memorial that bear his name are located. Visit the Armored Train Monument. Overnight accommodation.<br><br>\r\n<b>SANTA CLARA - TRINIDAD - CAYO COCO</b><br>\r\n<b>DAY 2.</b> Breakfast. Departure to Trinidad. City tour of Trinidad, a city frozen in time. Visit the Plaza Mayor; The Romantic Museum; The Church of the Holy Trinity; La Canchánchara Bar, with its typical welcome cocktail; and a ceramics workshop. Lunch at a local restaurant. Continue the tour to Cayo Coco. Overnight accommodation.<br><br>\r\n<b>CAYO COCO</b><br>\r\n<b>DAY 3.</b> Breakfast. Free day in Cayo Coco to enjoy the All-Inclusive modality.<br><br>\r\n<b>CAYO COCO - HOLGUÍN / HAVANA</b><br>\r\n<b>DAY 4.</b> Breakfast. Departure to Cayo Coco Airport to take a flight to Holguin. City hotel accommodation', '0', 13, '0', '0', '1');
INSERT INTO `roundtrips` VALUES (14, 'Isla de los Encantos Especial', 'Island Charms Special', 6, 9, 10, '<b>HABANA</b><br>\r\n<b>DÍA 1.</b> Recorrido de ciudad con visita al Centro Histórico de la Habana Vieja, Patrimonio de la \r\nHumanidad. Visita a las plazas de La Habana: Plaza de la Catedral, Plaza de Armas, Plaza de \r\nSan Francisco de Asís y Plaza Vieja. Almuerzo en restaurante local. En la tarde en AUTOS \r\nANTIGUOS visita panorámica al Capitolio, Parque Central, Parque de la Fraternidad, Plaza de \r\nla Revolución. Retorno al hotel. Alojamiento (<b>por el T.O.</b>)<br><br>\r\n<b>HABANA - VIÑALES - HABANA</b><br>\r\n<b>DÍA 2.</b> Salida hacia Pinar del Río. Paseo por el Valle de Viñales, declarado Paisaje Cultural \r\nProtegido por la UNESCO y Monumento Nacional Natural. Visita a la Casa del Veguero, donde \r\npodrá degustar de un coctel de bienvenida y además apreciar las plantaciones de tabaco que \r\nallí se encuentran cultivadas; Visita al Mirador de Los Jazmines, lugar que ofrece una hermosa \r\nvista general del Valle de Viñales; Visita a la Cueva del Indio con paseo en bote por el río que \r\ncorre en su interior; Almuerzo en un restaurante de la zona; Visita al Mural de la Prehistoria que \r\nmuestra el proceso de evolución de la vida en la Sierra de los Órganos, desde el molusco hasta \r\nlos primeros habitantes indígenas del lugar; Regreso al hotel. (<b>por el T.O.</b>)<br><br>\r\n<b>HABANA – CIENFUEGOS - SANTA CLARA</b><br>\r\n<b>DÍA 3.</b> Salida hacia la ciudad de Cienfuegos, llamada la Perla del Sur, en la cual se destaca el \r\ntrazado perfecto de sus calles y edificaciones de alto valor arquitectónico, que revelan el \r\nesplendor de una cultura con fuerte acento francés. Visita al Teatro Tomás Terry y al Palacio \r\nde Valle, donde conocerá la hermosa leyenda que se asocia a la construcción. Almuerzo en \r\nrestaurante de la zona. Continuación del recorrido hacia Santa Clara. Recorrido por la ciudad \r\ncapital del centro de Cuba, con un recorrido por la ruta patrimonial de la ciudad, que incluye el \r\nParque del Carmen, lugar donde se fundó la villa en 1685 y el Parque Leoncio Vidal. Visita a la \r\nPlaza Ernesto Che Guevara, lugar de encuentro con una de las más prominentes y \r\ncarismáticas personalidades de la historia contemporánea mundial, y donde se encuentran el \r\nMuseo y el Memorial que lleva su nombre. Visita al monumento a la acción contra el Tren \r\nBlindado. Alojamiento en hotel seleccionado.<br><br>\r\n<b>SANTA CLARA – TRINIDAD - CAYO COCO</b><br>\r\n<b>DÍA 4.</b> Desayuno. Salida hacia Trinidad. Recorrido por la ciudad de Trinidad, ciudad detenida \r\nen el tiempo. Visita a la Plaza Mayor; Museo Romántico; La Iglesia de la Santísima Trinidad; \r\nBar la Canchánchara, con su típico coctel de bienvenida; y Taller de Cerámica. Almuerzo en \r\nrestaurante local. Continuación del recorrido hacia Cayo Coco. Alojamiento en hotel \r\nseleccionado.<br><br>\r\n<b>CAYO COCO</b><br>\r\n<b>DÍA 5.</b> Desayuno. Día Libre en Cayo Coco para disfrutar del Régimen Todo Incluido.<br><br>\r\n<b>CAYO COCO - HOLGUÍN</b><br>\r\n<b>DÍA 6.</b> Desayuno. Salida hacia Aeropuerto de Cayo Coco para tomar vuelo con destino \r\nHolguín. Alojamiento en hotel de ciudad<br><br>\r\n<b>HOLGUÍN – BIRÁN – HOLGUÍN</b><br>\r\n<b>DÍA 7.</b> Desayuno. Salida hacia el Conjunto Histórico Birán, pueblo natal del Comandante de la \r\nRevolución Cubana Fidel Castro. Visita y degustación de coctel en el Mirador de Mayabe, el \r\ncual se encuentra en lo alto de una colina que, como un balcón natural, se abre a uno de los \r\nmás hermosos y profusos paisajes del oriente cubano. Almuerzo en restaurante de la zona. A \r\ncontinuación, recorrido por la ciudad de Holguín conocida como Ciudad de los Parques. con \r\nvisita al Museo de La Periquera. Alojamiento en hotel de ciudad.<br><br>\r\n<b>HOLGUÍN – CAJOBABO - BARACOA</b><br>\r\n<b>DÍA 8.</b> Desayuno. Salida hacia Baracoa. Visita en tránsito a Playita de Cajobabo, Este sitio, \r\nubicado en la costa sur de la provincia Guantánamo en el municipio Imías, con costa al Mar \r\nCaribe y a 3 Km. al este del poblado de Cajobabo es el primero de los que marcan la ruta de \r\nJosé Martí en la Guerra del 95 y de sus restos mortales, declarada Monumento Nacional el 19 \r\nde mayo de 2003.  Continuación hacia Baracoa. Recorrido a pie por la ciudad, primera villa \r\nfundada por los españoles en América y primera capital de la Isla de Cuba, que atesora en su \r\niglesia de Nuestra Señora de la Concepción la Cruz de Parra traída por Cristóbal Colón y que \r\nse considera el símbolo más antiguo de la religión cristiana en Cuba. Visita al Museo Municipal \r\nFuerte de Matachín. Recorrido por el Sendero de la ruta del cacao. Visita a Rancho Toa con \r\nalmuerzo y paseo en cayucas. Alojamiento en hotel de Baracoa.<br><br>\r\n<b>BARACOA – SANTIAGO DE CUBA – HOLGUÍN - HABANA</b><br>\r\n<b>DÍA 9.</b> Desayuno. Salida hacia la Ciudad de Santiago de Cuba, una de las más caribeña \r\nciudades cubanas, que atesora un inmenso patrimonio histórico y cultural. Recorrido por el \r\ncentro histórico de la ciudad. Visita al Cementerio de Santa Ifigenia, donde reposan los restos \r\ndel Héroe Nacional de Cuba José Martí y nuestro comandante Fidel Castro, líder de la \r\nRevolución Cubana. Visita al histórico Museo 26 de Julio y recorrido panorámico por otros \r\nlugares de interés. Salida hacia el Castillo de San Pedro de la Roca del Morro, recorrido y \r\nalmuerzo en el restaurante El Morro. A continuación, salida hacia Holguín con visita a la Loma \r\nde la Cruz con cena incluida en el lugar donde se podrá disfrutar de una de las vistas nocturnas \r\nmás impresionantes de la ciudad de Holguín. Salida hacia el Aeropuerto Frank País de Holguín \r\npara tomar vuelo de regreso a La Habana con traslado a los hoteles. Alojamiento (<b>por el T.O.</b>) ', '<b>HAVANA</b><br>\r\n<b>DAY 1.</b> City tour with a visit to the Historical Center of Old Havana, a World Heritage Site. Visit squares of Havana: The Cathedral Square, Plaza de Armas, Plaza de San Francisco de Asís and Old Town Square. Lunch at a local restaurant. In the afternoon, antique car sightseeing tour to the Capitol, Central Park, Fraternidad Park, The Revolution Square. Return to the hotel. Accommodation (<b>by the T.O.</b>)<br><br>\r\n<b>HAVANA - VIÑALES - HAVANA</b><br>\r\n<b>DAY 2.</b> Departure to Pinar del Río. Walk through the Viñales valley, declared Protected Cultural Landscape by UNESCO and a National Natural Monument. Visit the Casa del Veguero, where you can enjoy a welcome cocktail and also appreciate the tobacco plantations; Visit the Mirador de Los Jazmines, a place that offers a beautiful overview of Viñales Valley; visit the Cueva del Indio with boat ride on the river that runs inside. Lunch at a local restaurant; visit the Prehistory Mural showing the process evolution in the Sierra de los Órganos from mollusk to the first indigenous inhabitants of the place. Back to the hotel.<br><br>\r\n<b>HAVANA - CIENFUEGOS - SANTA CLARA</b><br>\r\n<b>DAY 3.</b> Departure to the city of Cienfuegos, called the Pearl of the South, where the perfect layout of its streets and buildings of high architectural value, which reveal the splendor of a culture with a strong French accent. Visit the Tomás Terry Theater and the Palacio de Valle, where you will know of the beautiful legend associated with its construction. Lunch at a local restaurant. Then travel to Santa Clara. Tour around the city of Santa Clara, the capital of central Cuba, with a tour along the heritage route in the city, including the Parque del Carmen, where the town was founded in 1685 and Leoncio Vidal Park. Visit the Ernesto Che Guevara Plaza, in which you will get in touch with the life and work of one of the most prominent and charismatic personalities of contemporary world history, and where the Museum and the Memorial that bear his name are located. Visit the Armored Train Monument. Overnight accommodation.<br><br>\r\n<b>SANTA CLARA - TRINIDAD - CAYO COCO</b><br>\r\n<b>DAY 4.</b> Breakfast. Departure to Trinidad. City tour of Trinidad, a city frozen in time. Visit the Plaza Mayor; The Romantic Museum; The Church of the Holy Trinity; La Canchánchara Bar, with its typical welcome cocktail; and a ceramics workshop. Lunch at a local restaurant. Continue the tour to Cayo Coco. Overnight accommodation.<br><br>\r\n<b>CAYO COCO</b><br>\r\n<b>DAY 5.</b> Breakfast. Free day in Cayo Coco to enjoy the All-Inclusive modality.<br><br>\r\n<b>CAYO COCO - HOLGUÍN</b><br>\r\n<b>DAY 6.</b> Departure to Cayo Coco Airport to take a flight to Holguin. City hotel accommodation<br><br>\r\n<b>HOLGUIN - BIRÁN - HOLGUÍN</b><br>\r\n<b>DAY 7.</b> Breakfast. Departure to Historic Biran, the birthplace of the Commander in Chief of the Cuban Revolution, Fidel Castro. Tour and tasting of a cocktail at the Mirador de Mayabe, which is on top of a hill. Like a natural balcony, it shows of the most beautiful and lavish landscapes of eastern Cuba. Lunch a local restaurant.Then a tour of the city of Holguin known as the City of Parks. with a visit to the Museum of Periquera. City hotel accommodation.<br><br>\r\n<b>HOLGUIN - CAJOBABO - BARACOA</b><br>\r\n<b>DAY 8.</b> Breakfast. Departure to Baracoa. In transit visit to Playita de Cajobabo. This site, located on the southern coast of Guantanamo province in the municipality of Imías with a coast to the Caribbean Sea and 3 km east of the town of Cajobabo, is among the first spots that mark the path of José Marti in the 1895 War. His remains were declared a National Monument on May 19, 2003. Continue to Baracoa. Walking tour of the city, the first village founded by the Spaniards in America and the first capital of the island of Cuba, which holds in the church of Our Lady of Conception, La Cruz de la Parra (the cross vinewood) brought by Christopher Colombus. It is considered the oldest symbol of the Christian religion in Cuba. Visit the Fort Matachín Municipal Museum. Tour around the cocoa trail. Visit Rancho Toa with lunch and cayucas ride. Baracoa hotel accommodations.<br><br>\r\n<b>BARACOA – SANTIAGO DE CUBA – HOLGUÍN - HAVANA</b><br>\r\n<b>DAY 9.</b> Breakfast. Departure to the city of Santiago de Cuba, one of the most Caribbean Cuban cities, which holds immense historical and cultural heritage. Tour of the historic city center. Visit the Santa Ifigenia Cemetery, where Cuba\'s National Hero José Martí and our Commander in Chief Fidel Castro, leader of the Cuban Revolution are buried. Visit the Historical July 26th Museum and sightseeing tour of local landmarks. Departure to the Castillo de San Pedro de la Roca del Morro, tour and lunch at the Restaurant El Morro. Then depart to Holguin with a Visit the Loma de la Cruz with dinner at the place where you can enjoy one of the most impressive night views in the city of Holguin. Departure to Holguin Frank Pais Airport to take a flight back to Havana with a transfer to the hotels. Accommodation (<b>by the T.O.<b>)', '0', 14, '1', '0', '1');
